INSERT INTO `blogs` VALUES (1,1,1,'Our first blog!','test','<p>Thank you for checking out our very first blog on ganjaroad.com! &nbsp;We are a bit new to the blog community so please bear with us while we get the hang of it.</p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div><p>Craig and I have been working on this site for a few years now and are almost ready to officially launch! &nbsp;We believe that the timing worked out perfectly with the current worldwide cannabis climate. &nbsp;It has never been so accepted by the mainstream in our recent history. &nbsp;With the general election in November putting cannabis measures on the ballot in many more states, we are closer than ever to legalization nationwide. &nbsp;</p><p>Our aim is to bring together a user to user community, similar to craigslist\'s classifieds, where users can post and search for anything related to the cannabis industry. &nbsp;In addition we are offering a user-friendly and less expensive way for providers to advertise their storefronts, delivery services, and doctors. &nbsp;The name Ganjaroad pretty much speaks for itself!</p><p>We sincerely appreciate all of you that are helping us in this first phase of the site. &nbsp;We are confident that soon ganjaroad.com will be a valuable tool for this entire budding industry.</p><p>-Charlice &amp; Craig</p>','','','','RnkPT1rBce.jpg',157,1,'2016-08-25 00:00:00','2020-09-30 05:05:05','2016-07-17 09:41:27','2017-04-27 12:34:09','2017-04-27 12:34:09'),(2,2,1,'test','test-1','<p>testse estse tset<br></p>','','','',NULL,6,1,'0000-00-00 00:00:00','0000-00-00 00:00:00','2016-07-18 10:26:49','2016-09-22 19:19:40','2016-09-22 19:19:40'),(3,2,1,'asdf','asdf','<p>adsf<br></p>','','','','OC3giXhnzC.jpg',4,1,'0000-00-00 00:00:00','0000-00-00 00:00:00','2016-07-20 17:16:25','2016-09-22 19:19:45','2016-09-22 19:19:45'),(4,2,1,'asdf','asdf-1','<p>asdf<br></p>','','','',NULL,0,1,'2016-08-09 00:00:00','0000-00-00 00:00:00','2016-08-11 18:00:55','2016-09-22 19:19:50','2016-09-22 19:19:50'),(5,4,1,'Test News Topic - Mike','news-topic-1','<p>This is a test of a news item.<br><br></p>','','','',NULL,12,1,'2016-09-19 00:00:00','2016-12-07 00:00:00','2016-08-28 11:21:55','2016-09-21 23:55:54','2016-09-21 23:55:54'),(6,4,1,'California marijuana legalization would cause \'sea change\' in capital for cannabis startups','news-topic-2','<p>INC.- Should California decide to legalize recreational marijuana this election, it will cause a flood of venture capital to enter the market for cannabis startups, investors said Tuesday speaking at a conference for marijuana companies in Oakland.<br />\r\n</p>\r\n<div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div>\r\n<p>\r\n</p>\r\n<p><a href=\"http://www.inc.com/salvador-rodriguez/cannabis-venture-capital.html\" target=\"_blank\">Read Full Story&nbsp;on Inc.com</a><br />\r\n<br />\r\n<br />\r\n</p>','','','',NULL,55,1,'2016-09-21 00:00:00','2016-11-09 00:00:00','2016-08-28 11:21:55','2016-11-08 22:41:49',NULL),(7,4,1,'Campus researcher to study link between medical marijuana and opioid use','news-topic-3','<p><font color=\"#222222\" face=\"arial, sans-serif\"><span style=\"font-size: 16px;\">The Daily Californian (September 20, 2016) A UC Berkeley researcher and HelloMD — a digital healthcare platform specializing in medical cannabis — announced last Tuesday that they had teamed up to study the connection between medical marijuana and opioid use.</span></font><br></p><p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px;\"><a href=\"http://www.dailycal.org/2016/09/20/campus-researcher-study-link-medical-marijuana-opioid-use/\" target=\"_blank\">Read Full Story</a><br></span><br><br></p>','','','',NULL,2,1,'2016-09-21 00:00:00','2016-09-30 00:00:00','2016-08-28 11:21:55','2016-10-11 21:16:17','2016-10-11 21:16:17'),(8,4,1,'LA Times Editorial: Yes on Proposition 64','news-topic-4','<p><span style=\"font-family: \" times=\"\" new=\"\"  roman\";=\"\" font-size:=\"\"  medium;\"=\"\">Los Angeles Times -Six years ago California voters were asked to make recreational marijuana legal under state law and they declined to do so. But the close decision &#8212; 46% voted &#8220;yes&#8221; on Proposition 19 &#8212; suggested that the battle was not yet over. At that time, The Times opposed Proposition 19 not because legalization was necessarily a bad idea, but because it was a poorly drafted mess that would have created a regulatory nightmare.</span></p><p><span style=\"font-family: \" times=\"\" new=\"\"  roman\";=\"\" font-size:=\"\"  medium;\"=\"\"><a href=\"http://www.latimes.com/opinion/editorials/la-ed-proposition-64-20160918-snap-story.html\" target=\"_blank\">Read Full Story on latimes.com</a><br /></span><br /><br /></p>','','','',NULL,55,1,'2016-09-21 00:00:00','2016-11-08 00:00:00','2016-08-28 11:21:55','2016-11-07 12:31:40',NULL),(9,4,12,'Ganjaroad.com Launches at San Diego Growers\' Expo','ganjaroad-com-launches-at-san-diego-growers-expo','<div>Ganjaroad.com will be officially launching their new site to the public at the upcoming San Diego Growers\' Expo on October 29, 2016 at Liberty Station in San Diego, California.<div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div> Sponsored by the Association of Cannabis Growers, Oaksterdam University and Calfironia Growers Association, this event is a great opportunity for growers, businesses offering grow supplies and other products as well as Ganjaroad.com to gain knowledge and exposure.</div>\r\n<div>&nbsp;</div>\r\n<div><a href=\"http://www.sdgrowersexpo.com\" target=\"_blank\">Go to the San Diego Growers\' Expo site for more info&nbsp;</a></div>','','','',NULL,50,1,'2016-10-03 00:00:00','2016-10-30 00:00:00','2016-10-03 21:41:38','2016-10-29 18:14:47',NULL),(10,4,12,'Study: Medical Cannabis Not Being Diverted, or Being Used by Kids','study-medical-cannabis-not-being-diverted-or-being-used-by-kids','Ganjapreneur.com -According to a study published in the Drug and Alcohol Dependence journal, children who live in states with medicinal marijuana programs are not more likely to use cannabis. The study did find, however, that people over the age of 25 did use the drug more after the laws were enacted.<br /><br /><a href=\"https://www.ganjapreneur.com/study-medical-cannabis-not-diverted-used-kids/\" target=\"_blank\">Read More at Ganjapreneur.com</a>','','','',NULL,39,1,'2016-10-26 00:00:00','2016-11-30 00:00:00','2016-10-26 23:10:48','2016-11-27 13:56:24',NULL),(11,4,12,'Controversial Question: Is Pot Part of the Answer to the Heroin Epidemic?','controversial-question-is-pot-part-of-the-answer-to-the-heroin-epidemic','FOX8 - One week after seven additional states legalized some form of marijuana use, a controversial question is now getting more serious attention.<br /><br />And that is: with so many people now dying from addictions to opiate painkillers (about 47,000 nationwide this year alone, and close to 700 just in Cuyahoga County), should we be looking more closely at marijuana as a possible alternative for treating pain?<br /><br /><div>\"This isn\'t some stoner stereotype about \'getting high man\'\", says 38 year-old Bob Ellison, \"this saved my life.\"</div><div>&nbsp;</div><div><a href=\"http://fox8.com/2016/11/17/controversial-question-is-pot-part-of-the-answer-to-the-heroin-epidemic/\" target=\"_blank\">Read the Full Story on FOX8.com</a>&nbsp;</div>','','This is a news story on ganjaroad.com.','news, marijuana, opiates, cannabis, weed, fox8.com,treatment',NULL,34,0,'2016-11-18 00:00:00','2017-01-31 00:00:00','2016-11-19 01:02:31','2017-01-19 22:55:36',NULL),(12,4,12,'What is Next for New Recreational Marijuana States?','what-s-next-for-new-recreational-marijuana-states','MG News -Last week, voters in four states approved measures to legalize the recreational use of marijuana. However, we do not simply go from the ballot to the dispensary overnight. Below is a breakdown of how the new laws impact residents both today and in the future.&nbsp;Read More at MGretailer.com&nbsp;','','This is a news story featured on ganjaroad.com.','recreational, marijuana, cannabis, weed, legalized, legal, ganjaroad, craigs, laws,mgretailer.com,prop 64',NULL,42,0,'2016-11-18 00:00:00','2017-01-31 00:00:00','2016-11-19 01:11:04','2017-01-19 23:23:54',NULL),(13,4,12,'Proposition 64: San Diego must prep for new marijuana era','proposition-64-san-diego-must-prep-for-new-marijuana-era','<div>San Diego Union Tribune -What does marijuana legalization mean for San Diegans? Under state law, it is now legal for adults to possess up to an ounce of marijuana and to grow up to six marijuana plants. That part of the ballot measure, Proposition 64, has already gone into effect. But if you were thinking about buying some marijuana to stimulate your Thanksgiving appetite, you&#8217;re out of luck.</div><div>&nbsp;</div><div><a href=\"http://www.sandiegouniontribune.com/opinion/commentary/sd-marijuana-legalization-kreit-20161125-story.html\" target=\"_blank\">Read More at Sandiegouniontribune.com</a>&nbsp;</div>','','This news article by the San Diego Union Tribune on ganjaroad.com describes what legalization means for San Diegans.','San Diego, News, Marijuana, Weed, Cannabis, recreational, medical, Ganjaroad, craig\'s, craigs,sandiegouniontribune.com,prop 64',NULL,32,1,'2016-11-30 00:00:00','2017-01-31 00:00:00','2016-11-30 22:37:56','2017-01-29 22:03:38',NULL),(14,1,1,'test','test-1','test test','','','',NULL,0,0,NULL,NULL,'2017-01-17 20:09:59','2017-01-17 20:10:07','2017-01-17 20:10:07'),(15,1,14,'Marijuana Is Legal In The Golden State Now','marijuana-is-legal-in-the-golden-state-now','Test test test','','','',NULL,0,0,NULL,NULL,'2017-01-17 20:30:38','2017-01-17 20:30:47','2017-01-17 20:30:47'),(16,4,12,'Legal and Illegal North American Cannabis Sales Outpace Starbucks, McDonalds in 2016','legal-and-illegal-north-american-cannabis-sales-outpace-starbucks-mcdonald-s-in-2016','<div>Ganjapreneur.com -Total combined sales for legal and illegal cannabis sales in North America reached $53.3 billion last year, more than Starbucks and McDonald&#8217;s combined, according to Arcview Market Research figures outlined by Business Insider. Illegal sales made up 87 percent of total cannabis sales in 2016, down from 90 percent the year prior. The legal market gained 30 percent from 2015, earning $6.7 billion in North America last year.</div><div>&nbsp;</div><div>Read More at <a href=\"https://www.ganjapreneur.com/legal-illegal-north-american-cannabis-sales-outpace-starbucks-mcdonalds-2016/\" target=\"_blank\">Ganjapreneur.com&nbsp;</a></div>','https://www.ganjapreneur.com/legal-illegal-north-american-cannabis-sales-outpace-starbucks-mcdonalds-2016/','','',NULL,30,1,'2017-01-19 00:00:00','2017-02-28 00:00:00','2017-01-19 22:32:20','2017-02-21 19:41:06',NULL),(17,4,12,'California Community College Planning to Offer Legal Cannabis Course','california-community-college-planning-to-offer-legal-cannabis-course','<div>Ganjapreneur.com -California&#8217;s City College of San Francisco is partnering with the United Food and Commercial Workers union and Oakland-based Oaksterdam University to develop a new course aimed at the legal cannabis industry, according to a report from the San Francisco Examiner.</div><div>&nbsp;</div><div>Read More at <a href=\"https://www.ganjapreneur.com/california-community-college-planning-offer-legal-cannabis-course/\" target=\"_blank\">Ganjapreneur.com&nbsp;</a></div>','https://www.ganjapreneur.com/california-community-college-planning-offer-legal-cannabis-course/','','',NULL,28,1,'2017-01-19 00:00:00','2017-02-28 00:00:00','2017-01-19 22:50:40','2017-02-22 18:10:36',NULL),(18,1,49,'Marijuana Is Legal In The Golden State Now','marijuana-is-legal-in-the-golden-state-now','<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;line-height:115%;font-family:\r\nHelvetica;mso-fareast-font-family:Verdana;mso-bidi-font-family:Verdana\">As of\r\nJanuary 1, 2017, Proposition 64, passed back in November, makes recreational\r\nmarijuana legal in the state of California. The Golden State joins Alaska,\r\nColorado and Washington State in legalizing marijuana for recreational use but\r\nwhat does that mean for pot lovers right now?</span><span style=\"font-family:\r\nHelvetica\"><o:p></o:p></span></p><p align=\"center\" style=\"text-align: left;\"><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div></p><p><span style=\"font-size:12.0pt;115%;font-family: Helvetica;Verdana;Verdana\">First, you still need to purchase your product from a licensed marijuana dispensary which means you still need a medical marijuana card in order to do so. The state is still working out how recreational marijuana will be sold and that isn&#8217;t likely to be resolved until later in the year so for now it is going to seem like not much has changed even though quite a bit has. </span></p>    <p><span style=\"font-size:12.0pt;115%;font-family: Helvetica;Verdana;Verdana\">Another option for you to get cannabis is you can begin to grow plants. You&#8217;re allowed up to six plants in your home for personal use and, because it&#8217;s now legal, you can freely and openly discuss the ins and outs of exactly how to grow pot with folks at hydroponics gardening stores without either of you jeopardizing breaking any laws. </span></p>    <p><span style=\"font-size:12.0pt;115%;font-family: Helvetica;Verdana;Verdana\">Obviously, you can&#8217;t drive impaired or in the process of ingesting or smoking cannabis, and you can only legally carry up to 28.5 - about an ounce - on you at any time. You also aren&#8217;t permitted to smoke in public places and must be at least 21 years old.</span><span style=\"font-size: 12px;\">&nbsp;</span></p><div><span style=\"font-size:12.0pt;115%;font-family: Helvetica;Verdana;Verdana\">But cannabis aficionados can come out of the closet and rejoice because the future is here and 2017 means you can indulge legally even if you suffer from no pesky health issues that only medicinal marijuana can help you with. Ganjaroad.com is a cannabis advertising platform that will help connect you with cannabis industry professionals so you may get your questions about cannabis answered. R</span><span style=\"font-size:12.0pt;115%;font-family:Helvetica; &quot;Times New Roman&quot;;&quot;Times New Roman&quot;;color:windowtext\">etail shops in California aren\'t scheduled to open until January 2018, but for now you can find (as well as place an ad for) doctors, dispensaries, and delivery services to get cannabis for medical purposes on our site. </span></div>\r\n<p><span style=\"font-size:12.0pt;115%;font-family: Helvetica;&quot;Times New Roman&quot;;&quot;Times New Roman&quot;; color:windowtext\">Search or </span><span style=\"font-size:12.0pt;115%;font-family: Helvetica;&quot;Times New Roman&quot;;&quot;Times New Roman&quot;; color:windowtext\"></span><a href=\"https://ganjaroad.com/login\" target=\"_self\" title=\"Marijuana Advertising in San Francisco, Los Angeles, San Diego, California with Ganjaroad.com - World\'s first global cannabis resource\r\n\"><span style=\"font-size:12.0pt;115%;font-family: Helvetica;&quot;Times New Roman&quot;;&quot;Times New Roman&quot;; color:windowtext\">p</span><span style=\"font-size:12.0pt; 115%;font-family:Helvetica;Verdana; Verdana\">lace your classified ad on ganjaroad.com</span></a><span style=\"font-size:12.0pt; 115%;font-family:Helvetica;Verdana; Verdana\"> </span><span style=\"font-size:12.0pt; 115%;font-family:Helvetica;Verdana; Verdana\">today</span><span style=\"font-size:1