ijuana. CBD, or Cannabidiol, doesn&#8217;t induce a user to &#8220;get high&#8221; but has been shown to produce some positive results in some users and shows promise in positively affecting seizures.</span></div>\r\n<p style=\"15.0pt\"><span style=\"font-size:12.0pt;115%;font-family:Verdana;Verdana;Verdana\">In an article on <a href=\"http://www.epilepsy.com/learn/treating-seizures-and-epilepsy/other-treatment-approaches/medical-marijuana-and-epilepsy\" target=\"_blank\" title=\"Small clinical studies from a number of years ago suggests that cannabidiol could potentially be helpful in controlling seizures.\">Epilepsy.com</a> they write:</span></p>\r\n<p style=\"20.0pt\"><em><span style=\"font-size:12.0pt;115%;font-family:Verdana;Verdana;Verdana\">&#8220;Evidence from laboratory studies, anecdotal reports, and small clinical studies from a number of years ago suggests that cannabidiol, a non-psychoactive compound of cannabis, could potentially be helpful in controlling seizures. However, there are conflicting reports in the literature. So far, scientifically controlled studies have not shown definitive proof of the effectiveness and safety of marijuana or cannabis in epilepsy<strong>.</strong> For example, in 2012, a literature review of clinical studies on </span></em><a href=\"http://www.ncbi.nlm.nih.gov/pubmed/24595491\"><em><span style=\"font-size:12.0pt;115%;font-family:Verdana;Verdana;Verdana;color:windowtext; none;\">cannabinoids for epilepsy</span></em></a><em><span style=\"font-size:12.0pt; 115%;font-family:Verdana;Verdana; Verdana\"> could not give a reliable conclusion about the effectiveness of four randomized controlled trials of cannabidiol. Yet in the 48 people included in these reports, no side effects were noted.&#8221; </span></em></p>\r\n<p style=\"20.0pt\"><span style=\"font-size:12.0pt;115%;font-family:Verdana;Verdana;Verdana\">The Weed Blog reported on an incident captured on video by a television crew doing a report on the use of cannabis to treat patients who suffer seizures. A mother was being interviewed when her son actually began to have a seizure. The crew filmed as she grabbed a cannabis nasal spray and administered it to her ailing son. Within moments he was on his feet. </span></p>\r\n<p style=\"20.0pt\"><span style=\"font-size:12.0pt;115%;font-family:Verdana;Verdana;Verdana\"><a href=\"https://www.theweedblog.com/life-saving-effect-cannabis-seizures-captured-news-crew/ \" target=\"_blank\" title=\"Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis related dispensaries, doctors, delivery, classified, news, information.\r\n\">The Weed Blog</a> writes:</span></p>\r\n<p style=\"20.0pt\"><span style=\"font-size:12.0pt;115%;font-family:Verdana;Verdana;Verdana\">&#8220;The rapidity with which is medical takes effect is astounding. Just moments after inhaling the cannabis spray, you can see the medication take effect&#8230;&#8221; </span></p>\r\n<p style=\"20.0pt\"><span style=\"font-size:12.0pt;115%;font-family:Verdana;Verdana;Verdana\">The video captured by WFTS TV in Tampa can be viewed </span><a href=\"http://www.abcactionnews.com/news/health/exclusive-cannabis-nasal-spray-stops-epileptic-seizure-in-its-tracks\"><span style=\"font-size:12.0pt;115%;font-family:Verdana; Verdana;Verdana;color:#1155CC\">here</span></a><span style=\"font-size:12.0pt;115%;font-family:Verdana; Verdana;Verdana\">. </span></p>\r\n<p style=\"20.0pt\"><br />\r\n</p>\r\n<p><span style=\"font-size: 12pt; font-family: Verdana;\"><a href=\"https://ganjaroad.com/login\" target=\"_self\" title=\"Marijuana Advertising in San Francisco, Los Angeles, San Diego, California with Ganjaroad.com - World\'s first global cannabis resource\r\n\">Ganjaroad.com</a> is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes.</span></p>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis related dispensaries, doctors, delivery, classified, news, information.\r\n','Marijuana seizures, ganjaroad, San Franciscso marijuana doctor, San Diego cannabis, Los Angeles Dispensaries, California Cannabis Doctors\r\n','66aZGnGKQ2.png',278,1,'2017-01-30 00:00:00',NULL,'2017-01-21 19:12:42','2017-02-23 00:02:57',NULL),(20,1,49,'Cannabis Dispensaries Still Require Medical Marijuana Cards','cannabis-dispensaries-still-require-medical-marijuana-cards','<style>  </style>       <p align=\"center\" style=\"text-align: left;\"><span style=\"font-family: Verdana; font-size: 12pt;\">California state cannabis regulators have promised that formal licensing will be ready to go by January of 2018. As part of both <a href=\"https://en.wikipedia.org/wiki/Adult_Use_of_Marijuana_Act\" target=\"_blank\" title=\"Cannabis Dispensaries Still Require Medical Marijuana Cards\">Proposition 64</a> - legalizing recreational marijuana use - and the <a href=\"http://bmcr.ca.gov/laws_regs/index.shtml\" target=\"_blank\" title=\"Medical Cannabis Regulation and Safety Act\">Medical Cannabis Regulation and Safety Act (MSRSA)</a> which was signed into law by Governor Jerry Brown, next January the state must have a licensing system in place for companies wanting to operate legally.</span></p>  <p style=\"20.0pt\"><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div>&nbsp;</p><div><span style=\"font-size:12.0pt;115%;font-family:Verdana;Verdana;Verdana\">In the interim, dispensaries are operating as they have been for the last several years, requiring a medical marijuana card for purchase. There are some reports of dispensaries already selling recreational cannabis by only requiring an identification proving buyers are over the age of 21 but that is not the norm and may be in violation of the law. </span></div>  <p style=\"20.0pt\"><span style=\"font-size:12.0pt;115%;font-family:Verdana;Verdana;Verdana\">As a buyer, it is best to stick to getting your medical marijuana card until next year when you can walk into a dispensary with only your identification and purchase marijuana even if you are not suffering from an ailment. </span></p>  <p style=\"20.0pt\"><span style=\"font-size:12.0pt;115%;font-family:Verdana;Verdana;Verdana\">For more information on the details of the law visit the links below</span></p>  <h1 style=\"24.0pt;widow-orphan;page-break-after:auto\"><span style=\"font-size:12.0pt;115%; font-family:Verdana;Verdana;Verdana\"><a href=\"https://mjbizdaily.com/california-regulators-promise-timely-licensing-for-industry/\" target=\"_blank\" title=\"Marijuana Business Daily News\">California MJ regulators promise timely licensing for industry</a></span></h1>  <p style=\"20.0pt\"><br /></p>  <h1 style=\"24.0pt;widow-orphan;page-break-after:auto\"><span style=\"font-size:12.0pt;115%; font-family:Verdana;Verdana;Verdana\"><a href=\"http://www.sacbee.com/news/state/california/california-weed/article127368214.html\" target=\"_blank\" title=\"Article from the Sacramento Bee, California\">California&#8217;s pot czar on upcoming marijuana regulation: &#8216;We will not fail&#8217;</a></span></h1>  <p style=\"20.0pt\"><br /></p>    <p><span style=\"font-size:12.0pt;115%;font-family: Verdana;Verdana;Verdana\">Ganjaroad.com is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes.</span></p>    <p><br /></p>    <p><br /></p>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana Cards, ganjaroad, San Franciscso marijuana doctor, San Diego cannabis, Los Angeles Dispensaries, California Cannabis Doctors','nxN48BA913.JPG',328,1,'2017-01-31 09:10:00',NULL,'2017-01-30 18:33:04','2017-02-21 20:10:43',NULL),(21,1,49,'Edible Marijuana is... Different than Smoking','edible-marijuana-is-different-than-smoking','<style> </style>\r\n<p align=\"center\" style=\"text-align: left;\"><span style=\"font-family: Verdana; font-size: 12pt;\">With recreational and medicinal cannabis becoming legal in California and <a href=\"http://www.thecannabist.co/2016/10/14/legal-marijuana-laws-by-state-map-united-states/62772/\" target=\"_blank\" title=\"Edible Marijuana is Different than Smoking Cannabis\">an increasing number of places around the country</a>, even some avid marijuana users are unfamiliar with ways to use cannabis in your cooking and why you would choose to do that rather the old tried and true method of smoking.</span></p>\r\n<p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div>&nbsp;</p><div><span style=\"font-size:12.0pt;115%;font-family: Verdana;Verdana;Verdana\">Eating marijuana does give you a high and by most accounts a bit of a different high than you get when smoking it because your body converts the THC differently with each method. </span></div>\r\n<p><span style=\"font-size:12.0pt;115%;font-family: Verdana;Verdana;Verdana\">A big difference in how your body reacts and processes marijuana differently with smoking versus eating it comes in the time that passes before the effects of the THC take hold. When smoking the &#8220;high&#8221; can occur as quickly as within seconds or up to several minutes and can last one to three hours in most people. However, eating marijuana might take a half hour to 90 minutes before any real effect takes place. Once a feeling of being high sets in that can last much longer than smoking usually does - between three and seven hours. </span></p>\r\n<p><span style=\"font-size:12.0pt;115%;font-family: Verdana;Verdana;Verdana\">Because the high last longer when ingesting cannabis, this makes it good for those who use marijuana to relieve pain or curb long lasting muscle spasms. </span></p>\r\n<p><span style=\"font-size:12.0pt;115%;font-family: Verdana;Verdana;Verdana\">A good tip even for those experienced at eating marijuana is to ingest a small serving and wait about an hour before deciding whether to eat more. Edibles are notoriously hard to measure the potency so you want to make sure you don&#8217;t overdo it. </span></p>\r\n<p><span style=\"font-size:12.0pt;115%;font-family: Verdana;Verdana;Verdana\"><a href=\"http://herb.co/2016/03/18/8-tips-for-getting-the-right-dose-with-edibles/\" target=\"_blank\" title=\"Cannabis Edibles in California\">HERB.com</a> has a great article on how to get the dosage right in your edibles.&nbsp;</span></p>\r\n<p><span style=\"font-size:12.0pt;115%;font-family: Verdana;Verdana;Verdana\"><a href=\"https://mic.com/articles/141413/weed-edibles-are-just-a-better-way-to-get-high-here-s-the-science-behind-why#.NsWbBTMWV\" target=\"_blank\" title=\"Check out how edibles get you stoned\">MIC.com</a> wrote a great article that you may want to check out: \"<span style=\"background:white;white\">Weed Edibles Are Just a Better Way to Get High &#8212; Here\'s the Science Behind Why.\"</span></span></p>\r\n<p><br />\r\n</p>\r\n<p><span style=\"font-size:12.0pt;115%;font-family: Verdana;Verdana;Verdana\"><a href=\"https://ganjaroad.com/register\" target=\"_self\" title=\"Create an account and start advertising today!\">Ganjaroad.com</a> is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes.</span></p>\r\n<p><br />\r\n</p>\r\n<p><br />\r\n</p>','','Find San Francisco and Los Angeles cannabis edibles on ganjaroad.com, the most reliable online resource to find cannabis related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana Edibles, ganjaroad, San Franciscso marijuana edibles, San Diego cannabis edibles, Los Angeles Dispensaries, California Cannabis Doctors','XcXswpmN06.JPG',324,1,'2017-02-07 18:43:00',NULL,'2017-01-30 18:43:02','2017-02-23 00:02:47',NULL),(22,1,49,'Fun Edible Marijuana Recipes','fun-edible-marijuana-recipes','<h2>\r\n<div>\r\n<div>How about a cannabis twist on the old brunch standby for those nursing a hangover - The Cannabis Infused Bloody Mary - BLOODY MARY JANE.\r\n</div>\r\n<p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div><br />\r\n</p>\r\n<div>According to <a href=\"https://originalweedrecipes.com/\">OriginalWeedRecipes.com</a> here are the ingredients you will need:</div><div><div title=\"Print Page Break\">&nbsp; </div>&nbsp;</div>\r\n<div><strong> </strong><strong>BREAKFAST - MORNING</strong></div>\r\n<ul>\r\n     <li>1/2 fl oz/15 ml vodka/ cannabis tincture</li>\r\n     <li>Three dashes Worcestershire sauce (if you\'re vegan, make the substitute accordingly)</li>\r\n     <li>5fl oz/150ml tomato juice</li>\r\n     <li>3 drops Tabasco sauce</li>\r\n     <li>1 Tbsp lemon juice</li>\r\n     <li>Lemon twist, salt and pepper and celery stalk are all optional.</li>\r\n     <li>Other things that you need</li>\r\n     <li>A shaker&#8211; any closed container will suffice</li>\r\n     <li>A tall glass</li>\r\n</ul>\r\n<div>They go on to say &#8220;as this is a cannabis-infused drink, you first need to know how to make the cannabis alcohol tincture. The THC (the main psychoactive chemical in cannabis) cannot be accessed by the body in the form it is, that&#8217;s why it needs to be extracted into alcohol.&#8221; </div>\r\n<div>It is a bit of work but well worth it. To read the entire process of making fantastic <a href=\"http://www.originalweedrecipes.com/bloody-mary-janes/\">Bloody Mary Janes go to their website</a>. </div>\r\n<div></div>\r\n<div><strong>LUNCH SNACK</strong></div>\r\n<div>MAC-N-CHEESE </div>\r\n<div>Before you get too far into the world of edibles you are going to want to learn about various cannabis extracts. <a href=\"http://herb.com/\">Herb.com</a> talks explains one popular extract butter. &#8220;Cannabutter is a primary ingredient in many cannabis-infused recipes or edibles. Known as an &#8216;extraction&#8217; because the THC &#8211; the psychoactive part of cannabis that gets you high &#8211; is extracted from the cannabis and infused with the butter. The butter from a normal recipe is then substituted with cannabutter.&#8221; </div>\r\n<div>Obviously you will be able to use this butter substitute in any recipe calling for butter so why not try it with any marijuana lovers favorite - 20 MINUTE MAC-N-CHEESE. </div>\r\n<div>Again from <a href=\"http://herb.com/\">Herb.com</a>: &#8220;Macaroni and cheese is a good go-to when you&#8217;re feeling a little under the weather. This recipe calls for Cheddar, but it&#8217;s also tasty with other cheeses. You can also add some chopped cooked broccoli or other vegetables to the dish once the cheese has melted.&#8221; </div>\r\n<div>Ingredients </div>\r\n<ul>\r\n     <li>8 ounces macaroni</li>\r\n     <li>1&#8260;4 cup (1&#8260;2 stick) butter</li>\r\n     <li>2 teaspoons <a href=\"http://herb.co/cannabutter/\">cannabutter</a></li>\r\n     <li>3 tablespoons all-purpose flour</li>\r\n     <li>1&#8260;4 teaspoon salt</li>\r\n     <li>1&#8260;4 teaspoon freshly ground black pepper 2 cups whole milk</li>\r\n     <li>2 cups shredded Cheddar cheese</li>\r\n</ul>\r\n<div>Read the entire recipe and preparation on <a href=\"http://herb.co/recipes/easy-macaroni-cheese/\">Herb.com</a>. </div>\r\n<div><a href=\"http://ganjaroad.com/\">Ganjaroad.com</a> is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes. </div>\r\n<div></div>\r\n<div></div>\r\n</div>\r\n</h2>\r\n<div></div>','','Connect with California Dispensaries on ganjaroad.com, the most reliable online resource to find cannabis related edibles, doctors, deliveries, classified ads, information, and news.','Marijuana Edibles, ganjaroad, San Franciscso marijuana edibles, San Diego cannabis edibles, Los Angeles Dispensaries, California Cannabis Doctors','BN5xPvNr0W.jpg',377,1,'2017-02-10 00:00:00',NULL,'2017-01-30 19:02:04','2017-02-28 20:09:20',NULL),(23,4,12,'CALIFORNIA COULD SEE MARIJUANA ADS START POPPING UP LIKE WEEDS ','california-could-see-marijuana-ads-start-popping-up-like-weeds','Take Two - Go online and you\'ll see advertisements for cannabis products and growers on websites across the internet. There\'s a possibility ads could pop up all over the place in real life, including in magazines, on television and on billboards.<br />\r\n<br />\r\nCurrently, there\'s no law in Los Angeles or in California preventing advertisements for marijuana companies from popping up everywhere. There are, however, advertising and marketing regulations built into Proposition 64, which passed in November. <br />\r\n<br />\r\n<a href=\"http://www.scpr.org/programs/take-two/2017/01/27/54704/highq-california-could-see-marijuana-ads-start-pop/\" target=\"_blank\">Read More at Take Two</a>','http://www.scpr.org/programs/take-two/2017/01/27/54704/highq-california-could-see-marijuana-ads-start-pop/','Read the Take Two/High-Q article on California marijuana businesses advertising and prop 64 regulations on Ganjaroad.com. Los Angeles medical marijuana. San Francisco cannabis.','marijuana,dispensaries,doctors,delivery,grow stores,classified ads,news,information,Ganjaroad,Cannabis,hydroponics',NULL,42,1,'2017-02-01 00:00:00','2017-04-03 00:00:00','2017-02-01 15:00:26','2017-02-22 20:19:12',NULL),(24,1,49,'Cannabis for Depression Relief?','cannabis-for-depression-relief','<p>Cannabis has long been argued to offer relief from a number of ailments and disease. One such ailment that marijuana users have long claimed cannabis helps is anxiety and depression. Though this &#8220;evidence&#8221; is merely anecdotal, the fact is cannabis has a long history of being used to treat disorders like depression and anxiety.</p>\r\n<p><span style=\"font-size: 12px;\"></span></p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div><div>&nbsp;</div><div>Dating back more than 400 years, cannabis was used in India for stress relief as well as a treatment for depression and anxiety. The practice spread throughout Asia, Africa, and the Middle East. The strains of marijuana with higher levels of CBD (Cannabidiol) proved to be effective in medicinal use. As the practice spread to America, there was also a call by users to get more of the &#8220;high&#8221; which came from the THC level. Thus, growers began to develop strains with higher levels of THC and lower levels of CBD.</div><p>&nbsp;</p>\r\n<p>Marijuana, hemp, cannabis, were used in the United States for both recreational and medicinal reasons for hundreds of years. It wasn&#8217;t until 1937 that marijuana was actually federally outlawed. </p>\r\n<p>Since then, medicinal marijuana proponents have continued to assert the many benefits and studies in recent years seem to support the claims. In part, this may be why we are seeing a shift in laws across the nation for both medical and recreational marijuana. </p>\r\n<p>One such <a href=\" http://www.buffalo.edu/news/releases/2015/02/004.html\" target=\"_blank\" title=\"Cannabis Research Study Buffalo University\">study</a> was conducted by scientists at Buffalo University. </p>\r\n<p><em>&#8220;Scientists at the University at Buffalo&#8217;s Research Institute on Addictions (RIA) are studying chronic stress and depression, with a focus on endocannabinoids, which are brain chemicals similar to substances in marijuana.</em></p>\r\n<p><em>The findings raise the possibility that components of marijuana may be useful in reducing depression that results from chronic stress.</em></p>\r\n<p><em>&#8216;In the animal models we studied, we saw that chronic stress reduced the production of endocannabinoids, leading to depression-like behavior,&#8217; says RIA senior research scientist Samir Haj-Dahmane, PhD.&#8221;</em></p>\r\n<p>If you suffer from depression or anxiety, how do you determine what type of cannabis to ingest or strains to smoke? <a href=\"http://allbud.com/\" target=\"_blank\">Allbud.com</a> has an interesting post that answers just that question - \"Ten Cannabis Strains for Defeating Depression.\"&nbsp;<a href=\"https://www.allbud.com/learn/story/ten-cannabis-strains-defeating-depression\" target=\"_blank\">Check out their article</a> and see if you can find these strains at your local dispensary.</p>\r\n<p><a href=\"http://ganjaroad.com/\" target=\"_blank\">Ganjaroad.com</a> is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes.</p>\r\n<p><br />\r\n</p>\r\n<p>Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.</p>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.\r\n','Marijuana, ganjaroad, San Franciscso marijuana depression help, San Diego cannabis depression, Los Angeles Dispensaries, California Cannabis Doctors, does cannabis help anxiety\r\n','UVCpmGGx3D.jpg',343,1,'2017-02-17 00:00:00',NULL,'2017-02-16 18:44:18','2017-02-28 20:11:48',NULL),(25,1,49,'Cannabis for Newbies - Delivery Methods','cannabis-for-newbies-delivery-methods','<p>With laws beginning to pass all over the United States making medicinal and even recreational marijuana use legal, some folks might find themselves open to trying marijuana out for the first time for any number of reasons. Filmmaker Kevin Smith didn&#8217;t start using marijuana until he was 40 and now he is a huge advocate for it.</p>\r\n<p>There are four delivery methods for using marijuana and they all vary in terms of the effect they have on you. If this is your first time, just know that there each delivery method has its own pluses and minuses.&nbsp;<br /></p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div>\r\n\r\n<h2>SMOKING</h2>\r\n<p>This is what most people think of when they picture a &#8220;stoner&#8221; or entertain the idea of using marijuana. It&#8217;s probably the easiest and most common delivery method for sure. The benefit of smoking is it is easy to control the dosage by simply limiting the amount you smoke, taking small doses to see how it impacts your system. The effects of a small amount of marijuana smoked shouldn&#8217;t last much more than a half hour. Start very slowly and pay attention to how you feel. The downside of smoking is that not everyone likes to smoke. If you have an aversion to smoke or you find it burns or is just uncomfortable, then the good news is you have other options.</p>\r\n<h2>VAPORIZING</h2>\r\n<p>This is probably the best bet for newbies. Like smoking, vaporizing is also easy to keep the dosage low and the effects are about the same. The flavor is usually better with vaporizing and it is easier on your throat and lungs. For that reason alone, many people prefer vaporizing. </p>\r\n<h2>INGESTING (aka Edibles)</h2>\r\n<p>Edibles are great for newbies but be warned - the effects take a while before they kick in so overdoing it is much more likely. For this reason, start very slowly. Take very small amounts. It can take an hour or two for you to feel anything but once you do the effects tend to last much longer than smoking or vaporizing, which is another reason you want to be careful not to ingest too much. </p>\r\n<h2>TOPICALS</h2>\r\n<p>For folks who want to treat localized symptoms of pain or inflammation, there are cannabis-infused lotions that are available as a delivery method for the medicinal benefits. </p>\r\n<p>Cannabis effects vary from person to person. Some people use cannabis to relax and unwind, some people use it for chronic pain, still others will use it for anxiety. There are many symptoms the cannabis plant can alleviate (too numerous to name them all here!). The delivery method, the person&#8217;s metabolism, as well as the plant species will all be determining factors in the effectiveness of the medicinal effects. Start slowly, consult with health professionals and qualified dispensary technicians who can guide you towards getting the best results for treating what ails you.</p>\r\n<div>___________&nbsp;</div>\r\n<p><a target=\"null\">Ganjaroad.com </a>is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors, and delivery services to acquire cannabis for medicinal purposes.</p>\r\n<p><br />\r\n</p>\r\n<p><br />\r\n</p>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','ESpnMqcpPr.jpg',257,1,'2017-02-27 00:00:00',NULL,'2017-02-27 18:47:35','2017-02-28 10:29:06',NULL),(26,4,12,'Officials in Legalized States Vow to Fight Feds Over \'Greater Enforcement\' of Cannabis Laws','officials-in-legalized-states-vow-to-fight-feds-over-greater-enforcement-of-cannabis-laws','<div><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div></div><div>Ganjapreneur.com -&nbsp;Lawmakers and officials in states with adult-use cannabis laws are speaking out against the enforcement of federal drug laws following comments last week by White House Press Secretary Sean Spicer hinting at &#8220;greater enforcement&#8221; of federal law in those states.</div><div><a href=\"https://www.ganjapreneur.com/officials-in-legal-cannabis-states-vow-to-fight-feds-over-greater-enforcement-of-federal-law/\" target=\"_blank\">Read More at Ganjapreneur.com</a> &nbsp;</div>','https://www.ganjapreneur.com/officials-in-legal-cannabis-states-vow-to-fight-feds-over-greater-enforcement-of-federal-law/','Read the Ganjapreneur.com article by TG Branfalt on Ganjaroad.com about state officials speaking out against the federal call for greater enforcement of marijuana laws.','marijuana,dispensaries,doctors,delivery,grow stores,classified ads,news,information,Ganjaroad,Cannabis,hydroponics\r\n',NULL,33,1,'2017-02-28 00:00:00','2017-03-31 00:00:00','2017-02-28 16:02:25','2017-02-28 16:09:11',NULL),(27,4,12,'Poll: Majority of Americans Support Cannabis Reforms','poll-majority-of-americans-support-cannabis-reforms','<p> Ganjapreneur.com -&nbsp;According to a February 23 Quinnipiac poll, support for legalized cannabis is at an all-time high. An eye-popping 93 percent of respondents indicated support for medical cannabis programs, while 59 percent supported legalizing cannabis for adult use nationally, with another 71 percent opposed to the federal government enforcing federal law in states with either medicinal or recreational regimes.\r\n</p>\r\n<div><a href=\"https://www.ganjapreneur.com/poll-majority-of-americans-support-cannabis-reforms/\" target=\"_blank\">Read More at Ganjapreneur.com</a>&nbsp;\r\n<p>&nbsp;</p>\r\n<div>\r\n<div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div>\r\n&nbsp;</div>\r\n</div>','https://www.ganjapreneur.com/poll-majority-of-americans-support-cannabis-reforms/','Read an article by TG Branfalt on Ganjapreneur.com on Ganjaroad.com about the latest Cannabis support poll.','marijuana,dispensaries,doctors,delivery,grow stores,classified ads,news,information,Ganjaroad,Cannabis,hydroponics\r\n',NULL,51,1,'2017-02-28 00:00:00','2017-04-30 00:00:00','2017-02-28 16:24:14','2017-04-12 14:37:20',NULL),(28,1,49,'THE MARIJUANA MUNCHIES','the-marijuana-munchies','<p class=\"m_-4311725127581559377m_-2347242040462203313s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:2.04\"><span class=\"m_-4311725127581559377m_-2347242040462203313s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">Yes,\r\n it&#8217;s a cliche&#8217; to joke about getting the munchies after smoking pot but\r\n getting hungry after partaking in your favorite recreational pastime is\r\n a thing. It&#8217;s real. For patients undergoing chemotherapy or people \r\nencountering issues causing their appetite to wain, the munchies \r\nphenomenon is a welcome side effect but for people who want to enjoy \r\nmarijuana without gaining a few belt sizes it might cause some problems.\r\n So what should you do if you want to smoke marijuana without diving \r\ninto a bag of Doritos an hour later? <br /></span></span></p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div><p class=\"m_-4311725127581559377m_-2347242040462203313s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:2.04\"><span class=\"m_-4311725127581559377m_-2347242040462203313s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">First, a quick explanation of what is happening to your body - marijuana is a natural appetite stimulant.&nbsp;</span></span></p><p class=\"m_-4311725127581559377m_-2347242040462203313s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:2.04\"><font color=\"#000000\"><span style=\"background-color:rgba(255,255,255,0)\"><a href=\"http://www.smithsonianmag.com/science-nature/scientific-explanation-how-marijuana-causes-munchies-180949660/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.smithsonianmag.com/science-nature/scientific-explanation-how-marijuana-causes-munchies-180949660/&amp;source=gmail&amp;ust=1489597414819000&amp;usg=AFQjCNHl_nRwz8egAGNaCUrcJJVauwyufQ\"><span class=\"m_-4311725127581559377m_-2347242040462203313s5\" style=\"line-height:14.399999618530273px\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\">Smithsonian</span></span></a><span class=\"m_-4311725127581559377m_-2347242040462203313s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\">&nbsp;wrote about a study published in&nbsp;</span></span><a href=\"http://www.nature.com/articles/nn.3647.epdf?referrer_access_token=i2JyqDNhJJ2YFo6oHjCosNRgN0jAjWel9jnR3ZoTv0NQxWPI9YHXmbUngliv7Md3PaLCNGwghC0WfxwnCD7OvIQozGAitShddu4RX1eyFIVRZl2SQxE7P8y-2wtLytDgsS-EA6gET_UTxWN3fEslJjgDZCi1oJuCvCS7Gm-UTfgQXA9_L1ZEVpGW8reuevHa6TUB1M6svJ0LcEbrbsjNgGB10v1atnVdBJ4mcohu5qy9EFTZxHnKv9xQ44ogiGwxz59SCTKyAB_SFzzQqqRwCldAo-zGoXT5GpyzGgvvZTQ%3D&amp;tracking_referrer=www.smithsonianmag.com\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.nature.com/articles/nn.3647.epdf?referrer_access_token%3Di2JyqDNhJJ2YFo6oHjCosNRgN0jAjWel9jnR3ZoTv0NQxWPI9YHXmbUngliv7Md3PaLCNGwghC0WfxwnCD7OvIQozGAitShddu4RX1eyFIVRZl2SQxE7P8y-2wtLytDgsS-EA6gET_UTxWN3fEslJjgDZCi1oJuCvCS7Gm-UTfgQXA9_L1ZEVpGW8reuevHa6TUB1M6svJ0LcEbrbsjNgGB10v1atnVdBJ4mcohu5qy9EFTZxHnKv9xQ44ogiGwxz59SCTKyAB_SFzzQqqRwCldAo-zGoXT5GpyzGgvvZTQ%253D%26tracking_referrer%3Dwww.smithsonianmag.com&amp;source=gmail&amp;ust=1489597414819000&amp;usg=AFQjCNE6h7bNrxiCY_nHE75P191Pd4Oh-A\"><span class=\"m_-4311725127581559377m_-2347242040462203313s5\" style=\"line-height:14.399999618530273px\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\">Nature Neuroscience</span></span></a></span></font></p><p class=\"m_-4311725127581559377m_-2347242040462203313s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:2.04\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_-4311725127581559377m_-2347242040462203313s6\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\">&#8220;A team of European neuroscientists led by</span></span><a href=\"http://www.inb.u-bordeaux2.fr/dev/EN/researcher.php?researcher=Giovanni%20Marsicano&amp;id=125\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.inb.u-bordeaux2.fr/dev/EN/researcher.php?researcher%3DGiovanni%2520Marsicano%26id%3D125&amp;source=gmail&amp;ust=1489597414819000&amp;usg=AFQjCNGgOkJjrVXMGS31pxqrVJmDsQ0abA\"><span class=\"m_-4311725127581559377m_-2347242040462203313s6\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\">&nbsp;</span></span></a><a href=\"http://www.inb.u-bordeaux2.fr/dev/EN/researcher.php?researcher=Giovanni%20Marsicano&amp;id=125\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.inb.u-bordeaux2.fr/dev/EN/researcher.php?researcher%3DGiovanni%2520Marsicano%26id%3D125&amp;source=gmail&amp;ust=1489597414819000&amp;usg=AFQjCNGgOkJjrVXMGS31pxqrVJmDsQ0abA\"><span class=\"m_-4311725127581559377m_-2347242040462203313s7\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\">Giovanni Marsicano</span></span></a><span class=\"m_-4311725127581559377m_-2347242040462203313s6\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\">of the University of Bordeaux has found that, in mice, THC fits into receptors in the brain\'s</span></span><a href=\"http://en.wikipedia.org/wiki/Olfactory_bulb\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://en.wikipedia.org/wiki/Olfactory_bulb&amp;source=gmail&amp;ust=1489597414819000&amp;usg=AFQjCNETUsiaoA1N_13u5H1SDeTFWdOu7A\"><span class=\"m_-4311725127581559377m_-2347242040462203313s6\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\">&nbsp;</span></span></a><a href=\"http://en.wikipedia.org/wiki/Olfactory_bulb\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://en.wikipedia.org/wiki/Olfactory_bulb&amp;source=gmail&amp;ust=1489597414819000&amp;usg=AFQjCNETUsiaoA1N_13u5H1SDeTFWdOu7A\"><span class=\"m_-4311725127581559377m_-2347242040462203313s7\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\">olfactory bulb</span></span></a><span class=\"m_-4311725127581559377m_-2347242040462203313s6\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\">,\r\n significantly increasing the animals\' ability to smell food and leading\r\n them to eat more of it. A big part of the reason why you might eat more\r\n food after using marijuana, the research indicates, is simply that you \r\ncan smell and taste it more acutely.&#8221;</span></span></span></p><p class=\"m_-4311725127581559377m_-2347242040462203313s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:2.04\"><span class=\"m_-4311725127581559377m_-2347242040462203313s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">The\r\n study found that when testing mice who were genetically engineered so \r\nthat their sense of smell would not be stimulated by cannabis, they did \r\nnot experience signs of hunger when THC was given to them.&nbsp;</span></span></p><p class=\"m_-4311725127581559377m_-2347242040462203313s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:2.04\"><span class=\"m_-4311725127581559377m_-2347242040462203313s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">You\r\n can certainly make plans to load up on healthy snacks, as a \r\npreventative measure before smoking, hoping you will be disciplined \r\nenough to avoid the stuff in the cupboard that might lead to munchie \r\nremorse. But there is also another option. There are strains of \r\nmarijuana that are designed as appetite suppressants rather than \r\nstimulants. If you are concerned that you might be eating too many girl \r\nscout cookies or ordering pizza delivery right before bedtime, then talk\r\n to your dispensary about which strains they recommend. They are experts\r\n at this stuff and, while everyone has a different reaction to things, \r\nthey can likely recommend something that will satisfy your craving for a\r\n good high without increasing your pant size.&nbsp;</span></span></p><p class=\"m_-4311725127581559377m_-2347242040462203313s9\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_-4311725127581559377m_-2347242040462203313s8\" style=\"line-height:14.399999618530273px\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">LINKS</span></span></p><p class=\"m_-4311725127581559377m_-2347242040462203313s11\" style=\"margin-top:0px;margin-bottom:8px;line-height:1.32\"><font color=\"#000000\"><span style=\"background-color:rgba(255,255,255,0)\"><a name=\"m_-4311725127581559377_m_-2347242040462203313__a1wiq434jkrg\" style=\"width: 20px; height: 20px; text-indent: 20px; background-repeat: no-repeat; background-image: url(&quot;/assets/vendors/cuteeditor/Images/anchor.gif&quot;);\"></a><span class=\"m_-4311725127581559377m_-2347242040462203313s10\" style=\"line-height:14.399999618530273px\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px\"><a href=\"http://www.nature.com/articles/nn.3647.epdf?referrer_access_token=i2JyqDNhJJ2YFo6oHjCosNRgN0jAjWel9jnR3ZoTv0NQxWPI9YHXmbUngliv7Md3PaLCNGwghC0WfxwnCD7OvIQozGAitShddu4RX1eyFIVRZl2SQxE7P8y-2wtLytDgsS-EA6gET_UTxWN3fEslJjgDZCi1oJuCvCS7Gm-UTfgQXA9_L1ZEVpGW8reuevHa6TUB1M6svJ0LcEbrbsjNgGB10v1atnVdBJ4mcohu5qy9EFTZxHnKv9xQ44ogiGwxz59SCTKyAB_SFzzQqqRwCldAo-zGoXT5GpyzGgvvZTQ%3D&amp;tracking_referrer=www.smithsonianmag.com\">NATURE NEUROSCIENCE STUDY</a></span></span></span></font></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\"><a href=\"http://www.smithsonianmag.com/science-nature/scientific-explanation-how-marijuana-causes-munchies-180949660/\">SMITHSONIAN MAGAZINE</a></span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><font color=\"#000000\"><span style=\"background-color:rgba(255,255,255,0)\"><a href=\"http://www.smithsonianmag.com/science-nature/scientific-explanation-how-marijuana-causes-munchies-180949660/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.smithsonianmag.com/science-nature/scientific-explanation-how-marijuana-causes-munchies-180949660/&amp;source=gmail&amp;ust=1489597414819000&amp;usg=AFQjCNHl_nRwz8egAGNaCUrcJJVauwyufQ\"><span class=\"m_-4311725127581559377m_-2347242040462203313s12\" style=\"line-height:21.600000381469727px\"><br /></span></a><span style=\"line-height:21.600000381469727px\"></span></span></font></p><p class=\"m_-4311725127581559377m_-2347242040462203313s13\" style=\"margin-top:0px;margin-bottom:0px;line-height:1.38\"><span class=\"m_-4311725127581559377m_-2347242040462203313s8\" style=\"line-height:14.399999618530273px\"><span class=\"m_-4311725127581559377m_-2347242040462203313bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\"><a href=\"http://Ganjaroad.com\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://Ganjaroad.com&amp;source=gmail&amp;ust=1489597414820000&amp;usg=AFQjCNHF2RfhXLn2VNirik-ol3WC5KJQ7w\">Ganjaroad.com</a>\r\n is an online portal for cannabis providers and related businesses to \r\nadvertise their products and services. While California retail shops are\r\n not scheduled to open until January of 2018, you can search for and \r\npost classified ads for cannabis related employment, grow equipment, \r\nreal estate, legal services and consulting services along with ads for \r\ndispensaries, doctors and delivery services to acquire cannabis for \r\nmedicinal purposes.</span></span></p>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','9IsBzxCSZo.jpeg',230,1,'2017-03-14 00:00:00',NULL,'2017-03-14 10:46:01','2017-03-14 10:52:50',NULL),(29,1,49,'LATE NIGHT MUNCHIES FIX FOR THE CANNABIS AFICIONADO','late-night-munchies-fix-for-the-cannabis-aficionado','<p class=\"m_-823414100717976366m_4979305724807473347s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">In\r\n a previous blog we talked about the marijuana user munchies phenomenon,\r\n more or less explaining it&#8217;s a real thing, not just imagined. So what \r\nmakes the list of late night munchies sure to hit the spot?</span></span></p><p class=\"m_-823414100717976366m_4979305724807473347s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">Presumably\r\n you&#8217;re either tired of pizza and doritos or you are concerned that \r\nmaybe too much of a good thing isn&#8217;t a good thing at all. We wanted to \r\nfind some items that satisfy your cravings while still being relatively \r\nhealthy. If you plan ahead, you are more likely to dive into some of \r\nthese snacks rather than emptying your wallet on late night delivery \r\nthat you might regret in the morning. <br /></span></span></p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div><p class=\"m_-823414100717976366m_4979305724807473347s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">SOME REASONABLE IDEAS:</span></span></p><p class=\"m_-823414100717976366m_4979305724807473347s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">HUMMUS</span></span></p><p class=\"m_-823414100717976366m_4979305724807473347s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">Keep\r\n a tub handy for those late night cravings. Hummus has a lot of \r\nnutrients and satiates your hunger. Flatbread or veggies, like carrots \r\nor celery, combine to make hummus the perfect dip.&nbsp;</span></span></p><p class=\"m_-823414100717976366m_4979305724807473347s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">CASHEWS</span></span></p><p class=\"m_-823414100717976366m_4979305724807473347s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">Nuts are a good source of protein and fat, making a few handfuls filling and satisfying.&nbsp;</span></span></p><p class=\"m_-823414100717976366m_4979305724807473347s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">POPCORN</span></span></p><p class=\"m_-823414100717976366m_4979305724807473347s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">Everyone\r\n loves popcorn. You could just pop a bag in the microwave or you could \r\nget a little more creative. Why not try BROWN SUGAR SRIRACHA POPCORN \r\nlike this recipe from <a href=\"http://HowSweetEats.com\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://HowSweetEats.com&amp;source=gmail&amp;ust=1490081454900000&amp;usg=AFQjCNHT6Ms8f9ZTcM1s9YyCSYwv_6DHlg\">HowSweetEats.com</a>&nbsp;</span></span></p><p class=\"m_-823414100717976366m_4979305724807473347s6\" style=\"margin-top:0px;margin-bottom:8px;line-height:1.32\"><font color=\"#000000\"><span style=\"background-color:rgba(255,255,255,0)\"><a name=\"m_-823414100717976366_m_4979305724807473347__6j7tzuk5hrln\" style=\"width: 20px; height: 20px; text-indent: 20px; background-repeat: no-repeat; background-image: url(&quot;/assets/vendors/cuteeditor/Images/anchor.gif&quot;);\"></a><span class=\"m_-823414100717976366m_4979305724807473347s5\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px\">ingredients:</span></span></span></font></p><div class=\"m_-823414100717976366m_4979305724807473347s8\" style=\"text-indent:0px;margin-top:4px;margin-bottom:11px;margin-left:44px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_-823414100717976366m_4979305724807473347s7\" style=\"line-height:13.199999809265137px\"></span><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px\">1/3 cup corn kernels</span></span></span></div><div class=\"m_-823414100717976366m_4979305724807473347s8\" style=\"text-indent:0px;margin-top:4px;margin-bottom:11px;margin-left:44px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_-823414100717976366m_4979305724807473347s7\" style=\"line-height:13.199999809265137px\"></span><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px\">1 tablespoon coconut oil, melted</span></span></span></div><div class=\"m_-823414100717976366m_4979305724807473347s8\" style=\"text-indent:0px;margin-top:4px;margin-bottom:11px;margin-left:44px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_-823414100717976366m_4979305724807473347s7\" style=\"line-height:13.199999809265137px\"></span><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px\">2 tablespoons brown sugar</span></span></span></div><div class=\"m_-823414100717976366m_4979305724807473347s8\" style=\"text-indent:0px;margin-top:4px;margin-bottom:11px;margin-left:44px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_-823414100717976366m_4979305724807473347s7\" style=\"line-height:13.199999809265137px\"></span><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px\">2 tablespoons sriracha</span></span></span></div><div class=\"m_-823414100717976366m_4979305724807473347s8\" style=\"text-indent:0px;margin-top:4px;margin-bottom:11px;margin-left:44px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_-823414100717976366m_4979305724807473347s7\" style=\"line-height:13.199999809265137px\"></span><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px\">1 tablespoon unsalted butter</span></span></span></div><div class=\"m_-823414100717976366m_4979305724807473347s8\" style=\"text-indent:0px;margin-top:4px;margin-bottom:11px;margin-left:44px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_-823414100717976366m_4979305724807473347s7\" style=\"line-height:13.199999809265137px\"></span><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px\">2 tablespoons toasted sesame seeds</span></span></span></div><div class=\"m_-823414100717976366m_4979305724807473347s9\" style=\"text-indent:0px;margin-top:4px;margin-bottom:9px;margin-left:44px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_-823414100717976366m_4979305724807473347s7\" style=\"line-height:13.199999809265137px\"></span><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span