utter. Place in the \r\nmicrowave for 20 seconds, then remove and whisk well to combine. Drizzle\r\n the mixture over the popcorn in layers - I like to drizzle, then toss \r\nwell, drizzle, then toss well, until all the sriracha is used and the \r\npopcorn is coated. Sprinkle the sesame seeds on and drizzle the toasted \r\nsesame oil with one more toss. Serve!</span></span></p><p class=\"m_-823414100717976366m_4979305724807473347s11\" style=\"margin-top:4px;margin-bottom:9px;line-height:21.600000381469727px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px\">LINK&nbsp;</span></span><a href=\"http://www.howsweeteats.com/2016/01/brown-sugar-sriracha-sesame-popcorn/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.howsweeteats.com/2016/01/brown-sugar-sriracha-sesame-popcorn/&amp;source=gmail&amp;ust=1490081454900000&amp;usg=AFQjCNFhiKRfp-WnwriXjPXgP4Xf_gfo2Q\"><span class=\"m_-823414100717976366m_4979305724807473347s12\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px\">http://www.howsweeteats.c<wbr>om/2016/01/brown-sugar-srirach<wbr>a-sesame-popcorn/</span></span></a><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px\"></span></span></span></p><p class=\"m_-823414100717976366m_4979305724807473347s11\" style=\"margin-top:4px;margin-bottom:9px;line-height:21.600000381469727px\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFo