4807473347s13\" style=\"margin-top:0px;margin-bottom:0px;line-height:1.38\"><span class=\"m_-823414100717976366m_4979305724807473347s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_-823414100717976366m_4979305724807473347bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\"><a href=\"http://Ganjaroad.com\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://Ganjaroad.com&amp;source=gmail&amp;ust=1490081454900000&amp;usg=AFQjCNGIqnV5uKXJD3-MuCgGTaTK5xNUTw\">Ganjaroad.com</a>\r\n is an online portal for cannabis providers and related businesses to \r\nadvertise their products and services. While California retail shops are\r\n not scheduled to open until January of 2018, you can search for and \r\npost classified ads for cannabis related employment, grow equipment, \r\nreal estate, legal services and consulting services along with ads for \r\ndispensaries, doctors and delivery services to acquire cannabis for \r\nmedicinal purposes.</span></span></p>','http://maxpixel.freegreatpicture.com/Paste-Healthy-Hummus-Chickpeas-Foliage-Basil-1058003','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','WpVewjRUcW.jpeg',233,1,'2017-03-20 00:00:00',NULL,'2017-03-20 18:09:31','2017-03-20 18:13:06',NULL),(30,1,49,'CANNABIS FOR SENIORS','cannabis-for-seniors','<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\" id=\"docs-internal-guid-7f20cc41-1701-0418-e6af-c5e5a9beb5d1\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">With the legalization of marijuana in some form or other taking place around the country, people who may not have thought they were a candidate for using cannabis might be open to the idea. One of the biggest segments of the population that appears to be looking to marijuana for health reasons is the senior population. Some dispensaries have reported that around 20% of their business comes from seniors.</span></p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">So what might be driving seniors to pursue marijuana? For many older people, &nbsp;common ailments like arthritis can motivate some of them to look for relief. Cannabis is well known for providing relief for pain and conditions like arthritis.</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">One woman in her 60s was interviewed by CBS News last year. Here is an excerpt:</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">&#8220;</span><span style=\"font-size:12pt;font-family:Verdana;color:#202022;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Sue Taylor works hard to stay fit, and stay healthy. This 68-year-old is a regular at the gym, eats kale to keep her cholesterol down, and at home, \"homemade\" is her motto.</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:11pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#202022;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">But there\'s one thing in her healthy lifestyle that may come as a surprise: she includes MARIJUANA in her quest to stay youthful&#8230;</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:11pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#202022;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Sue (who\'s known as \"the Weed Lady\") lives in California, one of the states where medical marijuana requires only a doctor\'s prescription.</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:11pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#202022;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">So what are the kinds of things marijuana helps if you\'re a senior? &#8216;Number one is arthritis,\" Taylor said. \"There are tinctures and rubs that you could actually put on your legs, on your knees, across your back, wherever you\'re having any arthritic pain. Most seniors use the cannabis for pain and to sleep.&#8217;\"</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:11pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#202022;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">While researchers are hoping to get more funding for studies, the research that has been done so far seems to show that pain is helped by marijuana. </span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:11pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#202022;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">If you are a senior, you might be intimidated at the prospect of trying cannabis for the first time but in today&#8217;s world where legal medical and recreational marijuana dispensaries are popping up around the nation, there is no reason to be. Most dispensaries are well educated on what type of product will be most helpful to someone based on their needs. Simply walk in and talk to them and give them as much information as possible so they can make a recommendation that gives you the best chance at success. </span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:11pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#202022;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">LINK</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:11pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#202022;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">CBS NEWS - Seniors and marijuana</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:11pt;\"><a href=\"http://www.cbsnews.com/news/seniors-and-marijuana/\" style=\"text-decoration:none;\"><span style=\"font-size:12pt;font-family:Verdana;color:#1155cc;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:underline;vertical-align:baseline;\">http://www.cbsnews.com/news/seniors-and-marijuana/</span></a></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Ganjaroad.com is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes.</span></p>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','LBvpgTymsd.jpg',288,1,NULL,NULL,'2017-03-28 15:21:59','2017-03-28 15:21:59',NULL),(31,4,12,'Oregon Legislature Passes Bill to Protect Recreational Customers Privacy','oregon-legislature-passes-bill-to-protect-recreational-customers-privacy','<div>GANJAPRENEUR.COM -A measure aimed at protecting cannabis consumers from federal prosecution has passed the Oregon legislature and has been sent to Gov. Kate Brown for her signature, according to a report from the Associated Press. The measure would end the practice by recreational dispensaries of keeping customer information often used for marketing and customer service purposes.</div>\r\n<div>&nbsp;</div>\r\n<div><a href=\"https://www.ganjapreneur.com/oregon-legislature-passes-bill-to-protect-recreational-customers-privacy/\" target=\"_blank\">READ MORE AT GANJAPRENEUR.COM</a>&nbsp;&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>\r\n<div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div>\r\n&nbsp;</div>\r\n<div>&nbsp;</div>','https://www.ganjapreneur.com/oregon-legislature-passes-bill-to-protect-recreational-customers-privacy/','Read news on Ganjaroad.com about Oregon recreational cannabis laws.','marijuana,dispensaries,doctors,delivery,grow stores,classified ads,news,information,Ganjaroad,Cannabis,hydroponics\r\n',NULL,72,1,'2017-04-12 00:00:00','2017-05-31 00:00:00','2017-04-12 15:07:57','2017-04-12 15:30:30',NULL),(32,1,49,'WHAT IS CANNABIS OIL AND WHAT ARE ITS BENEFITS?','what-is-cannabis-oil-and-what-are-its-benefits','<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">One of the biggest advantages in watching state after state legalize some form of marijuana use - medical and/or recreational - is that it gives people access to cannabis in forms other than for use in smoking. Many people adverse to smoking anything and though much research shows marijuana to be less harmful to your lungs than tobacco sometimes the act of inhaling smoke alone is a dealbreaker for people. </span></p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">As we have discussed in this space before, there are many ways of ingesting cannabis and the use of cannabis oil has some pretty ardent fans. What is cannabis oil and what benefits does it offer?</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Cannabis oil is different from hemp oil in that hemp oil is extracted from hemp plants and cannabis is derived from marijuana plants. Cannabis oil is concentrated and comes from a rather complicated process. High quality cannabis oil is available in nearly any place where marijuana is legally sold. </span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">A recent article on OrganicFacts.net details the benefits of cannabis oil. Here is an excerpt: </span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">&#8220;Cannabis oil has a wide range of effects on health, and has been connected to a diverse number of health problems, ranging from migraines and stress to lack of appetite and sex drive. Cannabis oil has even been connected to reducing the risk of certain cancers, as well as reducing pain, strengthening the heart and helping people get a good night sleep.&#8221;</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Anxiety, Stress, Sleep problems, Cancer Prevention, Digestive Issues, Heart Health, Migraines and several other conditions are said to benefit greatly by implementing cannabis oil into a regular use regiment. While research is being conducted and the verdict is still out, we can&#8217;t make claims for cures of whatever condition you are afflicted with but anecdotal and scientific evidence certainly points in direction of cannabis oil being a significant benefit to almost anyone. </span></p><br /><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">LINKS</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">10 Suprising Benefits of Cannabis Essential Oil https://www.organicfacts.net/health-benefits/essential-oils/cannabis-essential-oil.html</span></p><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Ganjaroad.com is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes.</span>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','JVmsLaYGhR.jpg',276,1,NULL,NULL,'2017-04-14 08:58:16','2017-04-14 11:59:32',NULL),(33,1,49,'THE COMING MARIJUANA HEALTH CRAZE','the-coming-marijuana-health-craze','<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">To cannabis aficionados and advocates for legalizing marijuana, it comes as no surprise when study after study seems to support the various health benefits of marijuana. Now that many states have legalized marijuana - medicinal and/or recreational - the question many folks are wondering is whether marijuana will be accepted in the health and wellness communities. </span></p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Preparing for last month&#8217;s Second Annual 420 Games in Santa Monica, California, event organizer Jim McAlpine spoke to LA Weekly about this topic of marijuana use in relation to health and wellness, &#8220;</span><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">It&#8217;s just always been part of the L.A. fitness lifestyle, but not many talk about it.&#8221;</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">LA Weekly continued:</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">&#8220;</span><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Cannabis culture is at a crossroads. With the recent passage of Measure M, which </span><a href=\"http://www.laweekly.com/news/measure-m-marijuana-laws-regulation-permits-number-of-shops-8013177\" style=\"text-decoration:none;\"><span style=\"font-size:12pt;font-family:Verdana;color:#0053b8;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">paves the way for recreational marijuana shops in L.A. next year</span></a><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">, the cannabis industry will become a much more ubiquitous part of our urban landscape. This expanded presence has already shifted the demographics of people who use the various incarnations of pot. Some of the fastest-growing groups consuming marijuana products are seniors older than 55, according to </span><a href=\"http://www.laweekly.com/news/seniors-quickly-becoming-the-next-weed-generation-7473884\" style=\"text-decoration:none;\"><span style=\"font-size:12pt;font-family:Verdana;color:#0053b8;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">new research from the Centers for Disease Control</span></a><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">. Then there\'s the high-end, members-only cannabis clubs, where </span><a href=\"http://www.laweekly.com/news/privee-social-cannabis-club-curates-high-end-marijuana-product-parties-8066237\" style=\"text-decoration:none;\"><span style=\"font-size:12pt;font-family:Verdana;color:#0053b8;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">fancy weed is available to a discerning crowd.</span></a><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\"> &nbsp;&nbsp;&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">The whole system of marketing cannabis to textbook &#8220;stoners&#8221; is off-base, McAlpine says. Most people who use marijuana today are moms, athletes and regular people, &nbsp;who eat well, are health-conscious and simply want to incorporate cannabis into their lifestyle in an unabashed way. &#8220;There were, and are still, millions of people living in the cannabis closet,&#8221; he says.</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">In another interesting article on the subject titled 7 Reasons Why Cannabis Will Dominate The Wellness World In 2017, WellAndGood.com takes much the same positive outlook on the coming marijuana health and wellness craze: </span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">&#8220;... the </span><a href=\"https://www.wellandgood.com/good-advice/cannabis-wellness-products-feminism/\" style=\"text-decoration:none;\"><span style=\"font-size:12pt;font-family:Verdana;color:#c53836;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">excitement around the herb&#8217;s health benefits</span></a><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\"> isn&#8217;t just buzz either, says Jeffrey Egler, MD, of Parsley Health in Los Angeles. &#8220;It&#8217;s good science. The numerous benefits have been demonstrated and well-documented for years, if not decades. There&#8217;s still the legitimate debate about safety in some circumstances, particularly smoking it. But there are much cleaner products than others, as well as cleaner ways of dosing cannabis.&#8221;</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">So if pot&#8217;s healing potential is old news, why is there such a blaze of activity around it at this very moment?</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Right now investors are throwing tons of money at the marijuana wellness market, spurred on by eases in drug regulations surrounding the plant, says Samantha Miller, chief science officer at functional cannabis start-up </span><a href=\"http://www.hmbldt.com/\" style=\"text-decoration:none;\"><span style=\"font-size:12pt;font-family:Verdana;color:#c53836;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Hmbldt</span></a><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">. (Nine states, including California, have now legalized recreational marijuana; 20 others, New York among them, allow it to be used medicinally.)</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;\">The momentum from recent state-level victories&#8212;and an influx of, ahem, seed money&#8212;is creating a cloud of innovation and growth around cannabis brands that are focused more on the luxury and artisanal segments of the market. (Think soccer moms in California or Colorado who aren&#8217;t interested in buying a baggie of Purple Haze, but are looking for a natural way to unwind.)&#8221;</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">By most accounts, the marijuana industry is shaping up to be embraced by the health and wellness industry as legalization becomes more common across the nation. It might mean the days of beach bum stoner stereotypes are soon going to be replaced by holistic, tofu eating, yoga instructors or, better yet, the new stereotype will be none at all, as people realize the benefits of marijuana and cannabis extend to just about everyone. </span></p><br /><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:15pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">LINKS</span></p><h1 dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">The 420 Games Encourage Health-Conscious Cannabis Culture </span></h1><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:15pt;\"><a href=\"http://www.laweekly.com/news/420-games-promotes-weed-use-for-fitness-and-wellness-8075409\" style=\"text-decoration:none;\"><span style=\"font-size:12pt;font-family:Verdana;color:#1155cc;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:underline;vertical-align:baseline;\">http://www.laweekly.com/news/420-games-promotes-weed-use-for-fitness-and-wellness-8075409</span></a><span style=\"font-size:12pt;font-family:Verdana;color:#333333;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\"> </span></p><h1 dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:4pt;\"><span style=\"font-size:12pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">7 REASONS WHY CANNABIS WILL DOMINATE THE WELLNESS WORLD IN 2017</span></h1><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><a href=\"https://www.wellandgood.com/good-advice/cannabis-health-wellness-trends-2017/\" style=\"text-decoration:none;\"><span style=\"font-size:11pt;font-family:Arial;color:#1155cc;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:underline;vertical-align:baseline;\">https://www.wellandgood.com/good-advice/cannabis-health-wellness-trends-2017/</span></a><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\"> </span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\"> </span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:12pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;\">Ganjaroad.com is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes.</span></p>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','VnffSZeQ5I.jpg',265,1,NULL,NULL,'2017-04-14 09:06:49','2017-04-14 11:58:42',NULL),(34,4,1,'test','test-1','test','','','','r8kxtAB5dN.jpg',0,0,NULL,NULL,'2017-04-14 11:35:13','2017-04-14 11:42:28','2017-04-14 11:42:28'),(35,4,1,'test','test-2','test','','','','MzyMBYymDe.jpg',0,0,NULL,NULL,'2017-04-14 11:37:32','2017-04-14 11:42:17','2017-04-14 11:42:17'),(36,1,14,'Mike test','mike-test','test','','','','dntrnAM5Qq.jpg',0,0,'2017-04-13 00:00:00','2017-04-15 00:00:00','2017-04-14 11:42:48','2017-04-14 11:42:48',NULL),(37,1,1,'test','test-1','test','','','','oKESGqTeWX.jpg',0,0,NULL,NULL,'2017-04-14 11:50:23','2017-04-14 11:51:26','2017-04-14 11:51:26'),(38,1,49,'MICRODOSING MARIJUANA ','microdosing-marijuana','<div id=\"m_6148834483522942559AppleMailSignature\"><p class=\"m_6148834483522942559s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_6148834483522942559s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">Microdosing\r\n marijuana seems obvious - taking small doses of THC - and it is \r\nstarting to become a popular method of taking medicinal marijuana, with \r\nmany people advocating for its effectiveness in treating the same \r\nconditions we often mention. In fact, many seem to believe it is \r\npreventative much like taking vitamins and other supplements. <br /></span></span></p><div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div><p class=\"m_6148834483522942559s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span class=\"m_6148834483522942559s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">In\r\n January, MIC published an excellent article on this growing phenomenon,\r\n first answering the question of why microdose in the first place:</span></span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_6148834483522942559s5\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px\">&#8220;</span></span><span class=\"m_6148834483522942559s5\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px\">The\r\n principle behind microdosing is simple: We enjoy many of the more \r\nabstract effects of psychedelics &#8212; the sense of well-being, harmony and \r\nhappiness &#8212; but tend to take enough of them that we also experience more\r\n extreme effects, like hallucinations and giggle fits. Taking a fraction\r\n of that ordinary dose, however, keeps most effects \"sub-perceptual,\" or\r\n below the threshold where you\'d actively notice them.</span></span></span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">&nbsp;</span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_6148834483522942559s5\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px\">In\r\n other words, you\'re not really \"tripping\" on a microdose. You can still\r\n go about your day-to-day life, though perhaps with slightly improved \r\nfocus, mood and emotional balance. It means that microdosing may be the \r\nanswer for people who want to medicate their anxiety or chronic pain \r\nwith marijuana but don\'t love feeling stoned all the time. Some doctors \r\nhave said that overall, their patients see&nbsp;</span></span><span class=\"m_6148834483522942559s5\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px\">better results</span></span><span class=\"m_6148834483522942559s5\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px\">&nbsp;with low doses.&#8221;&nbsp;</span></span></span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_6148834483522942559s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px\"></span></span><span style=\"line-height:21.600000381469727px\">&nbsp;</span></span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span class=\"m_6148834483522942559s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">The article next answers some of the how:</span></span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">&nbsp;</span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span class=\"m_6148834483522942559s5\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">&#8220;For\r\n some, a single puff on a bowl, joint or vape is a microdose. More \r\nexperienced smokers and vapers may want two or three. As with the normal\r\n ritual of getting high, it depends a lot on your tolerance, the potency\r\n of the weed and how deeply you\'re inhaling.&nbsp;</span></span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">&nbsp;</span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span class=\"m_6148834483522942559s5\" style=\"line-height:14.399999618530273px;font-style:italic\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">What\r\n matters most is your awareness of how much weed it takes to tilt your \r\nperception. If after three hits in a row all you can do is eat Doritos \r\nand watch old episodes of Seinfeld, then you\'ve already had too much. \r\nRemember, you\'re not looking to enter another dimension here.&#8221;</span></span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">&nbsp;</span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span class=\"m_6148834483522942559s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">The article goes on to detail how to microdose with edibles and monitor whether it is working or not.&nbsp;</span></span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">&nbsp;</span></p><p style=\"margin-top:0px;margin-bottom:0px;line-height:21.600000381469727px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_6148834483522942559s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px\">To read the entire article go to&nbsp;</span></span><a href=\"https://mic.com/articles/166192/microdosing-weed-the-definitive-guide-how-much-marijuana-you-need-for-a-functional-minimal-high#.Ehss5pVeT\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=https://mic.com/articles/166192/microdosing-weed-the-definitive-guide-how-much-marijuana-you-need-for-a-functional-minimal-high%23.Ehss5pVeT&amp;source=gmail&amp;ust=1493132039708000&amp;usg=AFQjCNGNBb5bsU1yeFCz0N2dYFCYxNwFrQ\"><span class=\"m_6148834483522942559s6\" style=\"line-height:14.399999618530273px\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px\">MIC.com</span></span></a></span></p><p class=\"m_6148834483522942559s4\" style=\"margin-top:0px;margin-bottom:20px;line-height:21.600000381469727px\"><span style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">&nbsp;</span></p><p class=\"m_6148834483522942559s8\" style=\"margin-top:0px;margin-bottom:11px;line-height:21.600000381469727px\"><span class=\"m_6148834483522942559s7\" style=\"line-height:14.399999618530273px\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px;background-color:rgba(255,255,255,0)\">LINK</span></span></p><p class=\"m_6148834483522942559s8\" style=\"margin-top:0px;margin-bottom:11px;line-height:21.600000381469727px\"><span style=\"background-color:rgba(255,255,255,0)\"><span class=\"m_6148834483522942559s2\" style=\"line-height:14.399999618530273px\"><span class=\"m_6148834483522942559bumpedFont15\" style=\"line-height:21.600000381469727px\"><a href=\"http://MIC.co\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://MIC.co&amp;source=gmail&amp;ust=1493132039708000&amp;usg=AFQjCNEgT1uufVavE21orTct3XCqMdEf-w\">MIC