381469727px;background-color:rgba(255,255,255,0)\"><a href=\"http://Ganjaroad.com\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://Ganjaroad.com&amp;source=gmail&amp;ust=1493132039709000&amp;usg=AFQjCNHhNaBJQja4126ZJvJQ6XV2agnv4Q\">Ganjaroad.com</a>\r\n is an online portal for cannabis providers and related businesses to \r\nadvertise their products and services. While California retail shops are\r\n not scheduled to open until January of 2018, you can search for and \r\npost classified ads for cannabis related employment, grow equipment, \r\nreal estate, legal services and consulting services along with ads for \r\ndispensaries, doctors and delivery services to acquire cannabis for \r\nmedicinal purposes.</span></span></p></div>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','eMnjD7SgK5.jpg',276,1,NULL,NULL,'2017-04-24 08:04:43','2017-04-24 08:04:43',NULL),(39,4,49,'This Landmark Cannabis Bill Is Great News for Marijuana Stocks','this-landmark-cannabis-bill-is-great-news-for-marijuana-stocks','<div class=\"subscriber-preview\" style=\"box-sizing: border-box; color: #333333; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;\"><p style=\"box-sizing: border-box; margin: 0px 0px 24px; color: #444444; font-size: 16px; line-height: 27px;\">Investors would probably struggle to find an industry that\'s growing at a faster and more consistent pace than legal marijuana.</p></div><div class=\"subscriber-preview\" style=\"box-sizing: border-box; color: #333333; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial;\"><p style=\"box-sizing: border-box; margin: 0px 0px 24px; color: #444444; font-size: 16px; line-height: 27px;\">Last year alone, according to cannabis research firm ArcView, North American legal pot sales jumped 34% to $6.9 billion. ArcView estimates that legal sales could top $22 billion by 2021, with investment firm Cowen &amp; Co. expecting legal sales to hit $50 billion by 2026. Regardless of what estimate you choose to believe, the legal marijuana industry is growing by between 20% and 30% a year. That type of consistent long-term growth is certainly appealing to investors.</p><div><a href=\"http://host.madison.com/business/investment/markets-and-stocks/this-landmark-cannabis-bill-is-great-news-for-marijuana-stocks/article_64280d67-2c0c-5681-acb7-8c461d6318b2.html\">READ MORE AT MADISON.COM</a></div></div>','http://host.madison.com/business/investment/markets-and-stocks/this-landmark-cannabis-bill-is-great-news-for-marijuana-stocks/article_64280d67-2c0c-5681-acb7-8c461d6318b2.html','The latest news about the cannabis and marijuana industry. ','Cannabis, Marijuana, news, dispensaries, legalization, medicinal, recreational',NULL,359,1,NULL,NULL,'2017-04-24 08:17:56','2017-04-24 08:17:56',NULL),(40,1,49,'How To Talk To Your Kids About Marijuana','how-to-talk-to-your-kids-about-marijuana','<p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   15pt;  0in; 16.2pt;\">As marijuana and cannabis become a legal substance to purchase and use in many places, it is inevitable that some users will have to answer questions from their children. Some recent articles address this issue head on and offer advice for parents who may feel unsure of what to say. <u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   15pt;  0in; 16.2pt;\">The Cannabist interviewed a man who is a father, pot user and author of a book on the future of legal marijuana in America.<div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div><span style=\"font-family: arial; font-size: 12px;\">&nbsp;</span></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   15pt;  0in; 16.2pt;\"><em>&#8220;Bruce Barcott, 49, is a pot user for both medical and recreational purposes. He lives outside Seattle and consumes about once a month, but never around his kids, a 13-year-old son and a 16-year-old daughter. He&#8217;s also the author of a new book on the future of legal marijuana in America, &#8220;</em><a href=\"http://www.thecannabist.co/tag/weed-the-people/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.thecannabist.co/tag/weed-the-people/&amp;source=gmail&amp;ust=1494486023983000&amp;usg=AFQjCNFIy8gLsz1dXaTXbkwCywHr7kPMkQ\" style=\"color: #1155cc;\"><em>Weed the People</em></a><em>.&#8221;</em><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   15pt;  0in; 16.2pt;\"><em>&#8220;I had real qualms as a parent writing this book,&#8221; he said. &#8220;I mean, here I am writing a book about pot and I&#8217;ve got two young teenagers in my house.&#8221;</em><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   15pt;  0in; 16.2pt;\"><em>His pot conversation has been a running dialogue, he said.</em><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   15pt;  0in; 16.2pt;\"><em>&#8216;We would stop and start in little snippets, maybe on the drive to school or over dinner. My daughter, especially, thought it was hilarious that her father was writing a book about pot. It&#8217;s an interesting opener,&#8217; Barcott said. &#8216;I wanted to really talk with them about marijuana in a way that came from a place of honesty and factual data and truth and not have to resort to some sort of scare tactic to keep them off pot.&#8217;&#8221;</em><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   15pt;  0in; 16.2pt;\">Esquire Magazine writer, author and former MTV VJ Dave Holmes, wrote an article recently answering a concerned father&#8217;s question about how to handle the subject of pot - his use versus not allowing his teenage son to do the same - and this was part of his answer:<u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;  16.2pt;\"><em>&#8220;I think you must tell him that it is a thing you have done, and a thing that&#8212;at least right now&#8212;he is not allowed to do&#8230;</em><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;  16.2pt;\"> <u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;  16.2pt;\"><em>The first part will achieve an important goal: It will demystify the idea of marijuana for your son. It will also quickly and mercilessly erase any outlaw appeal the drug may currently have. Your son is about to become a teenager, and it is a rule that nothing a teenager\'s father has done can ever be considered cool. You\'re doing your son a favor by taking weed out of the realm of the older kids and popular rappers, and placing it squarely into the realm of \"dad stuff.\"</em><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;  16.2pt;\"> <u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;  16.2pt;\"><em>The second part is not hypocritical, or even inconsistent. There are plenty of things adults do that children should be forbidden from trying, and on any given day you\'re doing several of them: driving, having sex, drinking alcohol, voting. Thirteen-year-olds should not get high for a variety of perfectly good reasons, not least of which is that 13-year-olds who get high naturally gravitate toward other 13-year-olds who get high, and groups of 13-year-olds who get high are known to make terrible decisions&#8230;&#8221;</em><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   15pt;  0in; 16.2pt;\"> <u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   15pt;  0in; 16.2pt;\">There are lots of subjects that parents feel awkward about addressing with their children, perhaps your personal marijuana consumption is one of them, but as with most things the best rule is probably just honesty and transparency. <u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   8.25pt;  0in; 16.2pt;\">LINK<u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   4.5pt;  0in; 16.2pt;\"><span style=\"color: black;\">How parents in marijuana industry talk to their own kids about pot</span><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;  16.2pt;\"><span style=\"color: black;\"><a href=\"http://www.thecannabist.co/2015/07/24/parents-marijuana-industry-kids-pot-talk/38447/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.thecannabist.co/2015/07/24/parents-marijuana-industry-kids-pot-talk/38447/&amp;source=gmail&amp;ust=1494486023983000&amp;usg=AFQjCNGjWNerelmvZbO_DfCxnl_TO7WSiA\" style=\"color: #1155cc;\">http://www.thecannabist.co/201<wbr>5/07/24/parents-marijuana-indu<wbr>stry-kids-pot-talk/38447/</a></span><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   8.25pt;  0in; 16.2pt;\"> <u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff; \"><span style=\"color: black;\">How to Talk to Your 13-Year-Old About Weed Without Seeming Like a Hypocrite</span><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;  16.2pt;\"><span style=\"color: black;\"><a href=\"http://www.esquire.com/lifestyle/advice/a54787/letting-kids-smoke-marijuana/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://www.esquire.com/lifestyle/advice/a54787/letting-kids-smoke-marijuana/&amp;source=gmail&amp;ust=1494486023983000&amp;usg=AFQjCNEuiunG2CLvDAkwoJruHliELBBAkA\" style=\"color: #1155cc;\">http://www.esquire.com/lifesty<wbr>le/advice/a54787/letting-kids-<wbr>smoke-marijuana/</a></span><u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff;   8.25pt;  0in; 16.2pt;\"> <u></u><u></u></p><p style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; background-color: #ffffff; \"><a href=\"http://ganjaroad.com/\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?hl=en&amp;q=http://Ganjaroad.com&amp;source=gmail&amp;ust=1494486023983000&amp;usg=AFQjCNGLocXeCb3p6FaT1eVZdHy7A97Eiw\" style=\"color: #1155cc;\">Ganjaroad.com</a> is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes.<u></u><u></u></p><div></div>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','aoYrW5PRPq.jpg',255,1,NULL,NULL,'2017-05-10 10:18:24','2017-05-10 10:18:24',NULL),(41,4,49,'LYFT and 420? In Colorado They Go Together','lyft-and-420-in-colorado-they-go-together','<p style=\"box-sizing: border-box;   0px;  0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: #ffffff;  normal; 24px; font-family: serif12, serif; max- 600px; color: #333333;\">Back in March, Westword covered a promotion by rideshare app Lyft in coordination with the Colorado Department of Transportation.</p><div><p style=\"box-sizing: border-box;   0px;  0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: #ffffff;  normal; 24px; font-family: serif12, serif; max- 600px; color: #333333;\"><span style=\"box-sizing: border-box;   0px;  0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold; font-family: avalonWeb, sans-serif;\">A month from now, thousands will gather at Civic Center Park for the annual 4/20 cannabis celebration.</span> On Monday, 3/20, the <a href=\"https://www.codot.gov/\" target=\"_blank\" style=\"box-sizing: border-box;   0px;  0px; vertical-align: baseline; background: transparent; cursor: pointer; text-decoration-line: none; color: #a5252b; outline: none !important;\">Colorado Department of Transportation</a> and <a href=\"https://www.lyft.com/cities/denver-co\" target=\"_blank\" style=\"box-sizing: border-box;   0px;  0px; vertical-align: baseline; background: transparent; cursor: pointer; text-decoration-line: none; color: #a5252b; outline: none !important;\">Lyft</a> gathered at the same spot to launch a safe driving program &#8212; <a href=\"https://www.320movement.com/\" target=\"_blank\" style=\"box-sizing: border-box;   0px;  0px; vertical-align: baseline; background: transparent; cursor: pointer; text-decoration-line: none; color: #a5252b; outline: none !important;\">the 320 Movement</a>.</p><p style=\"box-sizing: border-box;   0px;  0px; outline: 0px; font-size: 16px; vertical-align: baseline; background: #ffffff;  normal; 24px; font-family: serif12, serif; max- 600px; color: #333333;\">In the month leading up to April 20, Lyft is offering discounted rides to encourage marijuana users to plan ahead for a safe ride home. It\'s branded seventeen cars, wrapping them in green with the message of the campaign, \"plan a ride before you\'re high.\" There are seventeen cars in the fleet because 17 percent of Colorado State Patrol DUI arrests last year involved marijuana, according to CDOT spokesman Sam Cole.\"</p><div>It appears as though the promotioin is ongoing. You can read about it <a href=\"https://www.320movement.com/\">here</a>. To read the entire article <a href=\"http://www.westword.com/marijuana/lyft-and-colorado-transportation-department-launch-ride-plan-for-4-20-8892920\">click here</a>&nbsp;</div>&nbsp;</div>','http://www.westword.com/marijuana/lyft-and-colorado-transportation-department-launch-ride-plan-for-4-20-8892920http','The latest news about the cannabis and marijuana industry. ','',NULL,303,1,NULL,NULL,'2017-05-10 15:15:59','2017-05-10 15:17:07',NULL),(42,1,49,'AVAILABILITY OF MEDICINAL MARIJUANA LOWERS OPIOID USE','availability-of-medicinal-marijuana-lowers-opioid-use','<span id=\"docs-internal-guid-fb5c47e5-ec21-3537-0ff1-e71fec199c89\"><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">Across the country, opioid use is a major problem resulting in overdoses and deaths at an alarming rate. According to The Center for Disease Control, on average 91 people die each day because of opioid overdose. New research shows that where medicinal marijuana is legally available, deaths from opioids are reduced significantly.<div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div> </span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">In 2014, the Journal of the American Medical Association found that states in which medicinal marijuana was available saw a 25% reduction in opioid deaths. </span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">The Daily Caller wrote:</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">&#8220;Research from the Journal of the American Medical Association is adding to a growing body of evidence showing states with medical marijuana programs have lower rates of opioid related overdoses. Patients who are offered pot as an alternative treatment for chronic conditions are increasingly shifting off their prescription opioids entirely...</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">The designation of marijuana as a Schedule I drug alongside deadly narcotics limits researcher&#8217;s abilities to study the medical application of weed, but comparisons of opioid overdose statistics between different states at least suggests a medicinal purpose.&#8221;</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">Most regular users of marijuana and cannabis know about the tremendous health benefits as well as the ailments it can help. CBS2 New York reported about the growing belief in the medical community that marijuana can treat pain and diminish or replace the need for painkiller prescriptions like opioids. </span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">CBS2 New York writes:</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">&#8220;With the growing opioid epidemic, doctors are looking into alternatives to addictive prescriptions for treating chronic pain.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">Some experts believe </span><a href=\"http://newyork.cbslocal.com/tag/medical-marijuana/\" style=\"text-decoration-line: none;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #1155cc; font-style: italic; text-decoration-line: underline; vertical-align: baseline; \">medical marijuana</span></a><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \"> could help curb the nation&#8217;s narcotic drug crisis.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">As CBS2&#8217;s Dr. Max Gomez reports, Christine Stenquist suffered through a brain tumor, fibromyalgia and debilitating headaches. Chronic pain led to 45 different prescription drugs.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">&#8220;Migraines were just constant. So they started me on a lot of pharmaceuticals, and that went on for 16 years,&#8221; she said.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">Between the pain and the opioids, the mother of four was left bedridden. Eventually, she decided to give medical marijuana a try.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">&#8220;This is just a whole different lifestyle. I&#8217;m eating healthier, I&#8217;m more active, more alert,&#8221; she said.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">Stenquist is one of a growing number of Americans who have traded in their powerful and addictive painkillers for the green alternative.&#8221;</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">It seems the mainstream is finally catching on to one of the benefits the pro medicinal marijuana community has been campaigning on for decades.  </span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">LINK</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">THE DAILY CALLER - </span><span style=\"font-size: 12pt; font-family: Verdana; background-color: #ffffff; vertical-align: baseline; \">Medical Marijuana Linked To 25 Percent Drop In Painkiller Abuse</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><a href=\"http://dailycaller.com/2017/05/02/medical-marijuana-linked-to-25-percent-drop-in-painkiller-abuse/?utm_campaign=atdailycaller&amp;utm_source=Twitter&amp;utm_medium=Social\" style=\"text-decoration-line: none;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #1155cc; text-decoration-line: underline; vertical-align: baseline; \">http://dailycaller.com/2017/05/02/medical-marijuana-linked-to-25-percent-drop-in-painkiller-abuse/?utm_campaign=atdailycaller&amp;utm_source=Twitter&amp;utm_medium=Social</span></a> </p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">CBS2 NY - Patients With Chronic Pain Turn From Prescription Opioids To Medical Marijuana</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><a href=\"http://newyork.cbslocal.com/2017/05/05/chronic-pain-medical-marijuana/\" style=\"text-decoration-line: none;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #1155cc; text-decoration-line: underline; vertical-align: baseline; \">http://newyork.cbslocal.com/2017/05/05/chronic-pain-medical-marijuana/</span></a> </p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">Craigsweed.com is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes.</span></p><div><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \"><br /></span></div></span>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','js0TXZmBQ7.jpg',163,1,NULL,NULL,'2017-06-27 17:45:32','2017-06-27 17:45:32',NULL),(43,4,49,'SCIENCE ALERT REPORTS: 93% of Patients Prefer Cannabis Over Opioids For Managing Pain, According to New Study','science-alert-reports-93-of-patients-prefer-cannabis-over-opioids-for-managing-pain-according-to-new-study','<p style=\" color: #333333; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; font-size: 18px; background-color: #ffffff;\">A new study has investigated what patients themselves prefer when it comes to managing pain &#8211; opioids, which are widely distributed for intense pain relief, or medical marijuana.</p><p style=\" color: #333333; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; font-size: 18px; background-color: #ffffff;\">The researchers found that the patients themselves much prefer medical marijuana, and many believe it is just as effective for their pain.</p><p style=\" color: #333333; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; font-size: 18px; background-color: #ffffff;\">\"This study can conclude that medical cannabis patients report successfully using cannabis along with or as a substitute for opioid-based pain medication,\" <a href=\"http://online.liebertpub.com/doi/10.1089/can.2017.0012\" style=\"color: #005689; text-decoration-line: none; transition: color 0.2s ease-out;  1px solid #dcdcdc;\">the team reported</a> in the journal <em>Cannabis and Cannabinoid Research</em>.</p><p style=\" color: #333333; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; font-size: 18px; background-color: #ffffff;\">\"Patients in this study who are using cannabis and opioids report that they are able to use less opioids and that cannabis presents less unwanted side effects than their opioid-based medication.\"</p><p style=\" color: #333333; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; font-size: 18px; background-color: #ffffff;\">The researchers, from University of California Berkeley and Kent State University emailed participants a survey asking them about their pain, and their opioid and marijuana usage.</p><div>READ THE REST OF THE STORY<a href=\"http://www.sciencealert.com/93-of-patients-prefer-cannabis-over-opioids-for-managing-their-pain-according-to-new-study\"> HERE</a>&nbsp;</div>','http://www.sciencealert.com/93-of-patients-prefer-cannabis-over-opioids-for-managing-their-pain-according-to-new-study','The latest news about the cannabis and marijuana industry. ','Cannabis, Marijuana, news, dispensaries, legalization, medicinal, recreational',NULL,276,1,NULL,NULL,'2017-06-30 17:50:36','2017-06-30 17:50:36',NULL),(44,1,49,'WHAT ARE STRAINS AND HOW MANY ARE THERE?','what-are-strains-and-how-many-are-there','<span id=\"docs-internal-guid-32dda369-1ae7-79ef-07b7-48b3da2cd903\"><p dir=\"ltr\" style=\"text-align: left;\"><span style=\"font-family: Verdana; font-size: 12pt;\">The term &#8220;strain&#8221; in relation to marijuana and cannabis is akin to dog breeds. While still a dog, a pug is decidedly different than a German shepard and your expectations are adjusted accordingly.</span></p><p dir=\"ltr\" style=\"1.38;0pt;20pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">Marijuana strains are kind of the same thing - still weed but can affect you differently. So why are there so many strains and what do you need to know about them?</span></p><p dir=\"ltr\" style=\"1.38;0pt;20pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">Wikipedia says, of cannabis strains:</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">&#8220;Cannabis strains are either pure or hybrid varieties of Cannabis, typically of C. sativa, C. indica and C. ruderalis. Varieties are developed to intensify specific characteristics of the plant, or to differentiate the strain for the purposes of marketing or to make it more effective as a drug. Variety names are typically chosen by their growers, and often reflect properties of the plant such as taste, color, smell, or the origin of the variety.</span> <span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">Cannabis strains commonly refer to those varieties with recreational and medicinal use. These varieties have been cultivated to contain a high percentage of cannabinoids. Several varieties of Cannabis, known as hemp, have a very low cannabinoid content, and are instead grown for their fiber and seed.&#8221;</span></p><br /><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #202022; vertical-align: baseline; \">But wait. Why are there like a bajillion different names for the weed at my local dispensary or when my &#8220;bud expert&#8221; friend Lance goes on and on about his latest discovery? </span></p><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #202022; vertical-align: baseline; \">Green Rush Daily tackles the question of cannabis strains by diving more to the question about your buddy Lance. </span></p><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">&#8220;Strain names are one of the many interesting things about cannabis culture. And if you&#8217;re at all familiar with </span><a href=\"https://www.greenrushdaily.com/2016/02/08/best-cannabis-strain-names/\" style=\"text-decoration-line: none;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #000000; font-style: italic; text-decoration-line: underline; vertical-align: baseline; \">strain names</span></a><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \"> you know they can be pretty colorful, creative, funny, and weird. You also know there are tons of them. So how many different cannabis strains are there? Turns out the answer to that question isn&#8217;t as simple as you might think. And it all has to do with the fact that cannabis growers&#8212;amateur and professional alike&#8212;are constantly experimenting with new strains.</span></p><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">With that said, there is one fairly reliable number we can turn to. According to cannabis experts, there are at least </span><a href=\"http://graphics.latimes.com/marijuana-strains/\" style=\"text-decoration-line: none;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #000000; font-style: italic; text-decoration-line: underline; vertical-align: baseline; \">779 known cannabis strains</span></a><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \"> in the world.</span></p><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">The different cannabis strains included on this list are pretty well known and well-established ones. These are strains that have been around long enough to be recognizable. And most of them are strains you could probably find at a dispensary somewhere in the world.</span></p><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">Of course, this number also includes tons of obscure, harder to find different cannabis strains as well. But one way or another, these 779 known different cannabis strains have achieved some sort of stability and recognition on the global marijuana scene.&#8221;</span></p><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">779 (give or take) seems to be about the most definitive answer you get when trying to determine how many strains of cannabis are available, and you thought there were too many salad dressings to choose from. </span></p><br /><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #202022; vertical-align: baseline; \">LINK</span></p><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #202022; vertical-align: baseline; \">LA TIMES GRAPHIC </span><a href=\"http://graphics.latimes.com/marijuana-strains/\" style=\"text-decoration-line: none;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #1155cc; text-decoration-line: underline; vertical-align: baseline; \">http://graphics.latimes.com/marijuana-strains/</span></a> </p><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #202022; vertical-align: baseline; \">GREEN CRUSH DAILY </span><a href=\"https://www.greenrushdaily.com/many-different-cannabis-strains/\" style=\"text-decoration-line: none;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #1155cc; text-decoration-line: underline; vertical-align: baseline; \">https://www.greenrushdaily.com/many-different-cannabis-strains/</span></a> </p><p dir=\"ltr\" style=\"1.38;0pt;11pt;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #202022; vertical-align: baseline; \">WIKIPEDIA </span><a href=\"https://en.wikipedia.org/wiki/Cannabis_strains\" style=\"text-decoration-line: none;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #1155cc; text-decoration-line: underline; vertical-align: baseline; \">https://en.wikipedia.org/wiki/Cannabis_strains</span></a> </p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">GanjaRoad.com is an online portal for cannabis providers and related businesses to advertise their products and services. While California retail shops are not scheduled to open until January of 2018, you can search for and post classified ads for cannabis related employment, grow equipment, real estate, legal services and consulting services along with ads for dispensaries, doctors and delivery services to acquire cannabis for medicinal purposes.</span></p><div><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \"><br /></span></div></span>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','LqzBmOVjmU.jpg',1998,1,NULL,NULL,'2017-07-06 19:40:01','2017-07-06 19:40:01',NULL),(45,1,49,'Why we changed our name to GanjaRoad.com','why-we-changed-our-name-to-ganjaroad-com','<span id=\"docs-internal-guid-743bc8cf-2a17-101b-a623-5c453f4151ff\"><span id=\"docs-internal-guid-db73c952-42ed-b0be-d92f-8190e0dc0b26\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\">&nbsp;</p><div><span id=\"docs-internal-guid-bf367c4d-42f5-0e72-9281-49c1cb0916ca\"><span style=\"font-size: 12pt; font-family: Arial; vertical-align: baseline; \">It is almost certain that you enjoy one or more songs from Reginald Kenneth Dwight without even knowing it. And if you don&#8217;t use a company originally named Backrub on a daily basis, you are definitely in the minority. You may even use Backrub to find Reginald Kenneth Dwight&#8217;s music from time to time.</span></span></div><div>&nbsp;</div><div><span style=\"font-family: Arial; font-size: 12pt;\">Pepsi, Ebay, Nike, Pentium, PayPal, and Yahoo are examples of well-known businesses who weren&#8217;t always called what you now know them as. Now, we share something in common with these brand success stories - we&#8217;ve changed our name to GanjaRoad.com.</span></div><span id=\"docs-internal-guid-bf367c4d-42f4-1fd7-5f94-0eef1a94677c\"><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Arial; vertical-align: baseline; \">When we began our operation, it was because we saw a need in the cannabis industry that wasn&#8217;t being met - a one stop portal that aggregates suppliers, dispensaries, growers, manufacturers, doctors, delivery services, and any other industry related businesses in one place for consumers to easily locate and shop. We wanted to give marijuana- related businesses a place to advertise their goods and services, placing themselves where cannabis consumers would easily find them.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Arial; vertical-align: baseline; \">Craig Taliaferro has been involved in the cannabis industry for over 50 years so when he decided to launch an online platform for cannabis providers and related businesses to advertise their products and services naming the company after himself seemed a reasonable idea.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Arial; vertical-align: baseline; \">According to the website, HowManyOfMe.com, there are 334,866 people in the U.S. with the first name &#8220;Craig,&#8221; making it the 199th most popular name in America. It certainly doesn&#8217;t make &#8220;Craig&#8221;all that unique but in the world of business, that may or may not matter much because our Craig isn&#8217;t the only Craig with an online business named after himself and the other Craig has deep pockets. He is able to afford high priced attorneys who don&#8217;t much care for the name &#8220;Craig&#8221; being used for other businesses.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Arial; vertical-align: baseline; \">In November of 2016 we launched the beta version of our site. We had owned the domain for several years and used it for a California patient delivery system and dispensary distribution site. With the looming change in marijuana laws across the country, particularly in our home state of California, it seemed a good time to expand our vision and launch something more ambitious. So, we invested the money into developing a beta site and then began efforts to brand ourselves. We would soon find out our branding efforts were successful with at least one guy.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Arial; vertical-align: baseline; \">Our brand made an impact. That became apparent in April of this year when we received a cease and desist letter asking us to stop using our domain name because it might confuse people. Being in the industry we are in, confused people aren&#8217;t all that unfamiliar to us (we&#8217;re joking, friends) but confusion seemed unlikely to us. We weren&#8217;t advertising used sofas, roommates, missed connections or more unseemly services. We were a pot portal, a place for fans of medicinal and recreational marijuana to find everything they could possibly need. That other Craig and our Craig had two completely different consumers and industries to serve. But when a behemoth of a company sends a stern letter, most people would be smart to take notice. We did, putting an end to any claims of alleged trademark infringement.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Arial; vertical-align: baseline; \">We did some research and found that our Craig wasn&#8217;t alone. There were other Craigs who had received letters and lawsuits. We didn&#8217;t want to get into a name war with anyone. If you fight one Craig, there are at least 334,865 others to worry about and it looked like this Craig had gone to battle with some of them already. Rather than argue, we decided to embrace the opportunity to change course and rebrand ourselves. If Ebay, Pepsi, and all those other companies could do it and achieve such enormous success, then perhaps this would add to our origin story, giving us a feather in our cap like others who started being called one name only to change their identity entirely and become a household name.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Arial; vertical-align: baseline; \">Now we are GanjaRoad. It isn&#8217;t easy to go through a name change when you have already spent money, effort and resources branding as something else. But this really might be the best thing that could happen to us. GanjaRoad implies something we care about - legalized cannabis and marijuana and forward thinking. We are committed to an industry we love. The country has shifted its thinking in recent years, learning that pot isn&#8217;t just for hippies and surfers but offers benefits to a myriad of different ailments that impact almost everyone at one time or another. We believe in what we do. We believe in the people who are working hard to bring high quality products and services to consumers. We believe in the spirit of entrepreneurialism and the folks willing to take risks in order to achieve, and we believe strongly that the fastest growing industry in America is only going to get bigger, better, stronger, and more diverse as we move forward. GanjaRoad is prepared to be as big a part of that trajectory as we possibly can and we are excited to be able to help business owners and consumers find each other and grow.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Arial; vertical-align: baseline; \">Forget our old name. Get to know us as GanjaRoad.com. You know Reginald Kenneth Dwight as Elton John, and Backrub as Google. If they can reinvent themselves, we can too. Visit GanjaRoad.com for all your marijuana and cannabis related needs.</span></p></span></span><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #222222; background-color: #ffffff; vertical-align: baseline; \">-------------------</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 10pt; font-family: Verdana; color: #222222; vertical-align: baseline; \">GANJAROAD.COM is an online portal for cannabis providers and related businesses to advertise their products and services. GanjaRoad.com offers provider ads for dispensaries, deliveries, grow stores and doctors as well as user to user classified ads for products, jobs, real estate and services related to the cannabis industry. For more information please visit GanjaRoad.com or call (888) 904-WEED and follow us on social media - Facebook - Twitter - Instagram using @GanjaRoad&nbsp;</span></p><div><span style=\"font-size: 10pt; font-family: Verdana; color: #222222; vertical-align: baseline; \"><br /></span></div></span>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','bYhNVRbECe.png',190,1,NULL,NULL,'2017-07-09 18:24:31','2017-07-14 14:15:37',NULL),(46,1,49,'CANNABIS PAIRINGS ARE THE HIP NEW THING IN THE CULINARY WORLD','cannabis-pairings-are-the-hip-new-thing-in-the-culinary-world','<span id=\"docs-internal-guid-2acfb764-33d3-522a-d721-9db805751635\"><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">In less than six months, recreational marijuana will be legal in the state of California and the exploding interest in all things cannabis is gaining a lot of momentum. From startups to foodies pairing their ganja with their meals, marijuana is providing inspiration for folks excited about participating in the mainstreaming of pot.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">In a recent story by NPR, they draw parallels between the weed industry and wine industry, &#8220;</span><span style=\"font-size: 12pt; font-family: Verdana; color: #333333; background-color: #ffffff; vertical-align: baseline; \">With recreational marijuana about to be legal in the Golden State, some cannabis entrepreneurs are looking to the wine industry as a model&#8221;. </span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #333333; background-color: #ffffff; vertical-align: baseline; \">California transitioning from a state that has allowed medicinal use marijuana for over two decades to joining the states who have opened to doors to recreational use cannabis, seems to be a tipping point.<div title=\"Print Page Break\" style=\"font-size: 1px; page-break-before: always; vertical-align: middle; height: 1px; background-color: #c0c0c0\">&nbsp; </div></span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #333333; background-color: #ffffff; vertical-align: baseline; \">From NPR:</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">&#8220;Recreational marijuana is now legal</span><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">&nbsp;in eight states and the District of Colombia.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">But the prize is California, where American cannabis has the deepest historical, cultural and agronomic roots. California was the first state to legalize medical marijuana 21 years ago; in November, voters gave the green light to cannabis for fun.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">Northern California\'s legendary Emerald Triangle&nbsp;</span><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">of Humboldt, Mendocino and Trinity counties produces some of the world\'s most sought-after pot.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">As it happens, just south of the Triangle lie the state\'s famed wine-growing counties of Sonoma and Napa.&#8221;</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">Though some folks snicker at the idea of pairing foods with specific marijuana strains, inevitably finding a joke about the marijuana munchies aimed to undermine the entire concept, many people are taking pairings seriously. Already, restaurateurs across the country are beginning to offer special event pairing dinners, some even making it part of their regular service.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">Rolling Stone magazine did an </span><a href=\"http://www.rollingstone.com/culture/haute-pot-pairings-inside-world-of-marijuana-meals-w439452\" style=\"text-decoration-line: none;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #1155cc; text-decoration-line: underline; vertical-align: baseline; \">in depth piece</span></a><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \"> on the topic, speaking to a number of people including a couple who run a restaurant in Oregon.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">&#8220;Ginger and Brigham Edwards, who run a pot-friendly bed and breakfast called </span><a href=\"http://northfork53.com/\" style=\"text-decoration-line: none;\"><span style=\"font-size: 12pt; font-family: Verdana; color: #1155cc; font-style: italic; text-decoration-line: underline; vertical-align: baseline; \">North Fork 53</span></a><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">, are convinced pot pairing has a scientific basis and will soon be as popular as wine pairing. Ginger, an organic farmer, and her husband, an herbalist, acquired a river-front property in Nehalem, a small town on the Oregon coast. They opened for business nine days after rec pot was legalized in 2015. In the kitchen, they use only food from local farmers and fishermen, and for pairing, only cannabis from nearby growers.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">They studied terpenes, the essential oils found in cannabis and all plants. Each strain of marijuana has a different blend or &#8216;profile&#8217; of terpenes, which produces a unique scent and taste.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">&#8216;This is not like wine, which has a long history of pairing from different regions and a large repertoire to draw from,&#8217; Ginger says. &#8216;This is a new field, and we had a blank slate. We\'re the ones making some of the first pairings.&#8217;</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; font-style: italic; vertical-align: baseline; \">For New Year\'s Eve this year, they held a Moroccan dinner, honoring a culture where people have been smoking hashish in hookahs for centuries. Ginger met with growers and a Moroccan-trained chef. They identified a range of flavors in the local strains &#8211; spicy, lemony, earthy and musky &#8211; and began experimenting with dishes that would amplify those flavors.&#8221;</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">Food pairings offer an exciting new opportunity as we see the laws across the nation shift toward embracing pot and all its benefits, medicinal and otherwise.</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">LINKS</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">ROLLING STONE</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"text-decoration-line: underline; font-size: 12pt; font-family: Verdana; color: #1155cc; vertical-align: baseline;\"><a href=\"http://www.rollingstone.com/culture/haute-pot-pairings-inside-world-of-marijuana-meals-w439452\" style=\"text-decoration-line: none;\">http://www.rollingstone.com/culture/haute-pot-pairings-inside-world-of-marijuana-meals-w439452</a></span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 12pt; font-family: Verdana; vertical-align: baseline; \">NPR</span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"text-decoration-line: underline; font-size: 12pt; font-family: Verdana; color: #1155cc; vertical-align: baseline;\"><a href=\"http://www.npr.org/sections/thesalt/2017/07/10/535822257/pairing-wine-and-weed-is-it-a-california-dream-or-nightmare\" style=\"text-decoration-line: none;\">http://www.npr.org/sections/thesalt/2017/07/10/535822257/pairing-wine-and-weed-is-it-a-california-dream-or-nightmare</a></span></p><p dir=\"ltr\" style=\"1.38;0pt;0pt;\"><span style=\"font-size: 10pt; font-family: Verdana; color: #222222; background-color: #ffffff; vertical-align: baseline; \">GANJAROAD.COM is an online portal for cannabis providers and related businesses to advertise their products and services. GanjaRoad.com offers provider ads for dispensaries, deliveries, grow stores and doctors as well as user to user classified ads for products, jobs, real estate and services related to the cannabis industry. For more information please visit GanjaRoad.com or call (888) 904-WEED and follow us on social media - Facebook - Twitter - Instagram using @GanjaRoad </span></p><div><span style=\"font-size: 10pt; font-family: Verdana; color: #222222; background-color: #ffffff; vertical-align: baseline; \"><br /></span></div></span>','','Connect with San Francisco and Los Angeles cannabis doctors on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Franciscso Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','CUoHJZA4sN.jpg',221,1,NULL,NULL,'2017-07-11 17:20:24','2017-07-11 17:20:24',NULL),(47,4,49,'Craigslist Doesn\'t Want Craig Using His Name to Sell Weed','craigslist-doesn-t-want-craig-using-his-name-to-sell-weed','<div><strong style=\"color: #444444; font-family: arial, sans-serif; font-size: 13px; background-color: #ffffff;\">Craigslist asks marijuana businessman Craig Taliaferro to cease and desist using his name</strong>&nbsp;</div><div>&nbsp;</div><div><span style=\"color: #111111; font-family: arial, sans-serif; font-size: 13px; background-color: #ffffff;\"><strong>SAN DIEGO</strong> - <strong>July 20, 2017</strong> - <em><a href=\"https://www.prlog.org/\" style=\"color: #6080f0; 1.5; text-decoration-line: none;\">PRLog</a></em> -- Craigsweed.com announces it has changed its name to GanjaRoad.com to prevent any unintended confusion with online classified website,  craigslist.org.</span></div><br style=\"color: #111111; font-family: arial, sans-serif; font-size: 13px; background-color: #ffffff;\" /><span style=\"color: #111111; font-family: arial, sans-serif; font-size: 13px; background-color: #ffffff;\">Recently, craigslist.org issued a \"cease and desist\" warning to Craigsweed.com President Craig Taliaferro regarding the use of website address Craigsweed.com. The letter asked Taliaferro to stop using the Craigsweed.com domain name as it \"willingly confuses people into thinking it is affiliated with craigslist.\"</span><wbr style=\"color: #111111; font-family: arial, sans-serif; font-size: 13px; background-color: #ffffff;\"><br style=\"color: #111111; font-family: arial, sans-serif; font-size: 13px; background-color: #ffffff;\" /><br style=\"color: #111111; font-family: arial, sans-serif; font-size: 13px; background-color: #ffffff;\" /><div><span style=\"color: #111111; font-family: arial, sans-serif; font-size: 13px; background-color: #ffffff;\">While initially frustrated at not being able to use his own name, Taliaferro - a nearly 50 year veteran of the cannabis industry - decided to change the company name despite having invested significant resources into launching the startup. The name change to GanjaRoad.com has already taken effect.</span></div><div>&nbsp;</div><div><a href=\"https://www.prlog.org/12653368-craigslist-doesnt-want-craig-using-his-name-to-sell-weed.html\">TO READ THE REST OF THE PRESS RELEASE CLICK HERE&nbsp;</a></div>','https://www.prlog.org/12653368-craigslist-doesnt-want-craig-using-his-name-to-sell-weed.html','The latest news about the cannabis and marijuana industry. ','\r\nCannabis, Marijuana, news, dispensaries, legalization, medicinal, recreational','za3ZtLVvKJ.jpg',322,1,NULL,NULL,'2017-07-20 15:45:02','2017-07-21 12:48:39',NULL),(48,4,12,'This San Diego Sheriff Candidate Is Running On A Pot-Friendly Platform','this-san-diego-sheriff-candidate-is-running-on-a-pot-friendly-platform','<p style=\"  0px;  0px; font-size: 1.1rem; vertical-align: baseline; 1.55; font-family: &quot;PT Serif&quot;, sans-serif; background-color: #ffffff;\">The regulatory environment for cannabis in San Diego County could see dramatic change if candidate <a href=\"https://www.davemyersforsheriff.com/\" rel=\"nofollow\" style=\"text-decoration-line: none;   0px;  0px; vertical-align: baseline; opacity: 1; transition: all 0.25s; color: #000000; box-shadow: #00ff22 0px -4px 0px inset;\">Dave Myers</a> is elected sheriff in 2018. Myers, who is currently a commander in the San Diego County Sheriff&#8217;s Department, will be running against incumbent Bill Gore, a staunch <a href=\"https://hightimes.com/culture/the-biggest-prohibitionist-lie/\" style=\"text-decoration-line: none;   0px;  0px; vertical-align: baseline; opacity: 1; transition: all 0.25s; color: #000000; box-shadow: #00ff22 0px -4px 0px inset;\">opponent of legalized cannabis</a>.</p><p style=\"  0px;  0px; font-size: 1.1rem; vertical-align: baseline; 1.55; font-family: &quot;PT Serif&quot;, sans-serif; background-color: #ffffff;\">Running on a platform of diversity, inclusivity and transparency, Myers is actively seeking support from the many different communities that make up California&#8217;s second-most populous county. That includes the cannabis community. Myers has appeared at <a href=\"https://hightimes.com/news/political-candidates-courting-ganjapreneurs/\" style=\"text-decoration-line: none;   0px;  0px; vertical-align: baseline; opacity: 1; transition: all 0.25s; color: #000000; box-shadow: #00ff22 0px -4px 0px inset;\">functions hosted by cannabis industry groups</a> and medical marijuana advocates.</p><p style=\"  0px;  0px; font-size: 1.1rem; vertical-align: baseline; 1.55; font-family: &quot;PT Serif&quot;, sans-serif; background-color: #ffffff;\">&#8220;For too many years, law enforcement has marginalized and alienated the cannabis community,&#8221; Myers told High Times.</p>READ THE REST OF THE STORY<a href=\"https://hightimes.com/news/sheriff-candidate-pot-friendly-platform/\"> HERE</a> ','https://hightimes.com/news/sheriff-candidate-pot-friendly-platform/','The latest news about the cannabis and marijuana industry. ','Cannabis, Marijuana, news, dispensaries, legalization, medicinal, recreational','2qXttMeuPo.jpg',126,1,'2017-12-13 00:00:00','2018-06-05 00:00:00','2017-12-13 17:03:13','2017-12-13 17:03:13',NULL),(49,1,12,'Busting the Myths Around Marijuana','busting-the-myths-around-marijuana','<p style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n150%\">A survey conducted by the United Nations revealed that 158.8 million people all over the world use marijuana &#8211; making it one of the most popular drugs worldwide. In the US, for instance, the growing popularity of the drug has to do with changing laws. With its legalization in thirty states, as well as the District of Columbia, more and more people are warming up to the idea of marijuana usage.<br /><br />Along with the social stigma that surrounds drugs, there are a number of myths that are associated with marijuana: from the belief that using marijuana induces people to commit crimes to the rather conservative view that marijuana is usually used by college kids as an act of rebellion. However, with its growing popularity, it becomes important to disprove these myths because of the numerous benefits that otherwise accrue can be gained from marijuana usage.<br /><br />Before you decide to start or stop using marijuana, have a look at this list of busted myths as it could completely sway your decision in the opposite direction.<br /><br />Myth: Marijuana users are at a higher risk of being victims of lung cancer<br /><br />Fact: In general, prolonged exposure to smoke increases the risk of lung cancer; however, the effects of using marijuana seeds  are quite the opposite. A number of studies have found that instead of enhancing, cannabis prevents the growth of cancerous tumors. The presence of cannabinoids in marijuana seeds can be responsible for destroying cancer cells without harming the surrounding cells, and in the past, people have often been blessed with positive results after they decided to trade in painful chemotherapy sessions for marijuana.<br /><br />With research on the matter still underway, it&#8217;s too soon to start using the drug to treat high-risk cases; but that hasn&#8217;t stopped many researchers from viewing cannabis as the future of cancer medication. Apart from being the potential cure for cancer, medical marijuana has a number of other established health benefits like controlling epileptic seizure, decreasing anxiety and preventing nausea.<br /><br />Myth: Marijuana is a gateway drug<br /><br />Fact: It\'s commonly believed that smoking marijuana eventually leads to the use of harder drugs like heroin and cocaine since continued usage makes the body immune to the high from marijuana seeds. According to National Household Survey on Drug Use and Health-  slightly less than half of Americans over the age of 12 have used marijuana at some point in their lives, only around 15% of  Americans have tried cocaine and less than 2% have used heroin. Therefore, even though marijuana users are more likely to graduate to harder drugs than non-users, a majority of those who smoke pot do not go on to use harder substances, thus, disproving the gateway drug theory.<br /><br />Myth: Overdosing on marijuana can be lethal<br /><br />Fact: The short-term effects of cannabis may be intense: ranging from severe anxiety to hallucinations; in fact, in 2005, the United States saw 242,200 emergency room visits that involved marijuana use. However, it&#8217;s interesting to note that it\'s almost impossible to take a lethal dose of marijuana. Even though it\'s possible to consume more weed than the recommended amount, there have been no known cases of marijuana-induced deaths. This is because the amount of marijuana that needs to be taken at a time for it to be potentially lethal is physically impossible for any single individual to consume in one go.<br /><br />Myth: Legalization of medical marijuana would lead to an increase in the number of teenagers who use the drug<br /><br />Fact: In 2007, it was found that 6.7% of people falling in the bracket of 12 to 17 years of age were marijuana users. However, since then, a number of studies have shown that there is no direct or traceable relation between legalization of marijuana and teen drug use. Moreover, legalization allows the supply and distribution of marijuana seeds to be monitored by regulatory bodies and makes it tougher for kids to access the drug.<br /><br />At the same time, as more and more avenues of discussion on marijuana open up, it leads to increase in awareness among all age groups and limits the spread of misinformation. For instance, after marijuana was legalized in the state of Colorado, the state-level data from the National Survey on Drug Use and Health revealed that the number of teenagers using marijuana had  fallen from 20.81% in 2013-14 to 18.35% in 2014-15.<br /><br />As the world is coming to know of more and more benefits of the drug, it\'s important that we, as a society, encourage discussion and awareness on marijuana usage, instead of allowing it to remain a taboo subject. If embraced with open arms, medical cannabis has the potential to become the future of cancer medicine, as well as overall medical innovation. <br /><br />GANJAROAD.COM is an online community for cannabis providers and related businesses to advertise their products and services. GanjaRoad.com offers provider ads for dispensaries, deliveries, grow stores and doctors as well as user to user classified ads for products, jobs, real estate and services related to the cannabis industry. For more information please visit GanjaRoad.com or call (888) 904-WEED and follow us on social media - Facebook - Instagram using @GanjaRoad <br /><br /></p><div id=\"UMS_TOOLTIP\" style=\"position: absolute; cursor: pointer; z-index: 2147483647; background: transparent; top: -100000px; left: -100000px;\"></div>','','Connect with marijuana providers  on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, events, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Francisco Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco','wM2TNGQFp4.jpg',71,1,NULL,NULL,'2018-04-27 13:22:40','2018-07-17 13:23:53',NULL),(50,1,12,'5 Proven Benefits of Eating Hemp Seeds','5-proven-benefits-of-eating-hemp-seeds','<p align=\"center\" style=\"text-align: center; line-height: 150%;\"><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Hemp seeds are originated from Cannabis Sativa, which are from the same species as cannabis.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Hemp seeds or hemp hearts are dark brown in appearance and have a nutty flavor. They are full of essential nutrients, required by the human body. The amount of THC in hemp seeds is only minimal and thus do not produce the drug like effects of marijuana.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Both cannabis seeds and hemp seeds have health benefits. Just ensure that the dispensary is certified when you shop for cannabis seeds or get organic hemp seed options at your local health store.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">The multiple benefits of consuming hemp seeds. The top 5 of them are listed below:</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">1.     Hemp Seeds Are Nutrition- Packed</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Hemp seeds are high on protein, 25% of the total calories are from rich protein. The two essential proteins are albumin and edestin which are available in plenty in hemp hearts. These are actually superior quality storage proteins.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Consumers can also benefit from great health as these seeds also contain gamma- linolenic acid.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">According to the florida healing connection, they are high in essential fatty acids, alpha- linolenic acid (omega 3) and linoleic acid (omega- 6).</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Being a rich source of dietary fiber, zinc, sulfur, potassium, phosphorus, calcium, iron, sodium, vitamin E and magnesium, they can be consumed roasted, cooked or even raw. There is a high level of arginine- which is anti- inflammatory in nature as well as an amino acid.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">The incredible presence of all these essential nutrients make hemp seeds a wholesome food. Consumers can benefit from various micronutrients in measured proportions and overcome bodily deficiencies. They are even gluten free, which makes them safe to be consumed by gluten intolerant people.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">An interesting fact to be noted is that usually plant proteins lack one or two essential amino acids, but hemp seeds are one of the only few plant sources which are a complete source of protein. All 9 essential amino acids are present.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">2. Hemp Seeds Are A Boon For Skin</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Since hemp seeds contain omega- 3 and omega- 6 polyunsaturated fatty acids (PUFA), the oils in them penetrate to the innermost layers of the skin. They promote skin cell growth and reduce dryness which results in smoother, healthier skin.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Users of hemp seed oil have witnessed an improvement in their eczema. There was an increased level of essential fatty acids, which actually helped itchiness and dry skin. Hemp also improves digestion and removes allergens and toxins from the body, a possible trigger for eczema flare ups. It can be concluded that hemp seed oil bought from a health food store or dispensary makes the skin hydrated.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">3. Hemp Seeds May Protect From Cancer</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">The presence of THC in hemp seeds is minimal and when administered in prescribed amount, it can inhibit the growth of tumor cells. This makes them ideal to decrease the number of rising cancer patients globally.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Gamma linolenic acid, present in hemp hearts, is a proven anti- cancer compound. Thus, they are considered cancer protective both by the American Cancer Society as well as by natural health enthusiasts. It decreases or prohibits the growth of cancer cells and reduces the risk of cancer cells affecting other areas. Hemp seeds are also beneficial in reducing inflammation, thus they are useful in cancer therapies.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">4. Hemp Seeds Are Heart Friendly</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Due to the high presence of amino acid arginine, which produces nitric acid in the body, hemp seeds can reduce the risk of heart diseases. Nitric acid relaxes and dilates the blood vessels, which lowers the blood pressure, thereby reducing the risk of heart diseases.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">A study was conducted, in which in more than 13000 participants, increased level of arginine intake was associated with decreased levels of C- reactive protein or CRP. CRP is an inflammatory marker and is linked with heart diseases.</span></div><font face=\"arial\"><div style=\"text-align: left;\"><span style=\"font-size: 12px;\">Hemp seeds also contain gamma- linolenic acid, which reduces inflammation and can reduce heart related diseases.</span></div></font><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">5. Hemp Seeds Relieves Symptoms of PMS And Menopause</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">It is known that around 80% women go through emotional imbalance or physical symptoms, which are both caused by premenstrual syndrome (PMS). It is possible that these symptoms are caused by a sensitivity to the hormone prolactin.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">Hemp seeds contain gamma- linolenic acid or GLA, which produces prostaglandin E1. This reduces the effects of prolactin.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">A study was conducted on women suffering from PMS, in which they were administered with one gram of essential fatty acids per day. This led to the decrease in PMS related symptoms.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">GLA rich primrose oil can also be effective in decreasing the symptoms in women who have not benefited from other PMS therapies. Fatty acids can be effective against depression, reduce tenderness and breast pain, fluid retention and irritability- all related to PMS.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">GLA is also helpful in reducing the symptoms of menopause. Though conclusively unknown, it is possible that GLA helps in regulating inflammation and hormonal imbalance which are associated with menopause.</span></div><div style=\"text-align: left;\"><span style=\"font-size: 12px; font-family: arial;\">These benefits, among several others, prove that eating hemp seeds will definitely improve overall health. Introduce them into your everyday lifestyle and witness a change in your body.</span></div><div style=\"text-align: left;\">&nbsp;</div><div><span style=\"font-size: 12px; font-family: arial;\">GANJAROAD.COM is an online community for cannabis providers and related businesses to advertise their products and services. GanjaRoad.com offers provider ads for dispensaries, deliveries, grow stores and doctors as well as user to user classified ads for products, jobs, real estate and services related to the cannabis industry. For more information please visit GanjaRoad.com or call (888) 904-WEED and follow us on social media - Facebook - Instagram using @GanjaRoad&nbsp;</span></div><div style=\"text-align: left;\"></div><div style=\"text-align: left;\"></div></p>','','Connect with marijuana providers  on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, events, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Francisco Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco, hemp seeds','sud9VwLlGN.jpg',64,1,'2018-06-05 00:00:00',NULL,'2018-06-05 12:17:52','2018-07-17 13:22:04',NULL),(51,1,12,'Pros of Living the Cannabis Lifestyle','pros-of-living-the-cannabis-lifestyle','<p>With the evolution of medical marijuana, cannabis has become a part of people&#8217;s\r\neveryday life. People consume it on a daily basis as a preventative substance,\r\nlike a vitamin or a supplement in forms like edibles, tinctures, sprays, vapes\r\nor joints. The cannabis lifestyle is social. It&#8217;s about exploring and learning.\r\nCannabis enables people to be open-minded towards new ideas and new people,\r\nregardless. Cannabis also connects people unlike anything else. There are\r\nmarijuana and <u><a href=\"https://www.cigbuyer.com/\"></a></u> events organized worldwide\r\nfor cannabis enthusiasts. <br />\r\n</p>\r\n<p>In addition to helping people cope with daily life, cannabis is also good for\r\nalleviating regular aches and pains and fighting off bigger evils like\r\ndepression and anxiety. Whether you&#8217;re an everyday user or an occasional one,\r\nhere is an insight on embracing the cannabis lifestyle and how it can help make\r\nyour everyday life better:<br />\r\n&nbsp;<br />\r\n<strong>1. Helps Treat Pain<br />\r\n</strong>&nbsp;<br />\r\nCannabis has been found to help deal with minor to chronic pain ranging from\r\nmenstrual cramps and migraines to neuropathic and cancer-associated pain.\r\nRegular painkiller like opioids,&nbsp;\r\nantidepressants, and anticonvulsants are no longer adequate and can be\r\nmore harmful than good, and so people are switching to cannabis as it&#8217;s a\r\nhealthier and safer alternative as compared to strong painkillers.<br />\r\n&nbsp;<br /><strong>2.\r\nImproves Creativity <br />\r\n</strong>\r\n&nbsp;<br />\r\nResearch also suggests that marijuana can spark creativity and help you think\r\n&#8220;out of the box.&#8221; Carl Sagan, a popular and well-respected scientist who died\r\nin 1996, wrote extensively on the effects of marijuana and said that he more\r\nfully understood the meaning of the artwork, the message of music, and the\r\nintricacies of intellectual debates while he was under the influence of\r\nmarijuana. Due to this, cannabis is being consumed on a daily basis by people\r\nin the professional field like musicians and artisans.<br />\r\n&nbsp;<br />\r\n<strong>3. Helps Regulate Weight<br />\r\n</strong>\r\n&nbsp;<br />\r\nPeople struggle every day with weight loss or obesity. Cannabis can help to\r\nstabilize weight and also regulate blood sugar levels. As a result, daily\r\ncannabis use may be a good option for people struggling to maintain a healthy\r\nweight. You just have to determine the cannabis strains and products that don&#8217;t\r\nstimulate your appetite. Ensure to purchase it from a reliable, licensed\r\ndispensary or delivery service. <br /><br /><strong>4. Increases Energy Levels</strong><br /></p><div>Marijuana is known to make you feel happy and control extreme mood swings.\r\nSeveral strains of cannabis provide an instant energy boost. Strains like Blue\r\nDream, which is a Sativa-dominant hybrid is known as the quintessential\r\n&#8220;workout weed&#8221; as it sparks energy and helps to generate new ideas. Higher\r\nenergy levels can also help combat other problems like depression or anxiety.<br />\r\n<br />\r\n<strong>5. Provides Better Sleep<br /></strong><br />\r\nCannabis is also known to help you sleep better. It helps to ease your mind\r\nand allow you to fully relax and sleep. A good sleep means a well-rested mind\r\nand an active body. Daily use of cannabis can also help deal with chronic sleep\r\ndisorders like insomnia. Research has proven that CBD oil, prepared from the\r\nnon-psychoactive part of marijuana, influences the dopamine levels in our\r\nbloodstream during sleep. This leads to a better and more relaxed sleep.\r\nStrains like blueberry can help one relax. Find out <u><a href=\"http://www.ilovegrowingmarijuana.com/blueberry/\">more\r\ninformation about blueberry cannabis</a></u> before including it\r\nin your lifestyle.<br />\r\n<strong><br />6. Heightens Physical and Mental\r\nAwareness</strong><br />\r\n<br />Even <u><a href=\"http://www.thefloridahealingconnection.com/\">Tampa\r\nmarijuana doctors</a></u> believe that in smaller doses, CBD\r\nstimulates alertness and your heart rate can increase by 20 to 50 beats a\r\nminute. It can help reduce daytime fatigue which helps in normalizing the sleep-wake\r\ncycle. An alert mind is important for good performance throughout the day.<br />\r\nCannabis is being consumed as a supplement by cancer-fighting patients as it is\r\nshown to kill cancer cells or prevent the formation of new cancer cells. It is\r\nalso known to prevent further growth of a tumor. Cannabis can also help to deal\r\nwith pain and nausea associated with chemotherapy and other cancer-associated\r\nsymptoms. </div><div>&nbsp;</div><div><strong>7. Can Prevent Cancer</strong></div><div><br />Cannabis is being consumed as a supplement by cancer-fighting patients as it is shown to kill cancer cells or prevent the formation of new cancer cells. It is also known to prevent further growth of a tumor. Cannabis can also help to deal with pain and nausea associated with chemotherapy and other cancer-associated symptoms. <br /><br /><br />\r\n<strong>8. Aids Brain Functioning</strong><br />\r\n<br />Cannabis can increase nerve cells in the brain, which is a crucial aspect of\r\nour ability to learn. As we get older, our brain functioning slows as our\r\ncognitive ability decreases, and we are more susceptible to diseases like\r\nAlzheimer&#8217;s and Parkinson&#8217;s. Smoking weed daily could slow down this cognitive\r\ndeterioration and keep our brains effectual for longer.\r\n<br />\r\n</div><div>&nbsp;</div><div>There are still many questions about the effects of marijuana on the body and\r\nbrain and far more research is needed. Researchers are finding new benefits of\r\ncannabis on a daily basis. For everyday use, cannabis products with a high\r\nlevel of <u><a href=\"https://www.floridacbdconnection.com/single-post/2018/03/21/CBD-101---A-Detailed-Look-Into-CBD-Oil\"><span style=\"color:#1155CC\">CBD</span></a></u> and a negligible level of THC are recommended. While you should always talk to your doctor before adopting a daily marijuana regimen, this seems to be a valid option for many consumers.</div><div>&nbsp;</div><div>&nbsp;</div><div>GANJAROAD.COM is an online community for cannabis providers and related businesses to advertise their products and services. GanjaRoad.com offers provider ads for dispensaries, deliveries, grow stores and doctors as well as user to user classified ads for products, jobs, real estate and services related to the cannabis industry. For more information please visit GanjaRoad.com or call (888) 904-WEED and follow us on social media - Facebook - Instagram using @GanjaRoad </div>\r\n<div id=\"UMS_TOOLTIP\" style=\"position: absolute; cursor: pointer; z-index: 2147483647; background: none 0% 0% repeat scroll transparent; top: -100000px; left: -100000px;\"></div>\r\n<br />\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><br /></p>','','Connect with marijuana providers  on ganjaroad.com, the most reliable online resource to find cannabis-related dispensaries, doctors, deliveries, classified ads, medical cards, events, and news.','Marijuana, Ganjaroad, Cannabis Delivery, San Francisco Marijuana, San Diego Cannabis Delivery, Los Angeles Dispensaries, California Cannabis Doctors, Marijuana Delivery San Francisco, hemp seeds','PicyTApiwo.png',22,1,'2018-07-16 00:00:00',NULL,'2018-07-16 16:30:11','2018-07-17 13:19:27',NULL);
