;Calibri; Calibri;Calibri;Calibri;Calibri;color:#6633FF;font-weight:bold;language:en-US;en-US\">:  CBG&#8217;s SRS Series equipment is programmed for time, temperature and vacuum levels*.  As a result, there is no need to continuously and manually monitor/adjust temperature and vacuum levels, saving you time and labor.</span></p>    <p><span style=\"font-size:12.0pt;104%;font-family:Calibri; Calibri;Calibri;Calibri; Calibri;Calibri;Calibri;Calibri;Calibri; Calibri;Calibri;Calibri; color:#6633FF;underline;font-weight:bold; language:en-US;en-US\">Capacity</span><span style=\"font-size:12.0pt;104%;font-family:Calibri; Calibri;Calibri;Calibri; Calibri;Calibri;Calibri;Calibri;Calibri; Calibri;Calibri;Calibri; color:#6633FF;font-weight:bold;language:en-US;en-US\">:  CBG&#8217;s SRS Series is available in 8G (30L) and 15G (56L) sizes.  While all of this capacity does not need to be utilized to effectively process and purify essential oils, it does enable bulk lot production of essential oils. This automation, coupled with the SRS Series logarithmic       program, enables consistent processing outputting a consistent quality product batch to batch.</span></p>    <p><span style=\"font-size:12.0pt;104%;font-family:Calibri; Calibri;Calibri;Calibri; Calibri;Calibri;Calibri;Calibri;Calibri; Calibri;Calibri;Calibri; color:#6633FF;underline;font-weight:bold; language:en-US;en-US\">Preservation of Yield</span><span style=\"font-size:12.0pt;104%;font-family:Calibri;Calibri;Calibri; Calibri;Calibri;Calibri;Calibri;Calibri; Calibri;Calibri;Calibri;Calibri;color:#6633FF;font-weight:bold;language:en-US;en-US\">:  The CBG SRS Series operates in a controlled and enclosed environment within the unit&#8217;s footprint.  The SRS Series does not possess a boiling column and a condenser in sequence, thus the risk of valuable essential oils going up and into the condenser is avoided,     preserving valuable yield.</span></p>    <p><span style=\"font-size:12.0pt;104%;font-family:Calibri; Calibri;Calibri;Calibri; Calibri;Calibri;Calibri;Calibri;Calibri; Calibri;Calibri;Calibri; color:#6633FF;underline;font-weight:bold; language:en-US;en-US\">Materials of Construction and Safety</span><span style=\"font-size:12.0pt;104%;font-family:Calibri;Calibri;Calibri; Calibri;Calibri;Calibri;Calibri;Calibri; Calibri;Calibri;Calibri;Calibri;color:#6633FF;font-weight:bold;language:en-US;en-US\">:  The CBG SRS Series is made of high-quality stainless steel**, thereby avoiding expensive glass components.  The stainless steel configuration is also quite durable, not subject to cracking, breaking and a general limited useful life, as is the case with glass components.</span></p><div id=\"UMS_TOOLTIP\" style=\"position: absolute; cursor: pointer; z-index: 2147483647; background: transparent; top: -100000px; left: -100000px;\"></div>','2211 Lake Club Drive, Suite 205',0,'39.9362688','-82.83334009999999',1,1,0,0,0,0,49,'2016-12-15 15:31:55','2018-06-15 00:18:17','2018-05-14 00:00:01','2018-05-15 00:00:00',NULL,0.00,0,'',0),(96,434,'2017 World Medical Marijuana Business Conference & Expo','2017-world-medical-marijuana-business-conference-expo','<p>2017 World Medical Marijuana Business Conference &amp; Expo<br /></p><div>&nbsp;</div><div>April 21, 2017 Noon-9pm</div>April 22, 2017 10am-6pm<br /><br />David L. Lawrence Convention Center, Pittsburgh, PA<br /><br />Description:<br />Roll out the red carpet and attend our VIP ONLY event on Friday, April 21 for free drinks, appetizers, and live entertainment! Get a chance to meet and network with our sponsors, leading medical marijuana educators, businesses, and associations. Also, don&#8217;t miss your chance for a meet and greet with former NFL star, Ricky Williams, and other featured guest speakers!<br />We continue Saturday with a full day of events, including a medical education conference, educational seminars, panel discussions, and various business opportunities. We will also be featuring over 200 medical marijuana based busine