rd party laboratories to ensure quality and consistency.</p>','MGQFDkcXoZ.jpg','http://www.rawmmc.com','','','','','','',0,'',0,0,'18',1,0,0,'a:7:{s:6:\"sunday\";a:2:{s:2:\"am\";s:4:\"10am\";s:2:\"pm\";s:3:\"6pm\";}s:6:\"monday\";a:2:{s:2:\"am\";s:4:\"10am\";s:2:\"pm\";s:3:\"8pm\";}s:7:\"tuesday\";a:2:{s:2:\"am\";s:4:\"10am\";s:2:\"pm\";s:3:\"8pm\";}s:9:\"wednesday\";a:2:{s:2:\"am\";s:4:\"10am\";s:2:\"pm\";s:3:\"8pm\";}s:8:\"thursday\";a:2:{s:2:\"am\";s:4:\"10am\";s:2:\"pm\";s:3:\"8pm\";}s:6:\"friday\";a:2:{s:2:\"am\";s:4:\"10am\";s:2:\"pm\";s:3:\"8pm\";}s:8:\"saturday\";a:2:{s:2:\"am\";s:4:\"10am\";s:2:\"pm\";s:3:\"8pm\";}}',1,1,1,0,0,1,335,'32.7742488','-117.14118150000002','1234 main st','','US','San Diego','California','92108','2016-10-14 19:47:53','2018-05-22 03:00:02','2018-05-23 00:00:00','2018-07-31 00:00:00',NULL,0.00,0,'',0),(46,2,32,'Greentree Express Collective, Inc.','greentree-express-collective','<p align=\"center\" abp=\"5205\"><strong abp=\"5206\"><span class=\"wz-bold\" style=\"color: #2a7d33;\" abp=\"5207\"><span class=\"wz-bold\" style=\"color: #2a7d33;\" abp=\"5208\">, Inc. We are&nbsp; an organic company that believes in saving our ozone layer, and not polluting our bodies, or the earth with chemicals. So, if your looking for meds that have been treated with CO2 gas, or chemically enriched, sorry this is not the place for you. We are a group of old school growers who have gotten together to provide top quality&nbsp;medicinal marijuana&nbsp;strains, that have high&nbsp;CBD and&nbsp;CBN. As well as, high&nbsp;THC content to provide the best medicine available. 80% of all our strains are grown indoor, under lights, in our own mix of soil, and compost&nbsp;&nbsp;With a drip system, all our harvests are flushed a minimum of 7 days and cured to perfection. Just one look will tell you these meds are the real deal, with a medley of smells, flavors, looks,&nbsp;strains, and effects.</span></span><br abp=\"5209\" /></strong></p><div abp=\"5210\">&nbsp;</