 recreational cannabis sector as well as throughout San Diego with additional dispensary locations.<br /><br />Staff: Our team here at Outliers cares about our patients and their medical marijuana needs. Our knowledgeable budtenders take the time to understand our patients\' needs, walk you through our cannabis selection and assist you on your journey to wellness.<br /><br />Menu: We are proud to offer OutCo strains, vape cartridges, concentrates and topicals. As a seed-to-sale company, we maintain control of our products at every stage, from cultivation to harvest, curing, extraction, packaging and sale. Our indoor grows use natural, sustainable products to ensure the highest quality products. OutCo has the only extraction license in San Diego County, allowing us to produce our own oil and vape cartridges using OutCo strains and supercritical CO2 extraction methods in our state-of-the-art lab. Our patients particularly love our OutCo Diamond OG, which typically tests at 24.5% THC. In addition to specialty flowers and extractions, Outliers also offers patients a selection of vendor cannabis goods, including CBD balms, topicals, tinctures, and an array of glass and smoking accessories.<br /><br />Service Locations: Based in El Cajon, Outliers lies in central San Diego county and serves qualifying patients throughout the area. Patients from the El Cajon, Santee, Winter Gardens, Hillsdale, Jamacha, Homelands, Spring Valley, Lemon Grove, La Mesa, Grossmont, Casa de Oro-Mount Helix, Jamul, Bostonia, La Presa, Rolando, Del Cerro, Lakeside, Eucalyptus Hills, Blossom Valley, Harbison Canyon, Crest, Dehesa, Granite Hills, Alpine, Miramar and Bonita regions all have quick, easy access to Outliers near the intersection of 8 &amp; 67.<br /><br />Location Information: El Cajon is a larger city in San Diego County, surrounded by mountains and northeast of downtown San Diego. Nearby Mission Trails Regional Park offers miles of hiking trails and mountain views down to the Lake Murr