e. Very strong and Indica, best for experienced.','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1346,46,4,1,'Rg087IQAte.jpg','House Shake','Looking for some nice shake? We mix our indoor bud shake together for a great mix. No trim or leaf just untouched jar shake.','','','','','','','','','','','','50','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1347,46,4,1,'hYo6surNlC.JPG','Kief Hash','Collected right out of the trim bin, pressed fresh and ready to hit you a good one. Also have Kief called Rips Diesel','','','','','','','10','','','','','','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1348,46,4,1,'QNAFihzXvV.JPG','Popcorn Bud','We gather all the small buds from all the strains for this potpourri of flavors. Indica, Hybrid, and Sativa will be found mixed here is this budget of a deal!','','','','','','','','','','','','100','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1349,46,4,1,'JBBFAZILR4.JPG','Queen Dee','This is a frosty girl, with heavy body effect can lead to couch lock. This girl is great for body aches and when you want to relax and enjoy your time. Her nose is strong, and the taste is full. Indica lovers will want this in their reserve. ','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1350,46,4,1,'CHT5UzyzCs.JPG','SFV OG','This Sativa-Dom Hybrid is available at a great price. Great for day pain relief. The nugs are large, with a earth pine nose, followed by lemon. If you enjoy a vaporizer this is the strain for you. This strain will get you in your nose. Once in your system you will feel the effects, starting in your body and moving to where you need to be. We got a screaming deal, passing on the saving to you.','','','','','','','','','','','','75','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1351,46,4,1,'UXtDLPQzkc.JPG','SoMango Kush','Grown by Rip Genetics, SoMango literally came from Barcelona, Spain! This gift is now available for you! This Jack Herer and Super Skunk, and Big Skunk Korean. Are you wanting medicine that will help you with strong body pain. First you feel it as you get stuck, then you feel it in your whole body. Be ready to not move. Great for chronic pain, sleepless nights, anxiety, and more. ','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1352,46,4,1,'mPvodGXPSi.JPG','Sticky Harmony','Rip created the wonderful strain by crossing his Goo with TGA Shangri-La of Fudo Myo-O and 9lb hammer.  He has now released this dreamy treat that is very fruity, and the indica helps at bedtime to lull you to sleep. Sticky Harmony is covered in orange hairs, and dense sweet nugs. ','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1353,46,4,1,'vMwfconlvj.JPG','Tru Cookies','Rip\'s Genetics created this strain by crossing Truth X Blue Forum cookie/GSC (clone only). If you\'re looking for a heavy hitter, this medicine is for you. The cookie lineage is noted in the spicy nose, but the flavor is all Truth, and the flavor will keep you wanting more. The effects are fairly energetic, and are perfect for getting things done. Beware, this girl is easy to overdue.','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1354,46,4,1,'4zACREsv6X.JPG','Wired Boss','Rip\'s Genetics created this strain by crossing Truth X Blue Forum cookie/GSC (clone only). If you\'re looking for a heavy hitter, this medicine is for you. The cookie lineage is noted in the spicy nose, but the flavor is all Truth, and the flavor will keep you wanting more. The effects are fairly energetic, and are perfect for getting things done. Beware, this girl is easy to overdue.','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1355,46,5,1,'iNdUGdNQ5I.JPG','Pure Power Plant','This favor is back, gifted from Daniel S., and has become a favorite. The  nose is strong, and so is the effect for a Sativa strain. The flavor is full, and travels to your nose. Sativa lovers need this strain in your reserve. Great for chronic pain, anxiety, stress from a long day.','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1356,46,5,1,'27JGqCyJ9r.JPG','Sour Tangie','Sour Tangie is cross between East Coast Sour Diesel and Tangie. Expect some pretty flowers that are large, covered with orange hairs, tangy nose, massive frost, citrus flavor you want in your Sativa. This strain is 80% Sativa, and tested at 27% THC. Expect an upper effect for your day time cannabis needs.','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1357,46,5,1,'vcvQY2bInG.JPG','Super Blue Dream','Sativa fans love this particular strain of Super Blue Dream.  That classic Blueberry comes through for a great day time strain. Known to do wonders with migraines, and so much  more. This strain is what it says, a favorite daytime Sativa!','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1358,46,6,1,'bryScv8MHT.JPG','24K Gold','Hit you in the nose this one! Kosher Kush x Tangie provide a wonderful mix. The Tangie is seen all over in delightful orange hairs. Nice structure to the nugs house the frost. Breath in the terphines on this one and catch the citrus, and you will notice the follow of the Kosher. The flavor just sits in your mouth, as you inhale her goodness. She then washes over you and you\'re ready to go. Great for the experienced, go slow if new.','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1359,46,6,1,'4hVBp0sUJF.JPG','Blood Lemon Tangie','King Genetics crossed Blood Tangie x Lemon Og. You will feel a cozy buzz that\'s helpful for chronic pain. The smoke hits you in your nose, and then it floats through you to where you want to be.','','','','','','','','','','80','130','240','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1360,46,6,1,'LdOcZuDk9P.JPG','Cherry Bomb','This is a great strain for day timers needing to get their day done. The genetics are unsure, possibly a skunk line crossed with a Hawaiian Sative. But the nose if very berry, and the smoke is as promised. If you are looking for a smooth strain, add this to your supply. For recreational users you won\'t get couch locked. The buds are dense, and covered in red hairs. This is a top shelf quality at a mid prices passed on to you!','','','','','','','','','','75','90','150','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1361,46,8,1,'dy7Rx7OfbM.JPG','High Tolerance Cookie Bar','Free Edible with every order that meets the minimum. They are 600 ML for the experienced. Please use with caution those that are new, cut in 4 pieces, and best 30 minutes before bedtime. Great for a long nights rest, chronic pain, muscle aches!!  A full pan is $75 = 16 Cookie Bars','','','','','','8','','','','','','','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1362,46,11,1,'6K9Vgawa9X.jpg','OG Kush','Mid Shelf\r\nGorilla Glue\r\nIndica Dominant\r\nWell Done Light Dep\r\n\r\nThis Indica-dominant flower is a smooth hitter, and is a couch lock for your enjoyment. The pine nose is found in the flavor. \r\n','','','','','','','15','','50','75','90','175','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1363,46,11,1,'4EhYUv7NOC.jpg','Strawberry Banana Goo','','','','','','','','','','','','','','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1364,46,13,1,'5m6SjbDVyD.jpg','Call For Available Strains','Clones  12\r\nTeens    25\r\nMothers 75','','','','','','12','','','','','','','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1365,46,14,1,'Z23CzCKdBJ.jpg','Craft Strain Seeds','Want to pheno hunt? Looking to start from the beginning? Call our grower for seeds. He  has a selection of Craft strains. One pack is $50. Three packs, mix and match, for $100','','','','','','50','','','','','','','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1366,46,17,1,'rM8IZVqzjG.jpg','Queen Dee','Dream Queen is a sativa-dominant hybrid, from the Bay Area, that gives a euphoric, dream-like state after a few puffs. Blue Dream x Space Queen makes Dream Queen’s very frosty, light green flowers will have you sticking your nose back in the jar again and again to experience their delicious fruity aroma.','','','','','','','','','','','','','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1367,46,17,1,'86ely2YVNj.jpg','Wired Boss','Made from Rip Genetics sweet trim. This was is pure, clean, and dank.','','','','','','','20','','','','','','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1368,46,30,1,'GohWlDgmbo.jpg','Mothers/Ready to flower','Need a mother plant? Looking to go right into flower and want to skip the veg stage? Call our grower for current strains. Ask questions during the call, call back if you have new questions.','','','','','','75','','','','','','','2018-06-24 14:31:17','2018-06-24 14:31:17'),(1369,46,30,1,'egaTZ682sX.jpg','Teens, call for current strains','Call for current strains. Speak to our grower, call back with growing questions.','','','','','','25','','','','','','','2018-06-24 14:31:17','2018-06-24 14:31:17');
