re that we may forward the Counter-Notification to the\r\nparty who sent us the DMCA Copyright Infringement Notice.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin:0in;margin-bottom:.0001pt\"><strong><em><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Paid Advertisements. &nbsp;&nbsp;</span></em></strong><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif; color: #333333; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">We may charge a fee to Advertisers wishing to post content in\r\nsome areas of the Website. The fee is an access fee permitting content to be\r\nposted in a designated area. &nbsp;Each Advertiser posting Content to the\r\nWebsite is responsible for said Content and compliance with this Agreement.\r\n&nbsp;All fees paid will be non-refundable in the event that Content is removed\r\nfrom the Service for violating the this Agreement.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin:0in;margin-bottom:.0001pt\"><strong><em><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Data Ownership and Usage</span></em></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">.\r\n&nbsp;&nbsp;As specified in the Company&#8217;s Privacy Policy, incorporated herein,\r\nwe will own all Aggregated Data, and the Privacy Policy will govern how we\r\ncollect and use personal information that is submitted through the Services. By\r\naccessing or using the Services, you agree to that you have read and accept our\r\nPrivacy Policy.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin:0in;margin-bottom:.0001pt\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">As explained in our Privacy\r\nPolicy, we have controls in place to prevent outside parties from stealing or\r\naccessing your data and personal information, but they are not foo