n&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><strong><em><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Modification. &nbsp;&nbsp;</span></em></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">The\r\nCompany reserves the right, at its sole and absolute discretion, to change,\r\nmodify, add to, supplement or delete any of these Terms of Service and/or\r\nPrivacy, and any and all referenced and/or incorporated exhibits or policies,\r\nprograms and guidelines. &nbsp;The Company will endeavor to notify you of any\r\nmaterial changes by email, but will not be liable for any failure to do so.\r\n&nbsp;If any future changes to these Terms of Service and/or Privacy Policy are\r\nunacceptable to you or cause you to no longer be in compliance with these Terms\r\nof Service, you must terminate, and immediately stop using, the Services.\r\n&nbsp;Your continued use of the Services following any revision to these Terms\r\nof Service constitutes your complete and irrevocable acceptance of any and all\r\nsuch changes.</span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:10.0pt;margin-left:\r\n.5in;text-indent:-.25in;vertical-align:\r\nbaseline\"><span style=\"font-size: 10pt; font-family: Symbol;\">&#183;<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><strong><em><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Assignment. &nbsp;&nbsp;</span></em></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">The\r\nCompany may assign these Terms of Service and/or Privacy Policy in whole or\r\npart at any time. &nbsp;However, you may not assign, delegate or transfer this\r\nAgreement in whole or in part, without the Company&#8217;s prior written consent.</span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:10.0pt;margin-left:\r\n.5in;text-indent:-.25in;vertical-align:\r\nbaseline\"><span style=\"font-size: 10pt; font-family: Symbol;\">&#183;<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><strong><em><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Choice of Law. &nbsp;&nbsp;</span></em></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">These\r\nTerms of Service and the relationship between you and the Company shall be\r\ngoverned by the laws of the State of California without regard to its conflict\r\nof law provisions. </span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:10.0pt;margin-left:\r\n.5in;text-indent:-.25in;vertical-align:\r\nbaseline\"><span style=\"font-size: 10pt; font-family: Symbol;\">&#183;<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><strong><em><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Arbitration. &nbsp;&nbsp;</span></em></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">ALL\r\nDISPUTES ARISING OUT OF OR RELATED TO THIS AGREEMENT OR ANY ASPECT OF THE\r\nRELATIONSHIP BETWEEN YOU AND THE COMPANY, WHETHER BASED IN CONTRACT, TORT,\r\nSTATUTE, FRAUD, MISREPRESENTATION OR ANY OTHER LEGAL THEORY, WILL BE RESOLVED\r\nTHROUGH FINAL AND BINDING ARBITRATION BEFORE A NEUTRAL ARBITRATOR INSTEAD OF IN\r\nA COURT BY A JUDGE OR JURY. &nbsp;YOU AND THE COMPANY HEREBY WAIVE THE RIGHT TO\r\nTRIAL BY A JURY. &nbsp;YOU AGREE THAT ANY ARBITRATION UNDER THIS AGREEMENT WILL\r\nTAKE PLACE ON AN INDIVIDUAL BASIS, AND THAT CLASS ARBITRATIONS AND CLASS\r\nACTIONS ARE NOT PERMITTED. &nbsp;YOU ARE EXPRESSLY AGREEING TO GIVE UP THE\r\nABILITY TO PARTICIPATE IN A CLASS ACTION. The arbitration will be administered\r\nby the American Arbitration Association under its Commercial Arbitration Rules\r\nand Mediation Procedures. &nbsp;Any arbitration hearing will be held in San\r\nDiego County, California. The applicable governing law will be California law\r\n(provided that with respect to arbitrability issues, federal arbitration law\r\nwill govern). The arbitrator&#8217;s decision will follow the terms of this Agreement\r\nand will be final and binding. The arbitrator will have authority to award\r\ntemporary, interim or permanent injunctive relief or relief providing for\r\nspecific performance of this Agreement, but only to the extent necessary to\r\nprovide relief warranted by the individual claim before the arbitrator. The\r\naward rendered by the arbitrator may be confirmed and enforced in any court having\r\njurisdiction thereof. &nbsp;This clause shall not preclude the parties from\r\nseeking provisional remedies in aid of arbitration from a court of appropriate\r\njurisdiction. &nbsp;<strong>&nbsp;<em></em></strong></span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:10.0pt;margin-left:\r\n.5in\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">In any arbitration proceeding to enforce rights under this\r\nAgreement, the prevailing party will be entitled to recover costs and\r\nattorneys&#8217; fees. &nbsp;</span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:10.0pt;margin-left:\r\n.5in\"><span style=\"font-size:11.5pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333\">TO THE FULLEST EXTENT PERMITTED BY APPLICABLE LAW, IF PARTIES TO\r\nTHIS AGREEMENT WANT TO ASSERT A DISPUTE (BUT NOT A EXCLUDED DISPUTE), THEN THE\r\nPARTIES MUST COMMENCE IT (BY DELIVERY OF WRITTEN NOTICE AS SET FORTH HEREIN\r\nUNDER &',1,'2016-07-31 18:29:28','2017-05-18 16:22:34',NULL),(5,1,'Ganjaroad Privacy Policy','privacy-policy','Please read the following Ganjaroad privacy policy carefully. When you use our website you acknowledge that you have read and agree to be bound by this privacy policy.\r\n','marijuana,dispensaries,doctors,delivery,grow stores,classified ads,news,information,Ganjaroad,Cannabis,hydroponics\r\n','<p><span>Updated\r\nas of May 201</span>7</p>\r\n\r\n<p><span>International\r\nAccess Media, Inc. (&#8220;Company&#8221;) values your privacy and is committed to\r\nmaintaining your trust.&nbsp; We provide this\r\nPrivacy Policy to inform you of our policies and procedures regarding the\r\ncollection, use, and disclosure of personally identifiable information received\r\nfrom users of this website located at </span><a href=\"http://www.ganjaroad.com/\" target=\"_blank\"><span>www.ganjaroad.com</span></a><span> (the \"Website\") and all\r\nother products and services, and all content offered as a part thereof (the\r\n\"Services\").&nbsp;</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Changes.&nbsp;&nbsp; </em></strong><span>This Privacy Policy may be updated from time to time for\r\nany reason, at our sole discretion.&nbsp; We\r\nwill notify you of any material changes to our Privacy Policy by posting the\r\nnew Privacy Policy on our Website.&nbsp; You are\r\nadvised to consult this Privacy Policy regularly for any changes. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Incorporation into\r\nTerms of Service.&nbsp;&nbsp; </em></strong><span>By using or accessing the Website\r\nor the Services, you are accepting the practices described in this Privacy\r\nPolicy, and you are consenting to our processing of your information as set\r\nforth in this Privacy Policy now and as amended by us. This Privacy Policy is\r\nincorporated into, and considered a part of, the Company&#8217;s Terms of Service.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Personal\r\nInformation.&nbsp;&nbsp; </em></strong><span>&#8220;Personal Information&#8221; may\r\ninclude, but is not limited to information that identifies you as an individual\r\nor relates to an identifiable person, such as name, postal address, telephone\r\nnumber, email address, etc.&nbsp; The Company\r\ndoes not collect any personal data from visitors to its website that is not\r\nvoluntarily provided.&nbsp; The Company only\r\ncollects your Personal Information if you register for an account with the\r\nCompany&#8217;s Website, when you use the Company&#8217;s Services, and when you send the\r\nCompany communications in connection with your use of the Services.&nbsp; </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Use and Sharing of\r\nPersonal Information.</em></strong><span>&nbsp; We use the information we\r\ncollect from our Website and your use of our Services to provide and improve\r\nexisting Services; to develop new Services; and to protect you and the\r\nCompany.&nbsp; We also may use this\r\ninformation to offer you tailored content when you visit our Website.&nbsp; We will not share your personal information\r\nwith anyone except for our Company&#8217;s authorized service providers,<a href=\"#footnote1\" name=\"_ftnref1\"><sup><sup><span>[1]</span></sup></sup></a> business affiliates,<a href=\"#footnote2\" name=\"_ftnref2\"><sup><sup><span>[2]</span></sup></sup></a> and business partners<a href=\"#footnote3\" name=\"_ftnref3\"><sup><sup><span>[3]</span></sup></sup></a> for business purposes; or\r\nunless we specifically inform you and give you an opportunity to opt out of our\r\nsharing your personal information. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>In\r\ngeneral, we may use and/or share your Personal Information:</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To respond to your inquiries and\r\nyour requests regarding our Services.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To send you information regarding\r\nour services and changes to our terms, conditions, and policies. </span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To complete your registration,\r\nprocess your payments, and communicate with you regarding your purchase of our\r\nServices.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To send you marketing communication\r\nand newsletters about our Services.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To personalize your experience on\r\nour Website.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To inform you and allow you to\r\nparticipate in our promotions.&nbsp; </span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To facilitate social sharing\r\nfunctionality.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To collaborate with business\r\naffiliates, partners, vendors, or service providers to provide you with our\r\nServices.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>In connection with our business\r\npurposes, including but not limited to data analysis, audits, fraud monitoring\r\nand prevention, developing or enhancing new and existing products and/or\r\nservices, expanding our business activities, etc. </span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>We will\r\nnot use and/or share your Personal Information:</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To run interest-based advertising\r\ncampaigns that collect personal data such as email addresses, telephone\r\nnumbers, and credit card numbers.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To use or associate personal data\r\nwith remarketing lists, cookies, data feeds, or other anonymous identifiers.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To use or associate targeting\r\ninformation, such as demographics or location, with any personal data collected\r\nfrom the ad or its landing page.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To share any personal data with\r\nGoogle or third party companies through our remarketing tag or any product data\r\nfeeds which might be associated with our ads.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To send Google or third party\r\ncompanies precise location information without obtaining your consent.<strong><em> </em></strong></span></span></p>\r\n\r\n<p><span>However, we reserve the right to disclose Personal\r\nInformation that we believe to be necessary or appropriate in the following\r\ncircumstances:</span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>As required by law, such as to\r\ncomply with a subpoena, or similar legal process.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>When we believe in good faith that\r\ndisclosure is necessary to protect our rights, protect your safety or the\r\nsafety of others, investigate fraud, or respond to a government request.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To enforce our Terms and\r\nConditions.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>To allow us to pursue available\r\nremedies or limit the damage we may sustain.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Personally\r\nNon-Identifiable Information</em></strong><span>:&nbsp;&nbsp; We may collect\r\npersonally non-identifiable information, including but not limited to\r\ndemographic data, age, profession, and geographic location from you at the time\r\nof registration, or when you choose to use our Services. This information is\r\nnot, by itself, sufficient to identify or contact you.&nbsp; The Company may store such information, or it\r\nmay be included in databases owned and maintained by partners, affiliates,\r\nagents, or service providers of the Company.&nbsp;\r\nThe Company may use such information and pool it with other information\r\nto track data related to growing the business, such as the total number of\r\nvisitors to our Website and the domain names of our visitors\' Internet service\r\nproviders.&nbsp; </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>Regarding\r\ngeographic location in particular, our Services may use location-based services\r\nin order to locate you so we may verify your location, deliver you relevant\r\ncontent based on your location as well as to share your location with partners,\r\naffiliates, agents, or service providers of the Company, if you first give us\r\npermission to do so.&nbsp; Please consider the\r\nrisks involved in disclosing your location information before enabling\r\nlocation-based services.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>We may,\r\nfrom time to time provide settings in the Service that permit you to disable\r\nlocation-based services. Changing setting options may not result in immediate\r\nchanges to the settings, which are subject to our operations and maintenance\r\nschedules. You should carefully consider the use of such settings to improve\r\ninformation display options and to ensure the settings are properly set and\r\nfunctioning in the manner desired. Notwithstanding the availability of privacy\r\npreference settings, please note that these settings are for your convenience\r\nonly.&nbsp; They do not employ complex data security\r\nprotection, and may not be error free. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Passively Collected\r\nInformation</em></strong><span>:&nbsp;&nbsp; Your visit to our Website may allow us to\r\nobtain certain additional, personally non-identifiable information that is\r\ncollected passively using various technologies.&nbsp;\r\nThis information includes but is not limited to, for example, IP\r\naddresses, browser types, date and time of page views, location information\r\nassociated with your IP address, domain names, your interactions to an ad\r\ndelivered by us or our ad technology partners and other anonymous statistical\r\ndata involving your use of the Website and/or our services.&nbsp; This information cannot presently be used to\r\nspecifically identify you.&nbsp; </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Aggregated Personal\r\nData</em></strong><span>:&nbsp;&nbsp; The Company may analyze your personal data\r\nprovided through the Website or in connection with rendering the Services, in\r\naggregate form.&nbsp;&nbsp; This aggregate\r\ninformation does not identify you personally.&nbsp;&nbsp;\r\nWe may share this aggregate data with our partners, affiliates, agents,\r\nor service providers for business purposes.&nbsp;&nbsp;\r\nWe may also disclose aggregated statistics to explain our Services to\r\ncurrent and prospective business partners, and to other third parties for other\r\nlawful, business-related purposes. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Customer Credit Card\r\nInformation.</em></strong><span>&nbsp;&nbsp; The Company uses a third party to keep a\r\nprotected copy of your credit card number. This billing data belongs to you,\r\nand by utilizing the Service, you grant the Company a license to use this data\r\nto bill you for services rendered. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Tracking and\r\nAdvertising.</em></strong><span>&nbsp;&nbsp; The Company&#8217;s Website may use technologies\r\nsuch as cookies and log files. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><strong><em>Cookies.&nbsp;&nbsp; </em></strong><span>When you visit our Website or otherwise interact with the\r\nService, we may send one or more &#8220;cookies&#8221; to your computer or other\r\ndevices.&nbsp; Cookies are alphanumeric\r\nidentifiers stored on your computer through your web browser and are used by\r\nmost websites to help personalize your web experience.&nbsp; Some cookies may facilitate additional site\r\nfeatures for enhanced performance and functionality such as remembering\r\npreferences, allowing social interactions, analyzing usage for site\r\noptimization, providing custom content, allowing third parties to provide\r\nsocial sharing tools, and serving images or videos from third party\r\nwebsites.&nbsp; Some features on this site\r\nwill not function if you do not allow cookies.&nbsp;\r\nWe may link the information we store in cookies to any Personal\r\nInformation that you submit while visiting our Website.&nbsp; </span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>We may use both session ID cookies and persistent\r\ncookies.&nbsp; A session ID cookie expires\r\nwhen you close your browser.&nbsp; A\r\npersistent cookie remains on your hard drive for an extended period of time.&nbsp; Persistent cookies enable us to track and\r\ntarget the interest of our users to enhance the experience on our site. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>Functional cookies, persistent and session type, store\r\ninformation to enable core site functionality, such as Live Chat and Client ID\r\nremembrance.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>Analytics cookies allow us to count page visits and\r\ntraffic sources so we can measure and improve the performance of our site and\r\nour marketing campaigns.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>Advertising cookies may be set through our Website by our\r\nadvertising partners. Data may be collected by these companies that enable them\r\nto serve up advertisements on other sites that are relevant to your interests. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>If you do not want information collected through the use\r\nof cookies, there is a simple procedure in most browsers that allows you to\r\nautomatically decline cookies, or be given the choice of declining or accepting\r\nthe transfer to your computer of a particular cookie (or cookies) from a\r\nparticular site.&nbsp; You may also wish to\r\nrefer to </span><a href=\"http://www.allaboutcookies.org/manage-cookies/index.html\" target=\"_blank\"><span>http://www.allaboutcookies.org/manage-cookies/index.html</span></a><span>.&nbsp;\r\n</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>If you\r\nreject cookies, you may still use our site, but some features on the site will\r\nnot function properly.</span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><strong><em>Log Files.&nbsp;&nbsp; </em></strong><span>A Log File is a file that records either events that occur\r\nin an operating system or other software runs, or messages between different\r\nusers of a communication software.&nbsp; Log\r\nfile information is automatically reported by your browser or mobile\r\napplication each time you access the Website or our Services.&nbsp; Along with cookies and web beacons, log files\r\nhelp provide additional functionality to the Website and Services and help us\r\nanalyze Website and Services usage more accurately.&nbsp; We and our third party tracking-utility\r\npartners may use log files on our Service to gather automatically gather and\r\nstore information including, but not limited to, internet protocol (&#8220;IP&#8221;)\r\naddresses, browser type, internet service provider (ISP), referring/exit pages,\r\noperating system, date/time stamp, and clickstream data, for business\r\npurposes.&nbsp; We may use Google Analytics,\r\nwhich uses cookies and other, similar technologies to collect and analyze\r\ninformation about use of the Service and report on activities and trends.&nbsp; This service may also collect information\r\nregarding the use of other websites, apps and online resources.&nbsp; You can learn about Google&#8217;s practices by\r\ngoing to </span><a href=\"http://www.google.com/policies/privacy/partners/\" target=\"_blank\"><span>www.google.com/policies/privacy/partners/</span></a><span>, and opt out of them by\r\ndownloading the Google Analytics opt-out browser add-on, available at </span><a href=\"https://tools.google.com/dlpage/gaoptout\" target=\"_blank\"><span>https://tools.google.com/dlpage/gaoptout</span></a><span>.<strong><em></em></strong></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>We may,\r\neither directly or through third party companies and individuals we engage to\r\nprovide services to us, also:</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>Track your use of our Website and\r\nthe Services for purposes of our own customer support, analytics, research,\r\nproduct development, fraud prevention, risk assessment, regulatory compliance,\r\ninvestigation, etc.</span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>Track your use of the Website and\r\nthe Services to enable you to use and access the Services and pay for your\r\nactivities on the Website and through the Services.&nbsp; </span></span></p>\r\n\r\n<p><span>&#9679;<span>&nbsp;&nbsp;&nbsp;&nbsp; </span><span>Track your behavior on our own\r\nWebsite and use of the Services to market and advertise our services to you on\r\nour Website platform and third party websites.&nbsp;\r\nYou may opt out of receiving advertisements by visiting the Network\r\nAdvertising Initiative (</span><a href=\"http://www.networkadvertising.org/choices/\" target=\"_blank\"><span>http://www.networkadvertising.org/choices/</span></a><span>) and/or the Digital Advertising\r\nAlliance (</span><a href=\"http://www.aboutads.info/choices/\" target=\"_blank\"><span>http://www.aboutads.info/choices/</span></a><span>).&nbsp;\r\nPlease note that even if you choose to opt-out of receiving targeted\r\nadvertising, you may still receive advertising on the Services, generally.&nbsp; The advertising will simply not be targeted\r\nor specific to your interests.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Children.</em></strong><span>&nbsp;&nbsp;\r\nThe Website and our related Services are not intended for anyone under\r\n18, and we do not knowingly collect information from anyone under the age of\r\n18.&nbsp; Anyone aged 18 or under should not\r\nsubmit any Personal Information without the permission of their parents or\r\nguardians.&nbsp; By using the Website and our\r\nrelated Services, you are representing that you are at least 18 years old. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Links to Other\r\nWebsites.&nbsp;&nbsp; </em></strong><span>This Privacy Policy applies only\r\nto this Website and the Company&#8217;s Services.&nbsp;\r\nIt does not apply to any third-party sites. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>This\r\nPrivacy Policy does not address, and we are not responsible for, the privacy,\r\ninformation or other practices of any third parties.&nbsp; The inclusion of a link does not imply\r\nendorsement of the linked site or service by us or by our affiliates.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>Please\r\nnote that we are not responsible for the collection, usage and disclosure\r\npolicies and practices (including the data security practices) of other organizations,\r\nsuch as Facebook, Apple, Google, Microsoft, RIM or any other app developer, app\r\nprovider, social media platform provider, operating system provider, wireless\r\nservice provider or device manufacturer, including any Personal Information you\r\ndisclose to other organizations through or in connection with the Website or\r\nService. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Security</em></strong><span>.&nbsp;&nbsp;\r\nWe maintain reasonable and appropriate, although not infallible,\r\nsecurity precautions.&nbsp; However, we cannot\r\nguarantee that hackers or unauthorized personnel will not gain access to your\r\nPersonal Information, despite our reasonable efforts.&nbsp; You should note that in using the Website and\r\nour related Services, your information will travel through third party\r\ninfrastructures which are not under our control.&nbsp; Please feel free to raise any questions,\r\nconcerns or specific directions you may have regarding the privacy and security\r\nof your information to info@ganjaroad.com.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Data Retention.&nbsp;&nbsp; </em></strong><span>We will retain your Personal Information for as long as\r\nneeded to provide the applicable Services, unless a longer retention period is\r\nrequired or permitted by law.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Do Not Track</em></strong><span>.&nbsp;&nbsp;\r\nYour browser setting may allow you to automatically transmit a \"Do\r\nNot Track\" signal to websites and online service you visit.&nbsp; The Company&#8217;s Website does not respond to\r\n\"Do Not Track\" signals or other mechanisms from a visitor\'s\r\nbrowser.&nbsp; If, in the future, we create a\r\nprogram or protocol to respond to such web browser \"Do Not Track\"\r\nsignals, we will inform you of the details of that protocol in this Privacy Policy.&nbsp; To find out more about \"Do Not\r\nTrack,\" please visit </span><a href=\"https://www.allaboutdnt.com/\" target=\"_blank\"><span>https://www.allaboutdnt.com</span></a><span>. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em><span>Google AdWords</span></em><span>. </span></strong><span>&nbsp;This Website uses the Google AdWords in order\r\nto advertise on third party websites (including Google) to previous visitors to\r\nour site or to similar audiences online. This may result in you seeing an\r\nadvertisement on the Google search results page, or a site in the Google\r\nDisplay Network.&nbsp; Google may include\r\nin-ads notice labels to disclose interest-based advertising to their\r\nusers.&nbsp; Third-party vendors, including\r\nGoogle, use cookies to serve ads based on someone\'s past visits to the\r\nWebsite.&nbsp; Any data collected will be used\r\nin accordance with our own privacy policy and Google\'s privacy policy. Google\r\nreserves the right to display to users which remarketing lists users are on,\r\nalong with the corresponding domain name. You can set preferences for how\r\nGoogle advertises to you using the Google Ad Preference Manager (</span><a href=\"https://www.google.com/settings/ads/onweb/\" target=\"_blank\"><span>https://www.google.com/settings/ads/onweb/</span></a><span>), and you can opt out of\r\ninterest-based advertising entirely by cookie settings or permanently using a\r\nbrowser plugin. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em><span>Analytics Software</span></em><span>.&nbsp;&nbsp;\r\n</span></strong><span>We and our\r\nthird party tracking-utility partners use log files on our Service to\r\nautomatically gather certain information, including but not limited to internet\r\nprotocol (&#8220;IP&#8221;) addresses, browser type, internet service provider (ISP),\r\nreferring/exit pages, operating system, date/time stamp, and clickstream data,\r\nfor analytics purposes.&nbsp; Specifically, we\r\nanalyze trends, administer the site, track users&#8217; movements around the Website,\r\nand&nbsp; gather demographic information about\r\nour user base as a in the aggregate.&nbsp; </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>We use <strong>Google Analytics</strong>, which uses cookies and\r\nother, similar technologies to collect and analyze information about use of the\r\nService and report on activities and trends.&nbsp;\r\nThis service may also collect information regarding the use of other\r\nwebsites, apps and online resources.&nbsp; </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>You can\r\nlearn about Google&#8217;s practices by going to </span><a href=\"http://www.google.com/policies/privacy/partners/\" target=\"_blank\"><span>www.google.com/policies/privacy/partners/</span></a><span>, and opt out of them by\r\ndownloading the Google Analytics opt-out browser add-on, available at </span><a href=\"https://tools.google.com/dlpage/gaoptout\" target=\"_blank\"><span>https://tools.google.com/dlpage/gaoptout</span></a><span>. </span></p>\r\n\r\n<p><strong><em><span>Your California Privacy Rights</span></em><span>.&nbsp;&nbsp;\r\n</span></strong><span>Under\r\nCalifornia Civil Code Section 1798.83, California customers are entitled to\r\nrequest information relating to whether a business has disclosed personal\r\ninformation to any third parties for the third parties&#8217; direct marketing\r\npurposes.&nbsp; You may request and obtain\r\nfrom us once a year, free of charge, certain information about the personal\r\ndata (if any) we disclosed to third parties for direct marketing purposes in\r\nthe preceding calendar year.&nbsp; If\r\napplicable, this information would include a list of the categories of personal\r\ndata that was shared and the names and addresses of all third parties with which\r\nwe shared information in the immediately preceding calendar year.&nbsp; If you are a California resident and would\r\nlike to make such a request, please submit your request in writing to info@ganjaroad.com.</span></p>\r\n\r\n<p><strong><em>Facebook Connect/Sign In with Twitter/Open ID\r\nProviders.&nbsp; </em></strong><span>&nbsp;You may log into your account on our Website\r\nand/or access our Services using sign-in services such as &#8220;Facebook Connect&#8221;\r\nand &#8220;Sign in with Twitter,&#8221; or another Open ID provider.&nbsp; These services will authenticate your\r\nidentity and provide you the option to share certain Personal Information with\r\nus such as your name and email address to pre-populate our registration\r\nform.&nbsp; Services like &#8220;Facebook Connect&#8221;\r\nand &#8220;Sign in with Twitter&#8221; give you the option to post information about your\r\nactivities on this Website to your profile page to share with others within\r\nyour network if you so choose.</span></p>\r\n\r\n<p><strong><em>Public Forum on our Website.&nbsp;&nbsp; </em></strong><span>Our Website offers publicly accessible message boards,\r\nblogs, and community forums to which you may contribute after logging into your\r\naccount on our Website.&nbsp; Posted information\r\non these platforms may be collected and used by others. To request removal of\r\nyour Personal Information from our blog or community forum, contact us at <a href=\"&#109;&#97;&#105;&#108;&#116;&#111;&#58;&#105;&#110;&#102;&#111;&#64;&#103;&#97;&#110;&#106;&#97;&#114;&#111;&#97;&#100;&#46;&#99;&#111;&#109;\" target=\"_blank\">info@ganjaroad.com</a>.&nbsp; In some cases, we may not be able to remove\r\nyour Personal Information, especially if it was already re-posted by another\r\nuser.&nbsp; If this is the case, we will let\r\nyou know if we are unable to do so and why in response to your request.</span></p>\r\n\r\n<p><span>You agree not to post on our Website any content that: (i)\r\nmay create a risk of harm, loss, physical or mental injury, emotional distress,\r\ndeath, disability, disfigurement, or physical or mental illness to you, to any\r\nother person; (ii) may create a risk of any other loss or damage to any person\r\nor property; (iii) seeks to harm or exploit children by exposing them to\r\ninappropriate content, asking for personally identifiable details or otherwise;\r\n(iv) may constitute or contribute to a crime or tort; (v) contains any\r\ninformation or content that we deem to be unlawful, harmful, abusive, racially\r\nor ethnically offensive, defamatory, infringing, invasive of personal privacy\r\nor publicity rights, harassing, humiliating to other people (publicly or\r\notherwise), libelous, threatening, profane, or otherwise objectionable; (vi)\r\ncontains any information or content that is illegal (including, without\r\nlimitation, the disclosure of insider information under securities law or of\r\nanother party\'s trade secrets); (vii) contains any information or content that\r\nyou do not have a right to make available under any law or under contractual or\r\nfiduciary relationships; or (viii) contains any information or content that you\r\nknow is not correct and current.&nbsp; You\r\nagree that any user content that you post does not and will not violate\r\nthird-party rights of any kind, including without limitation any intellectual\r\nproperty rights or rights of privacy. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>The\r\nCompany reserves the right, but is not obligated, to reject and/or remove any\r\nuser content on the blog/public forum or ads that the Company believes, in its\r\nsole discretion, violates these provisions.&nbsp;\r\nWe also reserve the right to block or remove any content we deem\r\ninappropriate, obscene, lewd, lascivious, filthy, violent, harassing,\r\ndefamatory, libelous, tortious, illegal, threatening, or otherwise objectionable,\r\nregardless of whether it was intended to be private or public.&nbsp; Since we do not review all content on our\r\nWebsite, we cannot guarantee that we will be able to take protective measures\r\nin the event that any user posts content that violates the terms of this\r\nprovision.&nbsp; However, when we become aware\r\nof content that we consider violates this provision (<em>i.e., </em>is offensive, illegal or could compromise the privacy of your\r\npersonal or confidential information or that of another person), we will make a\r\ngood-faith, reasonable effort to block or remove such content.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>The\r\nCompany takes no responsibility and assumes no liability for any user content\r\nthat you or any other user or third party posts or sends over the Website or\r\nmobile app, or any action you take in reliance on any user content posted by\r\nanother user.&nbsp; You shall be solely\r\nresponsible for your user content and the consequences of posting or publishing\r\nit, and you agree that we are only acting as a passive conduit for your online\r\ndistribution and publication of your user content.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span>Furthermore,\r\nyou understand and agree that you may be exposed to other people&#8217;s user content\r\nthat may be inaccurate, objectionable, inappropriate for children, or otherwise\r\nunsuited to your purpose, and you agree that the Company shall not be liable\r\nfor any damages you allege to incur as a result of exposure to such user\r\ncontent.</span></p>\r\n\r\n<p><span>You may self-edit and/or remove the content you posted on\r\nour Website and/or mobile app by logging into your account.&nbsp; Or, to request removal of any content that\r\nyou believe violates this provision or that you previously posted on our\r\nblog/community forum, you may &#8220;report this classified&#8221; to flag inappropriate\r\nposts, or alternatively, contact us at <a href=\"&#109;&#97;&#105;&#108;&#116;&#111;&#58;&#105;&#110;&#102;&#111;&#64;&#103;&#97;&#110;&#106;&#97;&#114;&#111;&#97;&#100;&#46;&#99;&#111;&#109;\" target=\"_blank\">info@ganjaroad.com</a>.&nbsp; In some cases, we may not be able to remove\r\nyour content, especially if it was already re-posted by another user.&nbsp; If this is the case, we will let you know if\r\nwe are unable to do so and why in response to your request.&nbsp; </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em><span>Testimonials,\r\nRatings and Reviews. </span></em></strong><span>&nbsp;If you submit testimonials, ratings, or\r\nreviews of the Services directly on our Website, any Personal Information you\r\ninclude will be displayed on the Website.&nbsp;\r\nWe may also partner with third-party service providers to collect and\r\ndisplay ratings and review content on our Website.&nbsp; If you provide our third-party service\r\nproviders with your Personal Information in the process of submitting your\r\nrating and review, the content and Personal Information collected by a third\r\nparty will be posted on our Website, absent your express instruction not to do\r\nso.&nbsp; If you want your testimonial,\r\nrating, or review removed from our Website at any time, please contact us at <a href=\"&#109;&#97;&#105;&#108;&#116;&#111;&#58;&#105;&#110;&#102;&#111;&#64;&#103;&#97;&#110;&#106;&#97;&#114;&#111;&#97;&#100;&#46;&#99;&#111;&#109;\" target=\"_blank\">info@ganjaroad.com</a>.\r\n</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em><span>Opt-Out Policy. </span></em><span>&nbsp;&nbsp;</span></strong><span>If, at any time after registering, you change your mind\r\nabout receiving information from us or about the use of information volunteered\r\nby you, or if you prefer that we do not share your Personal Information with\r\nthird parties for marketing purposes, please contact us at <a href=\"&#109;&#97;&#105;&#108;&#116;&#111;&#58;&#105;&#110;&#102;&#111;&#64;&#103;&#97;&#110;&#106;&#97;&#114;&#111;&#97;&#100;&#46;&#99;&#111;&#109;\" target=\"_blank\">info@ganjaroad.com</a>.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>Contact Us.&nbsp; </em></strong><span>&nbsp;If you have any\r\nquestions or concerns relating to our use of your Personal Information, please\r\nemail <a href=\"&#109;&#97;&#105;&#108;&#116;&#111;&#58;&#105;&#110;&#102;&#111;&#64;&#103;&#97;&#110;&#106;&#97;&#114;&#111;&#97;&#100;&#46;&#99;&#111;&#109;\" target=\"_blank\">info@ganjaroad.com</a>.&nbsp; Additionally,\r\nyou may reach us by postal mail at:</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p align=\"center\"><span>International Access Media, Inc.</span></p>\r\n\r\n<p align=\"center\"><span>1804\r\nGarnet Ave #161</span></p>\r\n\r\n<p align=\"center\"><span>San\r\nDiego, California 92109</span></p>\r\n\r\n<p>&nbsp;</p><p><sup><sup><span>[1<a name=\'footnote1\' id=\'footnote1\'></a>]</span></sup></sup><span>\r\nAuthorized service providers are companies that perform certain services\r\nincluding, but not limited to,, processing credit card payments, providing\r\ncustomer service and marketing assistance, performing business and sales\r\nanalyses, supporting the functionality of the Services, and supporting\r\ncontests, sweepstakes, surveys and other features we offer, on our behalf.&nbsp; These service providers may have access to\r\nyour Personal Information, but to the extent necessary to perform or fulfill\r\ntheir business purpose.&nbsp; We do not permit\r\nthem to share or use any of your Personal Information for any other purpose.</span></p>\r\n\r\n<p><sup><sup><span>[2<a name=\'footnote2\' id=\'footnote2\'></a>]</span></sup></sup><span>\r\nAffiliate businesses are those businesses with whom we may affiliate to sell\r\nour products or Services.&nbsp; We may share\r\ninformation we collect, including Personal Information, with affiliated\r\nbusinesses.&nbsp; Sharing such information\r\nwith our affiliates enables us to provide you with information about a&nbsp;</span><span>variety\r\nof products and Services that might interest you.&nbsp; We instruct all\r\naffiliated businesses to comply with applicable privacy and security laws and,\r\nat a minimum, in any commercial e-mail they send to you, to give you the\r\nopportunity to choose not to receive such email messages in the future.</span><span>\r\n\r\n\r\n\r\n</span></p><p><sup><span>[3<a name=\'footnote3\' id=\'footnote3\'></a>]</span></sup>&nbsp;<span>Business partners are\r\ntypically merchants offering the products, services, promotions, contests\r\nand/or sweepstakes in connection with or somehow related to our own products\r\nand Services.&nbsp; We will not share your Personal Information with business\r\npartners unless you choose to participate in their offer or program.&nbsp; When\r\nyou choose to engage in a particular offer or program, you authorize us to\r\nshare your email address and other Personal Information with the relevant\r\nbusiness partner.</span></p>\r\n\r\n<p>&nbsp;</p>',1,'2016-07-31 18:29:46','2017-05-18 18:44:55',NULL),(6,1,'asdf','sdfa','','','<p>asdf<br></p>',0,'2016-07-31 18:30:01','2016-09-06 11:16:17','2016-09-06 11:16:17'),(7,1,'sdfa','sdfa','','','<p>sdfa<br></p>',0,'2016-07-31 18:30:15','2016-09-06 11:18:34','2016-09-06 11:18:34'),(8,1,'sdfa','sdfa23','','','<p>sdfa<br></p>',0,'2016-07-31 18:32:20','2016-09-06 11:19:17','2016-09-06 11:19:17'),(9,1,'adsfasdf','fdsadf','','','<p>asdfas<br></p>',0,'2016-07-31 18:32:39','2016-09-06 11:19:10','2016-09-06 11:19:10'),(10,1,'adsfasdf','adfasd','','','<p>asdfasdf<br></p>',0,'2016-07-31 18:32:56','2016-09-06 11:17:19','2016-09-06 11:17:19'),(11,1,'adsfasdf','asdfdsaf','','','<p>asdfasdf<br></p>',0,'2016-07-31 18:33:17','2016-09-06 11:16:53','2016-09-06 11:16:53'),(12,1,'adsfasdf','asdfsdaf','','','<p>asfsadfsadf<br></p>',0,'2016-07-31 18:33:31','2016-09-06 11:16:25','2016-09-06 11:16:25'),(13,1,'fasdf','gfsdhg','','','<p>adsfasd<br></p>',0,'2016-07-31 18:38:18','2016-09-06 11:16:33','2016-09-06 11:16:33'),(14,1,'Ganjaroad FAQs','FAQs','San Francisco and Los Angeles Cannabis Industry professionals can increase their network. Questions? Get Marijuana-related answers to our services for Ganjaroad.\r\n','marijuana,dispensaries,doctors,delivery,grow stores,classified ads,news,information,Ganjaroad,Cannabis,hydroponics\r\n','<p>Please check below to see if your question is answered, if not please <a href=\"https://www.ganjaroad.com/contact\">contact us</a>.</p><p>&nbsp;</p><h3>I did not receive my Activation Link Email, what do I do?</h3><p>Please check your spam/junk folder for an email from do_not_reply@ganjaroad.com, if you do not see that please add do_not_reply@ganjaroad.com to your address book and <a href=\"http://www.ganjaroad.com/activation\" target=\"_blank\">click here</a> to resend the email.</p><h3>Is my information secure?</h3><div>Yes! &nbsp;Please view our <a href=\"https://ganjaroad.com/privacy-policy\" target=\"_blank\">Privacy Policy</a> and <a href=\"https://ganjaroad.com/terms\" target=\"_blank\">Terms of Service</a> for more details on how your information is used and stored.</div><h3>How do I place a Classified ad?</h3><ul><li><a href=\"http://www.ganjaroad.com/register\" target=\"_blank\">Create a free account</a></li><li>Activate your account using the link in your activation email</li><li>Login to your account</li><li>Go to My Account link in the upper right of the home page</li><li>Go to Add New Classified link under Useful Links on the left of the page</li><li>Complete the applicable fields, upload pictures, choose multiple cities, if desired, and click Publish</li><li>To show your ad in multiple cities choose Yes for Would you like to place this ad in multiple cities? and add as many cities as you desire.&nbsp; Note that there is discounted pricing for 5-9, 10-19 and 20+ cities</li><li>You can edit or unpublish your classified ad at any time &nbsp;</li><li>Classified ads will be automatically renewed and moved up the list every two weeks unless you unpublish the ad&nbsp;</li></ul><h3>How do I place an ad for my dispensary, delivery service, grow store or doctor office?</h3><ul><li><a href=\"http://www.ganjaroad.com/register\" target=\"_blank\">Create a free account</a></li><li>Activate your account using the link in your activation email</li><li>Login to your account</li><li>Go to My Account link in the upper right of the home page</li><li>Go to Add New Store, Dispensary, Delivery, Doctor, Grow Store Ad under Useful Links on the left of the page</li><li>Complete the applicable fields, upload pictures, create your menu and click Publish</li><li>To show your ad in multiple locations you must create a new ad for each map marker location</li><li>Our team will review and publish the ad after final approval</li><li>You can edit your Provider ad at any time &nbsp;</li><li>Near Me ads will be automatically renewed monthly unless you unpublish the ad<br /></li></ul><h3>How do I place a Banner Ad?</h3><ul><li><a href=\"http://www.ganjaroad.com/register\" target=\"_blank\">Create a free account</a></li><li>Activate your account using the link in your activation email</li><li>Login to your account</li><li>Go to My Account link in the upper right of the home page</li><li>Go to Add New Banner Ad under Useful Links on the left of the page</li><li>Image specs are Top: 730px W x 92px H, Bottom: 730px W x 92px H, Right: 170px W x 700px H<br /></li><li>Complete the applicable fields, upload your image and click Publish</li><li>Our team will review and publish the banner ad after final approval</li><li>Banner Ads are on a random rotation site-wide that refreshes with each page view</li><li>You can edit your Banner Ad monthly</li><li>Banner Ads will be automatically renewed monthly unless you unpublish the ad&nbsp;</li></ul><h3>How do I report illegal activity?</h3><p>If you find an ad that mentions illegal substances or activity please click on Report This Classified in the upper right corner of the ad.&nbsp; Our team will then be flagged to review the ad and take the appropriate action.</p><h3>Why is my device showing the wrong location?</h3><p>Your device and/or your browser may have your location disabled or your phone company is not providing the correct location. &nbsp;Either manually put in the area you are searching for in the Change My Location bar on the home page or search the internet for solutions to enable your location based on your type of computer/device and browser.<br /><br /><strong>Disclosure</strong></p><p>Ganjaroad.com and its affiliates (the \"Company\" or \"We\") affirms that it does not perform any due diligence on any information, ownership or content on any of the Company\'s clients or customers. The Company makes no claims as to the authenticity of third party information. The Company does not require verification or inspection of products or services provided, verification or state or local licensing status, and/or accuracy of information provided by clients, customers and/or third parties. The Company does not endorse, approve, certify, or control third party content and does not guarantee or assume responsibility for the accuracy of content provided by any third party. Information is provided for the convenience of site users and any claims or reference to storefronts legal status has not been verified.<br /></p>',1,'2016-09-14 00:18:38','2018-03-14 15:23:59',NULL),(15,1,'Strains','strains','','','<p>Stay tuned for a comprehensive strain database! &nbsp;Coming soon....</p><p><br /></p>',0,'2016-09-18 16:43:36','2016-12-06 00:11:34',NULL),(16,1,'Forums','forums','','','<p><span style=\"color: #373a3c; font-family: muliregular; font-size: 16px; text-align: justify;\">Stay tuned for our user forums! &nbsp;Coming soon....</span><br /></p>',0,'2016-09-18 16:44:39','2016-12-06 00:11:44',NULL),(17,1,'Reviews','reviews','','','<p><span style=\"color: #373a3c; font-family: muliregular; font-size: 16px; text-align: justify;\">Stay tuned for our product and provider user reviews! &nbsp;Coming soon....</span><br /></p>',0,'2016-09-18 16:44:59','2016-12-06 00:11:58',NULL),(18,1,'Medical Research','medical-research','','','<p><span style=\"color: #373a3c; font-family: muliregular; font-size: 16px; text-align: justify;\">Stay tuned for a comprehensive medical research database! &nbsp;Coming soon....</span><br /></p>',0,'2016-09-18 16:46:04','2016-12-06 00:12:09',NULL),(19,1,'Cannabis Industry Events','events','Find marijuana-related industry events worldwide and in San Diego, Los Angeles, and San Francisco, California, and Denver, Colorado on Ganjaroad.com.','marijuana,dispensaries,doctors,delivery,grow stores,classified ads,news,information,Ganjaroad,Cannabis,advertising,hydroponics, events\r\n','<h3 style=\"font-weight: normal; font-size: 12px;\"><span style=\"color: #373a3c; font-family: muliregular; font-size: 16px; text-align: justify;\">SORTED BY DATE</span></h3>\r\n<div style=\"font-weight: normal; font-size: 12px;\"><span style=\"color: #373a3c; font-family: muliregular; font-size: 16px; text-align: justify;\">(To add an event to this directory p