t=\"_blank\">Project CBD</a></h3><div>Founded in 2010, is a California-based educational nonprofit dedicated to defending and promoting whole plant cannabis therapeutics. Project CBD reports on cutting edge developments in cannabis science, medicine, and political economy. Our website is the premier, go-to resource for physicians, patients, industry professionals, policymakers, and others who seek accurate, up-to-date information about the medicinal properties of CBD and other components of the cannabis plant.<br /><br />CALIFORNIA<br /><a href=\"&#109;&#97;&#105;&#108;&#116;&#111;&#58;&#105;&#110;&#102;&#111;&#64;&#112;&#114;&#111;&#106;&#101;&#99;&#116;&#99;&#98;&#100;&#46;&#111;&#114;&#103;\" target=\"_blank\">info@projectcbd.org</a><br /><a href=\"https://www.projectcbd.org\" target=\"_blank\">www.projectcbd.org</a>&nbsp;</div><div>&nbsp;</div>\r\n<h3><a href=\"http://www.theroc.us\" target=\"_blank\">Realm of Caring</a></h3>\r\n<div>We improve lives through Research, Education, and Advocacy. By funding and conducting Research, we learn more about cannabis and its effects while legitimizing the therapy. Education empowers consumers to select the best products for their individual needs, and informs healthcare professionals about options for their patients. Through Advocacy, we spread the truth about cannabis and expand access to those in need. </div>\r\n<div>&nbsp;</div>\r\n<div>COLORADO SPRINGS, CO</div>\r\n<div>(719) 347-5400<br />\r\ninfo@theroc.us</div>\r\n<div><a href=\"https://www.theroc.us/\" target=\"_blank\">www.theroc.us</a></div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>',1,'2016-09-18 16:47:02','2017-05-18 16:48:30',NULL),(22,1,'Recipes','recipes','','','<span style=\"color: #373a3c; font-family: muliregular; font-size: 16px; text-align: justify;\">Stay tuned for a comprehensive recipe database! &nbsp;Coming soon....</span>',0,'2016-09-18 16:47:27','2016-12-06 00:30:18',NULL),(23,12,'Cannabis Industry Associations','associations','Find marijuana industry association directory in Los Angeles or San Francisco, California on Ganjaroad.com.','marijuana,dispensaries,doctors,delivery,grow stores,classified ads,news,information,Ganjaroad,Cannabis,hydroponics\r\n','<div>(<a href=\"https://www.ganjaroad.com/contact\">Contact us</a> with your Company Name, Short Description, Location, Email Address, and Phone Number to be included in this industry association directory)</div>\r\n<div>&nbsp;</div>\r\n<h3><a href=\"http://www.responsibleaccess.org\" target=\"_blank\">ARMA (Alliance for Responsible Medicinal Access)</a></h3>\r\n<div>The Alliance for Responsible Medicinal Access is a trade association dedicated to ensuring responsible, legal access to medicinal cannabis for patients and to promoting the common business interests of our members. We advocate for clear, reasonable laws and we steer our members to success in this rapidly evolving industry.</div>\r\n<div>&nbsp;</div>\r\n<div></div>\r\n<div><a href=\"http://www.responsibleaccess.org/\" target=\"_blank\">www.responsibleaccess.org</a></div>\r\n<div>&nbsp;</div>\r\n<h3><a href=\"http://www.cannabisprofessionals.org\" target=\"_blank\">Association of Cannabis Professionals</a>&nbsp;</h3>\r\n<p>Cannabis business-to-business trade association,<br />\r\nNetworking industry-related professionals to ensure success.&nbsp;</p>\r\n<div><a href=\"http://www.cannabisprofessionals.org/\" target=\"_blank\">www.cannabisprofessionals.org</a></div>\r\n<div>(858) 779-4215&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<h3><a href=\"http://www.cacannabisindustry.org\" target=\"_blank\">California Cannabis Industry Association</a></h3>\r\n<div>California\'s collective voice for the cannabis industry.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><a href=\"http://www.cacannabisindustry.org/\" target=\"_blank\">www.cacannabisindustry.org</a></div>\r\n<div>(866) 774-6932</div>\r\n<div>&nbsp;</div><h3><a href=\"http://mjba.net/\" target=\"_blank\"><img src=\"/uploads/sitefiles/MJBA_Official_Logo_Reversed_With_Tag__3_.jpg\" width=\"75\" height=\"41\" alt=\"\" />&nbsp;Marijuana Business Association</a></h3><div><span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;Times New Roman&quot;;\">The\r\nMarijuana Business Association has quickly established itself as the\r\nauthoritative trade resource for participants in the booming legal marijuana\r\nindustry. &nbsp;</span></div><div>&nbsp;</div><div><a href=\"http://mjba.net/\" target=\"_blank\">mjba.net</a>&nbsp;</div><div>&nbsp;</div>\r\n<h3><input type=\"image\" id=\"image1\" value=\"image1\" src=\"/uploads/sitefiles/2013_Logo_OCNorml.png\" height=\"25\" align=\"baseline\" size=\"20\" name=\"image1\" width=\"40\" /><a href=\"http://OrangeCountyNORML.org\" target=\"_blank\">Orange County NORML</a></h3>\r\n<div>Orange County NORML, a chapter of the National Organization for the Reform of Marijuana Laws, was founded in 2003. OC NORML is a 501(c)3 non profit organization which holds several educational meetings per month.</div><div><br /><a href=\"http://OrangeCountyNORML.org\" target=\"_blank\">OrangeCountyNORML.org</a><br /><a href=\"&#109;&#97;&#105;&#108;&#116;&#111;&#58;&#75;&#97;&#110;&#100;&#105;&#99;&#101;&#79;&#67;&#78;&#79;&#82;&#77;&#76;&#64;&#97;&#111;&#108;&#46;&#99;&#111;&#109;\" target=\"_blank\">KandiceOCNORML@aol.com</a> <br /><div>\r\n</div>\r\n&nbsp;</div>\r\n<h3><a href=\"http://womengrow.com\" target=\"_blank\">Women Grow</a></h3>\r\n<div>Women Grow was created to connect, educate, inspire and empower the next generation of cannabis industry leaders by creating programs, community and events for aspiring and current business executives. Founded in 2014 in Denver, Women Grow is a for-profit entity that serves as a catalyst for women to influence and succeed in the cannabis industry as the end of marijuana prohibition occurs on a national scale.</div>\r\n<div>&nbsp;</div>\r\n<div><a href=\"http://womengrow.com/\" target=\"_blank\">womengrow.com</a></div>\r\n<div>sandiego@womengrow.com</div>\r\n<div>&nbsp;</div>',1,'2016-10-05 21:31:31','2017-05-18 16:49:19',NULL),(24,12,'Ganjaroad Marketing Agreement','Marketing_Agreement','Please read the Marketing agreements. Cannabis Marketing partners must agree to the terms here. San Francisco Cannabis. Los Angeles Medical Marijuana.\r\n','marijuana,dispensaries,doctors,delivery,grow stores,classified ads,news,information,Ganjaroad,Cannabis,hydroponics\r\n','<p style=\"margin-top:10.0pt;margin-right:0in;margin-bottom:0in;margin-left:\r\n0in;margin-bottom:.0001pt;text-align:justify\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">This <strong><span style=\"font-variant-numeric: normal; font-variant-caps: small-caps;\">Internet Marketing And Sales <em>Agreement and Exhibit A hereto</em></span></strong>\r\n(collectively, this &#8220;<strong><em><u>Agreement</u></em></strong>&#8221;) is made and entered into\r\neffective as of <span style=\"background:yellow;\">______________________</span>,\r\n20<span style=\"background:yellow;\">____________</span>\r\n(&#8220;Effective Date&#8221;) by and between <span style=\"background:yellow\">Insert Client\r\nName Here</span> (&#8220;Client&#8221;), with an office at <span style=\"background:yellow\">Insert\r\nClient&#8217;s Address for Notice Here</span> and <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">International\r\nAccess Media, Inc. (&#8220;Provider&#8221;)</span>, with an office at <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1804 Garnet Ave #161, San Diego, California 92109 </span>and\r\na website located at </span><a href=\"http://www.ganjaroad.com/\" target=\"_blank\"><span style=\"