ze: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">&#8220;<em>Confidential\r\nInformation</em>&#8221;</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> means the information and materials of the parties that may be\r\nconfidential or proprietary or may contain valuable trade secrets and similar\r\nbusiness information, and are identified as such by the owner in a commercially\r\nreasonable manner.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">1.2</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">&#8220;<em>Services</em>&#8221;</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> means\r\ncreative services and services related to the design, development and\r\nimplementation of internet based marketing, including advertisement purchase\r\nand placement, direct mail via internet or conventional mail, and related\r\nservices, all as more particularly described in each sequentially numbered\r\nStatement of Work executed by both parties and attached to this <strong><em><u>Agreement</u></em></strong>.\r\nProvider will use commercially reasonable efforts to complete the Services on\r\nor before the &#8220;Completion Date&#8221; set forth in each Statement of Work.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">1.3</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">&#8220;<em>Statement\r\nof Work</em>&#8221;</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> means a document executed by the parties in connection with\r\ndiscrete advertising or marketing projects to be undertaken by Provider, which\r\nshall contain at a minimum the following information and be substantially in\r\nthe form attached hereto as Exhibit A: (a) a description of the Services and\r\nthe deliverables or work products to be produced by Provider (the &#8220;Work Product&#8221;);\r\n(b) a projected timetable by which the Work Product will be delivered,\r\nincluding a timetable for each party&#8217;s obligations required to meet that\r\ndelivery commitment; (c) Client&#8217;s special conditions of acceptance, if any; (d)\r\na description of required status reports and interim Client approvals, if any;\r\n(e) the commencement and termination dates of the Services; (f) price; and (g)\r\na payment schedule.</span></p>\r\n\r\n<p style=\"text-align:justify;text-indent:-20.0pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:38.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">2.</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Services.</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">2.1</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Client\r\nObligations.</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:74.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">2.1.1</span></strong>&nbsp;<span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Client shall provide Provider\r\nwith all information required in each Statement of Work within the timeframes\r\nset forth in the Statements.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:74.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">2.1.2</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">In\r\nconnection with the Services, Client hereby authorizes and grants Provider a\r\nlimited license to use Client&#8217;s trade and service names and marks, and will\r\ncause Client&#8217;s principal, if any, to grant the same limited license to use\r\nClient&#8217;s principal&#8217;s trade and service.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:38.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">3.</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Payments.</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">3.1</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">General.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> Client\r\nshall pay Provider in accordance with the terms of the Statement of Work.\r\nAdditional Services may be added to the scope of services hereunder only upon\r\nexecution of an amended Statement of Work by both parties specifying the\r\nservices, pricing and payment terms for such additional work.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">3.2</span></strong>&nbsp;<strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Transaction History and\r\n(Recurring) Payment.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> Client may review the amounts due in connection\r\nwith the Services as rendered by way of the &#8220;Transaction History&#8221; page on\r\nProvider&#8217;s Website, after logging into Client&#8217;s Account. The &#8220;Transaction\r\nHistory&#8221; page shall set forth the total amount paid and/or due. The\r\n&#8220;Transaction History&#8221; page in Client&#8217;s Account shall be deemed Provider&#8217;s\r\nConfidential Information. Payments are processed on a recurring basis according\r\nto the Services rendered pursuant to Exhibit A, Provider Statement of Work.\r\n&nbsp;If payment is not processed automatically through the Website, as in the\r\nevent that your credit card declined payment, Company will notify you and </span><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">provide a\r\nfive (5) day grace period before initiating termination pursuant to Par. 7 of\r\nthis Agreement.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">3.3</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Taxes.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> Client\r\nagrees to pay, and to indemnify and hold Provider and its service bureau\r\nproviders harmless from, any sales, use, excise, import or export, stamp, value\r\nadded or similar tax or duty not based on Provider&#8217;s or such providers income,\r\nproperty values, and business license taxes, as well as the collection or\r\nwithholding thereof, including penalties and interest, and all government\r\npermit or license fees and all customs or similar fees, levied upon the\r\nperformance of the Services by Provider and partners hereunder. The parties\r\nshall, at their own option and expense, have the right to seek administrative\r\nrelief, a ruling, judicial review or other appropriate review (in a manner\r\ndeemed appropriate by the party seeking such determination), as to the applicability\r\nof any tax, penalty or interest, or to protest any assessment and control any\r\nlegal challenge to such assessment, but shall be liable hereunder for any such\r\namount ultimately determined to be due. The parties agree to cooperate and\r\nprovide reasonable documentation toward the resolution of tax audits conducted\r\nby government taxing authorities relating to purchases under this <strong><em><u>Agreement</u></em></strong>.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:38.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">4.</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Representations\r\nand Warranties.</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">4.1</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Power and\r\nAuthority; Due Organization.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> Each party represents and\r\nwarrants that it is duly organized, validly existing and in good standing in\r\nits state of incorporation and/or operations, and has full power and authority\r\nto enter into this <strong><em><u>Agreement</u></em></strong> and to contract for the\r\nServices in accordance with the terms of this <strong><em><u>Agreement</u></em></strong>.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">4.2</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">On-line\r\nConduct Policy.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> Client acknowledges that it is Provider&#8217;s business policy to\r\nconduct e-mail and online campaigns in a manner so as not to: send unsolicited\r\nemail to Recipients (unless authorized by federal law), spam, misuse or\r\nmisappropriate other party&#8217;s trademarks, send obscene messages to Recipients or\r\nuse email to conduct illegal activities as per current law. Client represents,\r\nwarrants and covenants that: (a) any advertising content and/or product content,\r\nas defined in Exhibit A, (collectively the &#8220;Content&#8221;) is true, complete, and\r\naccurate and not misleading; (b) Client holds all necessary rights to permit\r\nthe use of said Content; (c) Said Content is in compliance with Provider&#8217;s\r\nspecifications and does not otherwise interfere with the function or\r\nperformance of Provider&#8217;s web site(s); (d) none of the Content will: (i)\r\ninfringe on any third party&#8217;s copyright, patent, trademark, trade secret or\r\nother proprietary rights or intellectual property rights, (ii) violate any law,\r\nstatute, ordinance or regulation, including without limitation the laws and\r\nregulations governing export control, the Civil Rights Act, the Fair Housing\r\nAct, the Americans with Disabilities Act and the Equal Credit and Protections Act,\r\n(iii) be defamatory or trade libelous, (iv) be pornographic, obscene or contain\r\nany nudity or other sexual materials, (v) contain viruses, Trojan horses,\r\nworms, time bombs, or other similar harmful programming routines, (vi) contain\r\nmaterial that is threatening, abusive, harassing, profane, indecent, or\r\notherwise objectionable or offensive, and/or (vii) contain hate propaganda or\r\nfraudulent material or activity. Client agrees that it will take no actions\r\ninconsistent with this policy and that it will make its principal(s) and/or\r\nagents aware of such policy. Client further agrees that it will cooperate with\r\nProvider in its efforts to respect Recipient&#8217;s privacy wishes and requests to\r\nbe unsubscribed from receiving email.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">4.3</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Limitations.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> Client\r\nacknowledges that Provider may, at some point now or in the future, retain\r\nthird-party service providers or subcontractors to perform portions of the\r\nServices. In such an event, Provider shall execute, and shall require its\r\nservice providers to execute, appropriate non-disclosure agreements and to use\r\ntheir commercially reasonable efforts to ensure that the Services are provided\r\nin a timely manner. Provider agrees that Client shall not be responsible for\r\nthe nonperformance by any of Provider&#8217;s third-party service providers or\r\nsubcontractors.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:38.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">5.</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Indemnity.</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">5.1</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Provider\r\nLimited Warranty.</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:74.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">5.1.1</span></strong><span style=\"font-size: 7pt;\">\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Provider\r\nLimited Warranty</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">. Provider warrants that it shall use commercially reasonable\r\nefforts to facilitate the Services being performed for Client by third-party service\r\nproviders or subcontractors. PROVIDER DISCLAIMS ALL OTHER WARRANTIES, EXPRESS\r\nOR IMPLIED, INCLUDING BUT NOT LIMITED TO THE IMPLIED WARRANTIES OF\r\nMERCHANTABILITY AND FITNESS FOR A PARTICULAR PURPOSE, WITH RESPECT TO THE\r\nSERVICES. NO ORAL OR WRITTEN INFORMATION OR ADVICE GIVEN BY PROVIDER, ITS\r\nAGENTS OR EMPLOYEES, SHALL CREATE A WARRANTY OR IN ANY WAY INCREASE THE SCOPE\r\nOF PROVIDER&#8217;S LIMITED WARRANTY.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:74.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">5.1.2</span></strong><span style=\"font-size: 7pt;\">\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Limited\r\nDamages</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">. NOTWITHSTANDING ANYTHING CONTAINED ELSEWHERE WITHIN OR WITHOUT\r\nTHIS <strong><em><u>AGREEMENT</u></em></strong> TO THE CONTRARY, IN NO EVENT SHALL PROVIDER\r\nBE LIABLE FOR CONSEQUENTIAL, INCIDENTAL, SPECIAL OR PUNITIVE DAMAGES OF ANY\r\nNATURE OR TYPE WHATSOEVER (INCLUDING, WITHOUT LIMITATION, ANY CLAIMS FOR LOST\r\nPROFITS, REVENUES OR INFORMATION), AND PROVIDER&#8217;S LIABILITY HEREUNDER (AS WELL\r\nAS THE LIABILITY OF ANY OFFICER, DIRECTOR, PARTNER, EMPLOYEE OR ANY OF\r\nPROVIDER&#8217;S SERVICE PROVIDERS AND THEIR RESPECTIVE OFFICERS, DIRECTORS, PARTNERS\r\nAND EMPLOYEES, AS THE CASE MAY BE) SHALL BE LIMITED IN ALL EVENTS TO AMOUNTS\r\nPAID TO PROVIDER BY CLIENT UNDER THIS <strong><em><u>AGREEMENT</u></em></strong>.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">5.2</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Client\r\nIndemnification.</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:74.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">5.2.1</span></strong><span style=\"font-size: 7pt;\">\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Client\r\nIndemnification of Provider</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">. Client shall indemnify Provider and its\r\nservice providers and hold Provider and its service providers harmless from and\r\nagainst any and all liabilities, lawsuits, damages, claims, payments,\r\njudgements, costs and expenses (including attorneys\' fees) suffered by or\r\nincurred by Provider as a result of any claim or cause of action arising out of\r\nor relating to: (a) Client&#8217;s performance of or failure to perform its\r\nobligations under this <strong><em><u>Agreement</u></em></strong>; (b) any breach of the\r\ncovenants, representations and warranties given to Provider by Client under\r\nthis <strong><em><u>Agreement</u></em></strong>; or (c) any claim or cause of action\r\nagainst Provider alleging that the content of any e-mail, on-line transmission\r\nor other distribution of any materials provided by Client sent pursuant to the\r\nterms of this <strong><em><u>Agreement</u></em></strong> infringes or violates the rights\r\nof any third party.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:38.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">6.</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Confidentiality.</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">6.1</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Non-Disclosure.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> The parties\r\nagree and shall cause their respective service providers and subcontractors to\r\nagree that they will not make use of, disseminate, or in any way disclose any\r\nConfidential Information to any person, firm or business, except as authorized\r\nby this <strong><em><u>Agreement</u></em></strong> and to the extent necessary for\r\nperformance of this <strong><em><u>Agreement</u></em></strong>. The parties represent that\r\nthey will exercise reasonable care to protect their own Confidential\r\nInformation.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:38.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">7.</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Term And\r\nTermination.</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">7.1</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Term.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> The term\r\nof this <strong><em><u>Agreement</u></em></strong> will commence on the Effective Date and\r\nwill continue for an indefinite period, unless terminated in accordance with\r\nthe provisions hereof.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">7.2</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Termination\r\nfor Cause.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> Any party may terminate this <strong><em><u>Agreement</u></em></strong> with\r\nfourteen (14) days&#8217; written notice for material breach of the <strong><em><u>Agreement</u></em></strong>\r\nby the other party; or:</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:74.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">7.2.1</span></strong><span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">If any\r\nparty ceases to do business, or otherwise terminates its business operations\r\nand provides a written attestation to that effect; or</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:74.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">7.2.2</span></strong><span style=\"font-size: 7pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">If any\r\nparty fails to promptly secure or renew any license, registration, permit,\r\nauthorization or approval for the conduct of its business in the manner\r\ncontemplated by this <strong><em><u>Agreement</u></em></strong> or if any such license,\r\nregistration, permit, authorization or approval is revoked or suspended and not\r\nreinstated within fourteen (14) days, and provides a written attestation to\r\nthat effect; or</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:74.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">7.2.3</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Effective\r\nimmediately and without notice if any party becomes insolvent or seeks\r\nprotection under any bankruptcy, receivership, trust deed, creditors\r\narrangement, composition or comparable proceeding, and provides a written\r\nattestation to that effect.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">7.3</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Rights\r\nupon Expiration or Termination.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> Upon termination of this <strong><em><u>Agreement</u></em></strong>,\r\nProvider will cease displaying Client&#8217;s advertisements on its Website within\r\nfive (5) days of nonpayment, and Client shall pay, in accordance with the terms\r\nhereof, the final outstanding balances due to Provider, if any.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">7.4</span></strong>&nbsp;<strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Survival.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> In the\r\nevent of the termination or expiration of this <strong><em><u>Agreement</u></em></strong>,\r\n(a) any accrued payment obligations, (b) any right of action for breach of this\r\n<strong><em><u>Agreement</u></em></strong> prior to termination and (c) all the rights and\r\nobligations pursuant to Section 1 (Definitions), 3 (Invoicing and Payment), 4\r\n(Representations and Warranties), 5 (Indemnification), 6 (Confidentiality), 7\r\n(Term and Termination) and 8 (General) will remain in effect.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:38.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">8.</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">General.</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">8.1</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">No\r\nAgency.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> Each party will in all matters relating to this <strong><em><u>Agreement</u></em></strong>\r\nact as an independent contractor. No party will have authority and will not\r\nrepresent that it has any authority to assume or create any obligation, express\r\nor implied, on behalf of any other, or to represent any other party as an\r\nagent, employee or in any other capacity. Neither execution nor performance of\r\nthis <strong><em><u>Agreement</u></em></strong> will be construed to have established any\r\nagency, joint venture or partnership.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">8.2</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Force\r\nMajeure.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> Any delay in or failure by Client or Provider in performance of\r\nthis <strong><em><u>Agreement</u></em></strong> shall be excused if and to the extent that\r\nsuch delay or failure is caused by occurrences beyond the reasonable control of\r\nthe affected party, including, but not limited to, acts of God, acts of\r\ngovernment, flood, fire, civil unrest, acts of terror, strikes or other labor\r\nproblems (other than those involving the Company&#8217;s or your employees,\r\nrespectively), computer attacks (by government/nation entities or otherwise) or\r\nmalicious acts, such as attacks on or through the Internet, any Internet\r\nservice provider, telecommunications or hosting facility. &nbsp;Dates by which\r\nperformance obligations are scheduled to be met will be extended for a period\r\nof time equal to the time lost due to any delay so caused. </span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">8.3</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Notices.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> All\r\nnotices, demands, consents, approvals or other communications permitted or\r\nrequired hereunder shall not be effective unless the same shall be in writing\r\nand delivered, or sent postage prepaid, by first class mail, with or without\r\nreturn receipt requested, or sent by an local or overnight courier service with\r\ntracking capabilities or emailed to the parties at their addresses shown below,\r\nand shall be deemed served when so delivered or deposited in the United States\r\nPostal Service, courier service and/or upon receipt of the email. Any party may\r\ndesignate by notice a new or different address, from time to time in accordance\r\nherewith.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-align:justify\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">IF TO\r\nPROVIDER:</span></strong></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-indent:.5in\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">International\r\nAccess Media, Inc.</span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-indent:.5in\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1804 Garnet Ave\r\n#161</span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-indent:.5in\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">San Diego,\r\nCalifornia 92109</span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-indent:.5in\"><a href=\"&#109;&#97;&#105;&#108;&#116;&#111;&#58;&#105;&#110;&#102;&#111;&#64;&#103;&#97;&#110;&#106;&#97;&#114;&#111;&#97;&#100;&#46;&#99;&#111;&#109;\" target=\"_blank\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; color: #1155cc; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">info@ganjaroad.com</span></a> </p>\r\n\r\n<p style=\"text-indent:.5in\">&nbsp;</p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-indent:.5in\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">IF TO CLIENT:</span></strong></p>\r\n\r\n<p style=\"text-indent:.5in\">&nbsp;</p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-indent:.5in\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; background: yellow;\">Insert Client\r\nName</span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-indent:.5in\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; background: yellow;\">Insert Client\r\nAddress</span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-indent:.5in\"><span style=\"font-size: 11pt; font-family: Arial, sans-serif; background: yellow;\">Insert Client\r\nEmail</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">8.4</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Arbitration,\r\nGoverning Law, &amp; Attorneys&#8217; Fees.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> ALL DISPUTES ARISING OUT OF OR\r\nRELATED TO THIS <strong><em><u>AGREEMENT</u></em></strong> OR ANY ASPECT OF THE\r\nRELATIONSHIP BETWEEN YOU AND THE COMPANY, WHETHER BASED IN CONTRACT, TORT,\r\nSTATUTE, FRAUD, MISREPRESENTATION OR ANY OTHER LEGAL THEORY, WILL BE RESOLVED\r\nTHROUGH FINAL AND BINDING ARBITRATION BEFORE A NEUTRAL ARBITRATOR INSTEAD OF IN\r\nA COURT BY A JUDGE OR JURY. &nbsp;YOU AND THE COMPANY HEREBY WAIVE THE RIGHT TO\r\nTRIAL BY A JURY. &nbsp;YOU AGREE THAT ANY ARBITRATION UNDER THIS AGREEMENT WILL\r\nTAKE PLACE ON AN INDIVIDUAL BASIS, AND THAT CLASS ARBITRATIONS AND CLASS\r\nACTIONS ARE NOT PERMITTED. &nbsp;YOU ARE EXPRESSLY AGREEING TO GIVE UP THE\r\nABILITY TO PARTICIPATE IN A CLASS ACTION. The arbitration will be administered\r\nby the American Arbitration Association under its Commercial Arbitration Rules\r\nand Mediation Procedures. &nbsp;Any arbitration hearing will be held in San\r\nDiego County, California. The applicable governing law will be California law\r\n(provided that with respect to arbitrability issues, federal arbitration law\r\nwill govern). The arbitrator&#8217;s decision will follow the terms of this Agreement\r\nand will be final and binding. The arbitrator will have authority to award\r\ntemporary, interim or permanent injunctive relief or relief providing for\r\nspecific performance of this Agreement, but only to the extent necessary to\r\nprovide relief warranted by the individual claim before the arbitrator. The\r\naward rendered by the arbitrator may be confirmed and enforced in any court\r\nhaving jurisdiction thereof. &nbsp;This clause shall not preclude the parties\r\nfrom seeking provisional remedies in aid of arbitration from a court of\r\nappropriate jurisdiction. &nbsp;In any arbitration proceeding to enforce rights\r\nunder this <strong><em><u>Agreement</u></em></strong>, the prevailing party will be\r\nentitled to recover costs and attorneys&#8217; fees. </span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">8.5</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Waiver.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> The\r\nfailure of any party to require performance by any other party of any provision\r\nhereof will not affect the full right to require such performance at any time\r\nthereafter; nor will the waiver by any party of a breach of any provision\r\nhereof be taken or held to be a waiver of the provision itself.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">8.6</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Severability.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> In the\r\nevent that any provision of this <strong><em><u>Agreement</u></em></strong> is found by a\r\ncourt or other body of competent jurisdiction to be unenforceable or invalid\r\nunder any applicable law such unenforceability or invalidity will not render\r\nthis <strong><em><u>Agreement</u></em></strong> unenforceable or invalid as a whole, and,\r\nin such event, such provision will be changed and interpreted so as to best\r\naccomplish the objectives of such unenforceable or invalid provision within the\r\nlimits of applicable law or applicable court decisions.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">8.7</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">Entire <em><u>Agreement</u></em>.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> This <strong><em><u>Agreement</u></em></strong>\r\nand the Exhibits hereto constitute the entire <strong><em><u>Agreement</u></em></strong>\r\nbetween the parties with respect to the subject matter hereof. This <strong><em><u>Agreement</u></em></strong>\r\nsupersedes, and the terms of this <strong><em><u>Agreement</u></em></strong> govern, any\r\nprior or collateral agreements with respect to the subject matter hereof with\r\nthe exception of any prior confidentiality agreements between the parties. This\r\n<strong><em><u>Agreement</u></em></strong> may only be changed by mutual, written agreement\r\nof authorized representatives of the parties.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:56.0pt;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-20.0pt\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">8.8</span></strong><span style=\"font-size: 7pt;\"> &nbsp;&nbsp;</span><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">No\r\nSolicitation/Non-Circumvention.</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\"> During the period beginning with\r\nthe Effective Date and ending twelve (12) months after the termination of this <strong><em><u>Agreement</u></em></strong>,\r\nneither party nor its affiliates will offer employment to or hire any employee\r\nof the other party or its affiliates without the prior written consent of the\r\nemploying party. For purposes of the preceding sentence, the terms &#8220;employment&#8221;\r\nand &#8220;employee&#8221; shall include any form of employment, consulting, contract\r\nrelationship, or other arrangement pursuant to which such individual will,\r\ndirectly or indirectly, perform services for the other party. Violation of this\r\nfirst provision of Section 8.8 shall subject the violating party to actual\r\ndamages. Further, Client agrees that it will not contract directly or\r\nindirectly with any of the service providers utilized by Provider to provide\r\nany of the Services under this <strong><em><u>Agreement</u></em></strong> for a period of\r\ntwelve (12) months following the termination of this <strong><em><u>Agreement</u></em></strong>\r\nunless such service provider had provided identical services to Client within\r\ntwelve (12) months prior to the execution of this <strong><em><u>Agreement</u></em></strong>.\r\nViolation of this second provision of Section 8.8 shall subject the violating\r\nparty to actual damages.</span></p>\r\n\r\n<p style=\"margin-top:6.0pt;margin-right:0in;margin-bottom:0in;margin-left:0in;\r\nmargin-bottom:.0001pt;text-align:justify\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">In Witness Whereof</span></strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">, the\r\nundersigned have caused this <strong><em><u>Agreement</u></em></strong> to be executed by\r\ntheir respective authorized representatives. This <strong><em><u>Agreement</u></em></strong>\r\nmay be executed in counterparts, each of which will be deemed an original, but\r\nall of which together will constitute one and the same original.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"border-collapse:collapse;\">\r\n <tbody><tr>\r\n  <td valign=\"top\" style=\"border:solid white 1.0pt;\r\n  padding:.75pt 5.25pt .75pt 5.25pt\">\r\n  <p style=\"margin:0in;margin-bottom:.0001pt;\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">CLIENT</span></strong></p>\r\n  </td>\r\n  <td valign=\"top\" style=\"border:solid white 1.0pt;border-left:none;padding:.75pt 5.25pt .75pt 5.25pt\">\r\n  <p style=\"margin:0in;margin-bottom:.0001pt;\"><strong><span style=\"font-size: 11pt; font-family: Arial, sans-serif;\">PROVIDER</span></strong></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td valign=\"top\" style=\"border:solid white 1.0pt;border-top:none;padding:.75pt 5.25pt .75pt 5.25pt\"></td>\r\n  <td valign=\"top\" style=\"border-top:none;border-left:none;border-bottom:solid white 1.0pt;\r\n  border-right:solid white 1.0pt;\r\n  padding:.75pt 5.25pt .75pt 5.25pt\"></td>\r\n </tr>\r\n <tr>\r\n  <td valign=\"top\" style=\"border:solid white 1.0pt;border-top:none;padding:.75pt 5.25pt .75pt 5.25pt\">\r\n  <p style=\"margin:0in;margin-bottom:.0